INSERT INTO `informations` (`id`, `name`, `slug`, `description`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Реферальная программа', 'referalnaya-programma', '<section class=\"referral\">\r\n<div class=\"container\">\r\n<div class=\"referral__inner\">\r\n<div class=\"referral__image\"><img src=\"https://unitedmarket.org/images/refferal.svg\" alt=\"\" />\r\n<div class=\"referral__texting\">\r\n<div class=\"referral__united\">UNITED MARKET</div>\r\n<div class=\"referral__program\">РЕФЕРАЛЬНАЯ ПРОГРАММА</div>\r\n</div>\r\n</div>\r\n<div class=\"referral__text\">\r\n<p>Добро пожаловать в Onion Market &ndash; сервис, объединяющий различные товары и сферы услуг по всей России.</p>\r\n<p>Мы работаем уже в 100 городах России и постоянно расширяем территорию нашего присутствия.</p>\r\n<p>Наша партнерская программа работает во всех городах нашего присутствия.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"start\">\r\n<div class=\"container\">\r\n<div class=\"start__inner\">\r\n<h2 class=\"start__title\">Чтобы стать нашим рефералом и начать зарабатывать вместе с нами, пройдите простые шаги:</h2>\r\n<div class=\"start__wrapper\">\r\n<div class=\"start__item\">\r\n<div class=\"start__name\">шаг 1</div>\r\n<div class=\"start__text\">Зарегистрируйтесь на нашей платформе</div>\r\n</div>\r\n<div class=\"start__item\">\r\n<div class=\"start__name\">шаг 2</div>\r\n<div class=\"start__text\">Скопируйте и отправьте реферальную ссылку из личного кабинета своему другу</div>\r\n</div>\r\n<div class=\"start__item\">\r\n<div class=\"start__name\">шаг 3</div>\r\n<div class=\"start__text\">Получите бонусы за первый оплаченный заказ вашим другом</div>\r\n</div>\r\n</div>\r\n<div class=\"start__description\">\r\n<p>По реферальной программе вы получите 500 бонусов на счет в личном кабинете после оплаты, приглашенным по вашей реферальной ссылке, другом.</p>\r\n<p>Бонусы, заработанные в партнерской программе, вы можете потратить на заказ товаров или услуг на нашей площадке, оплатив 50% от суммы заказа.</p>\r\n<p>Присоединяйтесь к нам!</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 1, '2021-09-09 11:10:00', '2021-09-10 10:38:16'),
(2, 'О нас', 'o-nas', '<section class=\"about\">\r\n<div class=\"container\">\r\n<div class=\"about__inner\">\r\n<div class=\"about__block\">\r\n<div class=\"about__image\"><img src=\"https://unitedmarket.org/images/about.svg\" alt=\"\" />\r\n<div class=\"about__texting\">\r\n<div class=\"about__united\">UNITED MARKET &ndash;</div>\r\n<div class=\"about__innovation\">\r\n<p>ИННОВАЦИИ</p>\r\n<p>ПРОГРЕСС</p>\r\n<p>ОПЫТ</p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"about__text\">\r\n<p>Onion Market - российская компания, целью которой является объединение предпринимателей и их компаний и клиентов на единой уникальной онлайн-платформе для увеличения количества заказов и объема прибыли с одной стороны, и для удобного и быстрого заказа товаров и услуг с другой. Onion Market предлагает сотрудничество с различными сферами бизнеса: цветы, еда, автосервис, клининг и пр. по всей России.</p>\r\n<p>Главная идея компании &ndash; обеспечить более легкий выход на онлайн-рынок для наших партнеров, ведь мы знаем, как тяжело и дорого продвигать свой бизнес в интернете самостоятельно. С Onion Market вам не нужно годами подбирать многочисленных специалистов в команду и тратить огромные средства на продвижение &ndash; здесь всё сделают за вас!</p>\r\n<p>Пока наши партнеры занимаются своим любимым делом, Onion Market обеспечит полную техническую поддержку и продвижение: мы берем на себя увеличение количества клиентов наших партнеров с помощью различных методов продвижения.</p>\r\n<p>Сейчас с компанией сотрудничают предприниматели из более чем 100 городов страны.</p>\r\n<p>Если вы хотите стать партнером компании и увеличить ключевые показатели вашего бизнеса &ndash; переходите на наш сайт и оставляйте заявку на сотрудничество. Мы свяжемся с вами в ближайшее время и обсудим все важные моменты нашего взаимодействия.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"benefits\">\r\n<div class=\"container\">\r\n<div class=\"benefits__inner\">\r\n<h2 class=\"benefits__title\">наши преимущества</h2>\r\n<div class=\"benefits__wrapper\">\r\n<div class=\"benefits__item\">\r\n<div class=\"benefits__blue\">\r\n<div class=\"benefits__num\">10+</div>\r\n<div class=\"benefits__what\">лет работы</div>\r\n</div>\r\n<div class=\"benefits__description\">Мы обладаем большим опытом в нашем деле. В сфере интернет-маркетинга мы успешно работаем с 2008 года</div>\r\n</div>\r\n<div class=\"benefits__item\">\r\n<div class=\"benefits__blue\">\r\n<div class=\"benefits__num\">100+</div>\r\n<div class=\"benefits__what\">партнеров</div>\r\n</div>\r\n<div class=\"benefits__description\">\r\n<p>Наша отличительная особенность - 1 партнер в одном городе.</p>\r\n<p>На данный момент мы заключили договора более чем в 100 городах</p>\r\n</div>\r\n</div>\r\n<div class=\"benefits__item\">\r\n<div class=\"benefits__blue\">\r\n<div class=\"benefits__num\">150+</div>\r\n</div>\r\n<div class=\"benefits__description\">Веб-сайты, приложения и продукты, запущенные нами.</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"milestones\">\r\n<div class=\"container\">\r\n<div class=\"milestones__inner\">\r\n<h2 class=\"milestones__title\">Основаные вехи развития компании Onion Market</h2>\r\n<div class=\"milestones__block\">\r\n<div class=\"milestones__name\">Основание компании Onion Market</div>\r\n<div class=\"milestones__wrapper\">\r\n<div class=\"milestones__item\">\r\n<div class=\"milestones__date\">07.2020</div>\r\n<div class=\"milestones__description\">Разработка и запуск проекта по доставке цветов umflowers.ru</div>\r\n<div class=\"milestones__description\">Запуск контекстной рекламы</div>\r\n<div class=\"milestones__description\">Создание аккаунтов в социальных сетях</div>\r\n<div class=\"milestones__description\">Участие в соревнованиях по бодибилдингу в Ростове Великом и Ярославле</div>\r\n<div class=\"milestones__description\">Участие в соревнованиях по бодибилдингу в Дзержинском</div>\r\n</div>\r\n<div class=\"milestones__item\">\r\n<div class=\"milestones__date\">01.2021</div>\r\n<div class=\"milestones__description\">Разработка CRM системы в части для руководителя call center</div>\r\n<div class=\"milestones__description\">Участие в соревнованиях по бодибилдингу в Воронеже</div>\r\n<div class=\"milestones__description\">Участие в соревнованиях по бодибилдингу в Москве и Санкт-Петербурге</div>\r\n<div class=\"milestones__description\">Разработка CRM системы в части для рекламы и маркетинга</div>\r\n<div class=\"milestones__description\">Участие в соревнованиях по бодибилдингу в Краснодаре и Сочи</div>\r\n<div class=\"milestones__description\">Разработка CRM системы в части для call-центра</div>\r\n</div>\r\n<div class=\"milestones__item\">\r\n<div class=\"milestones__date\">02.2021</div>\r\n<div class=\"milestones__description\">Разработка и запуск автоматизированной системы взаимодействия партнеров с клиентами</div>\r\n<div class=\"milestones__description\">Тестирование и запуск в работу личных кабинетов для партнера и клиента</div>\r\n</div>\r\n<div class=\"milestones__item\">\r\n<div class=\"milestones__date\">03.2021</div>\r\n<div class=\"milestones__description\">Разработка и запуск проекта по доставке еды umfood.ru</div>\r\n<div class=\"milestones__description\">Подключение от 10 партнеров по направлению еда</div>\r\n<div class=\"milestones__description\">Тестирование и запуск проекта по клинингу</div>\r\n</div>\r\n<div class=\"milestones__item\">\r\n<div class=\"milestones__date\">04.2021</div>\r\n<div class=\"milestones__description\">Разработка единой платформы для объединения 30 сфер бизнеса</div>\r\n<div class=\"milestones__description\">Увеличение количества представленных и работающих сфер до 5 штук</div>\r\n<div class=\"milestones__description\">Участие в соревнованиях по бодибилдингу в Сочи</div>\r\n<div class=\"milestones__description\">Участие в соревнованиях по бодибилдингу в Ростов-на-Дону</div>\r\n<div class=\"milestones__description\">Подключение от 10 партнеров по каждому направлению</div>\r\n</div>\r\n<div class=\"milestones__item\">\r\n<div class=\"milestones__date\">09.2021</div>\r\n<div class=\"milestones__description\">Планы: Запуск 30 сфер бизнеса на единой платформе, Разработка мобильного приложения, Создание полноценно работающих всех частей CRM системы</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"rinat\">\r\n<div class=\"container\">\r\n<div class=\"rinat__inner\">\r\n<div class=\"rinat__image\"><img src=\"https://unitedmarket.org/images/rinat.png\" alt=\"\" /></div>\r\n<div class=\"rinat__info\">\r\n<div class=\"rinat__text\">\r\n<p>Меня зовут Ринат, я основатель холдинговой компании Onion Market. Одно из первых, запущенных в компании направлений, &ndash; доставка цветов по России, причем каждый новый регион мы открываем с новым партнером. Сейчас мы сотрудничаем с партнерами в более чем 40 городах и очень ценим это сотрудничество.</p>\r\n<p>Мы тщательно следим за качеством предоставляемых услуг и обеспечиваем партнерам востребованность на рынке. Если вы хотите присоединиться к нашей команде и быть в числе лучших, то оставляйте заявку &ndash; я лично свяжусь с вами, и мы обсудим и проговорим ключевые моменты нашего сотрудничества.</p>\r\n<p>Я очень ценю личное знакомство с бизнес-партнерами &ndash; оно делает рабочие процессы более четкими и понятными. На нашей встрече я подробно объясню концепцию компании, а вы сможете получить ответы на все интересующие вас вопросы незамедлительно. Успейте принять правильное решение первым!</p>\r\n</div>\r\n<div class=\"rinat__btn partnerBtn\"><a href=\"#\">стать партнером</a></div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"team\">\r\n<div class=\"container\">\r\n<div class=\"team__inner\">\r\n<div class=\"contacts__item\">\r\n<div class=\"contacts__name\">Свяжитесь с нами</div>\r\n<ul class=\"contacts__media\">\r\n<li class=\"contacts__phone\">+7 999 333 54 01</li>\r\n<li class=\"contacts__mail\">hello@united-market.ru</li>\r\n<li class=\"contacts__map\">191123, Санкт-Петербург, ул. Маяковского 37. литера В, офис 20</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 1, '2021-09-10 10:43:00', '2021-09-13 09:03:46'),
(3, 'Пользовательское соглашение', 'polzovatelskoe-soglashenie', '<section class=\"agreement\">\r\n<div class=\"container\">\r\n<div class=\"agreement__inner\">\r\n<h2 class=\"agreement__title\">Пользовательское соглашение</h2>\r\n<div class=\"agreement__text\">\r\n<p>г.Санкт-Петербург<br />ред. от 06.08.2021</p>\r\n<p>1.Общие положения</p>\r\n<p>1.1.Настоящим Пользовательским Соглашением (далее по тексту-&laquo;Соглашение&raquo;) регулируется порядок использования Пользователями Сайта а равно подсайтов с доменным именем unitedmarket.org, а также совершение покупок Товаров на Сайте.&lt; 1.2. Пользуясь Сайтом и его Сервисами, Пользователь сети Интернет тем самым принимает и соглашается с условиями настоящего Пользовательского Соглашения, Иных Правил и применимого законодательства. Соглашение вступает в силу с момента ознакомления с его условиями и выражения согласия Пользователем при регистрации Личного кабинета пользователя и при совершении действий, направленных на дальнейшее использование функциональных возможностей Сайта.&lt; 1.3. Администрация сайта просит внимательно ознакомиться с Пользовательским Соглашением, Иными Правилами и применимым законодательством.&lt; 1.4.Сайт unitedmarket.org является собственностью ООО &laquo;ЮНАЙТЕД МАРКЕТ&raquo;, ОГРН 1207800103004 (далее по тексту-&laquo;Правообладатель&raquo;).&lt; 1.5.Правообладатель оставляет за собой право в любой период изменять и редактировать настоящее соглашение без уведомления Пользователя.&lt; 1.6. В соответствии с положениями статьи 435 Гражданского кодекса РФ, данное соглашение является офертой. Использование Сайта Пользователем означает безусловное принятие, а именно-акцепт и исполнение условий Соглашения, действующих в редакции на момент пользования Сайтом.&lt; 1.7. В случае, если Пользователь не достиг 18-летнего возраста, ознакомиться с настоящим соглашением, осуществить регистрацию личного кабинета должны его законные представители. Пользование сайтом и сервисом должно осуществляться в порядке, предусмотренном п.1.2. настоящего соглашения.&lt; 1.8.Пользователь дает согласие не предпринимать действий, которые могут быть рассмотрены как нарушающие нормы законодательства Российской Федерации или нормы международного права, в том числе в сфере интеллектуальной собственности, авторских и/или смежных прав, а также иных действий, которые могут привести к нарушению нормального функционирования сайта.&lt; 1.9.Использование материалов Сайта без согласия Правообладателя не допускается.</p>\r\n<p>2.Понятийный аппарат</p>\r\n<p>2.1.Администрация сайта- ответственное лицо, выступающее уполномоченным представителем Правообладателя Сайта, действующее от его имени и в его Интересах.<br />2.2.Контент-любая информация в любой форме (включая текст, фотографии, графические изображения, аудиовизуальные произведения), размещаемая, воспроизводимая, доводимая до всеобщего сведения или индивидуального сведения Пользователя на Сайте.<br />2.3.Личный кабинет-закрытая часть Сайта, представляющая собой совокупность защищенных страниц на Cайте, создаваемых при активации Личного кабинета и содержащих данные Пользователя на Сайте, в которых Пользователю доступны предоставляемые на Сайте Сервисы.<br />2.4. Сайт-размещенный в сети Интернет массив связанных данных,с доменным именем unitedmarket.org, предназначенный для автоматизации сервисных центров, содержащий информацию о Товарах и Услугах, продаваемых Торговыми партнерами, позволяющий Пользователю искать, просматривать информацию о Товарах и Услугах, предлагаемых Пользователям Торговыми партнерами для покупки, заказывать и покупать Товары и Услуги.<br />2.5.Содержание сайта-охраняемые результаты интеллектуальной деятельности, включая Контент, тексты произведений, их названия, предисловия, аннотации, статьи, иллюстрации, обложки, музыкальные произведения с текстом или без текста, аудиовизуальные, графические, текстовые, фотографические, производные, составные и иные произведения, пользовательские интерфейсы, визуальные интерфейсы, названия товарных знаков, логотипы, программы для ЭВМ, базы данных, а также дизайн, структура, выбор, координация, внешний вид, общий стиль и расположение данного Содержания Сайта, входящего в состав Сайта и другие объекты интеллектуальной собственности все вместе и/или по отдельности, содержащиеся на Сайте.<br />2.6.Пользовательское соглашение-настоящий документ в текущий редакции со всеми изменениями и дополнениями, размещенный на сайте Правообладателя с использованием доменного имени unitedmarket.org.<br />2.7. Пользователь- физическое лицо из числа неограниченного круга лиц, осуществляющее правомерный доступ к Сайту посредством сети Интернет и обладающее достаточным объемом прав для совершения сделок на Сайте.<br />2.8. Покупатель - Пользователь, совершивший покупку товара на условиях настоящего Соглашения и в части, относящейся к покупке товара- на условиях иных документов, размещенных на сайте, а также с учетом действующего законодательства.<br />2.9. Регистрация-совокупность действий Пользователя, направленных на формирование Учетных данных, формируемых с использованием специальной формы Сайта в целях создания Личного кабинета и получения доступа к определенным Сервисам Сайта.<br />2.10.Регистрационные данные- данные Пользователя, самостоятельно указанные при регистрации на Сайте, которые хранятся в информационных базах Администрации сайта с использованием исключительно в соответствии с настоящим Соглашением и действующим законодательством.<br />2.11. Сведения- любые материалы и информация, предоставляемая Пользователем в связи с использованием Сайта.<br />2.12.Товары- товары, информация о которых размещается на Сайте с целью их последующей реализации Покупателю в порядке и на условиях, установленных настоящим Соглашением, иными актами и действующим законодательством.<br />2.13.Торговый партнер- физическое лицо (а равно в статусе самозанятого, индивидуального предпринимателя) или юридическое, зарегистрированное в соответствии с применимым законодательством, объявлен