ия прав несовершеннолетних граждан;<br />-некорректного сравнения услуг, предоставляемых с использованием Сайта с услугами, предоставляемыми другими лицами, в том числе при помощи интернет-ресурсов.<br />5.3.Пользователю запрещается:<br />&bull; использовать любые устройства, программы, процедуры, алгоритмы и методы, автоматические устройства или эквивалентные ручные процессы для доступа, приобретения, копирования или отслеживания Содержания Сайта; <br />&bull; любым способом обходить навигационную структуру Сайта для получения или попытки получения любой информации, документов или материалов любыми средствами, которые специально не представлены Сервисами данного Сайта;<br />&bull; осуществлять несанкционированный доступ к функциям Сайта, любым другим системам или сетям, относящимся к данному Сайту, а также к любым Услугам;<br />&bull; нарушать систему безопасности или аутентификации на Сайте или в любой сети, относящейся к Сайту; &bull; выполнять обратный поиск, отслеживать или пытаться отслеживать любую информацию о любом другом Пользователе Сайта;<br />&bull; использовать Сайт и Содержание Сайта в любых целях, запрещенных применимым законодательством, а также подстрекать к любой незаконной деятельности или другой деятельности, нарушающей права Администрации сайта или других лиц;<br />&bull; передавать (сообщать) третьим лицам свои логин и/или пароль, используемые для доступа к своему Личному кабинету;<br />&bull; незаконно загружать, хранить, публиковать, распространять и предоставлять доступ или иным образом использовать интеллектуальную собственность третьих лиц.<br />5.4.Администрация сайта имеет право:<br />&bull; в любое время в одностороннем порядке по своему усмотрению без указания причин и без получения на то чьего-либо согласия, а также без какого-либо специального уведомления Пользователя изменять и/или дополнять настоящее Пользовательское Соглашение. Измененное и/или дополненное таким образом Пользовательское Соглашение в новой редакции вступает в силу