тствующие законодательству РФ.</p>\r\n<p>6.Порядок оформления заказа и его оплата.<br />6.1. Товарное предложение в Объявлении, размещаемое Торговым партнером является официальным публичным предложением Торгового партнера, адресованным Покупателям &ndash; физическим лицам, заключить договор купли-продажи на Товары и договора оказания Услуг.<br />6.2. Заказ Товара и Услуг оформляется Покупателем самостоятельно на Сайте через свой Личный кабинет. Для оформления Заказа Покупатель должен:<br />&bull; зарегистрироваться и авторизоваться на Сайте;<br />&bull; выбрать интересующий Товар или Услугу, нажав на картинку соответствующего Объявления, а затем кнопку &laquo;Купить&raquo;; <br />&bull; указать количество Товара и иные индивидуальные признаки Товара, указание которых является необходимым условием для заключения договора купли-продажи Товара;<br />&bull; нажать на кнопку &laquo;Оформить Заказ&raquo; и заполнить форму Заказа (указать контактную информацию, адрес доставки и время доставки Товара, выбрать способ оплаты, заполнить другие поля формы); <br />&bull; нажать на кнопку &laquo;Оформить Заказ&raquo;. Договор купли-продажи между Покупателем и Торговым партнером считается заключенным с момента нажатия на кнопку &laquo;Оформить Заказ&raquo;, если данное условие не противоречит применимому законодательству.<br />6.3. Покупатель вправе оформить Заказ на любой Товар или Услугу, представленную на Сайте. Особенности Заказа конкретного Товара или Услуги указываются в соответствующем Объявлении.<br />6.4. После оформления Заказа на адрес электронной почты Покупателя отправляется письмо с указанием наименований выбранных Товаров или Услуг, их количества и общей суммы оплаты. <br />6.5. Покупателю, оформившему Заказ, предоставляется возможность осуществить оплату Товара (включая их доставку Покупателю) или Услуг одним из способов:<br />&bull; предварительная оплата Товара через оператора электронный платежей на Сайте (при этом, на адрес электронной почты Покупателя направляется онлайн-чек, а на номер телефона Покупателя &ndash; смс-сообщение с подтверждением оформления Заказа; <br />&bull; иными способами (при наличии технической возможности осуществления оплаты такими способами, что будет уточняться при оформлении Заказа Покупателем).<br />6.6. Указанная на Сайте Цена Товара или Услуги и стоимость доставки Товара или Услуги не могут быть изменены после Заказа Товара или Услуги на Сайте.<br />6.7. Покупатель вправе отказаться от Товара в любое время до его передачи, а после передачи Товара - в течение срока, установленного применимым законодательством.</p>\r\n<p>7. Ответственность сторон<br />7.1. Любые убытки, которые Пользователь может понести в случае умышленного или неосторожного нарушения любого положения настоящего Соглашения, а также вследствие несанкционированного доступа к коммуникациям другого Пользователя, Администрацией сайта не возмещаются.<br />7.2. Пользователь согласен с тем, что Администрация Сайта не несет ответственности и не имеет прямых или косвенных обязательств перед Пользователем в связи с любыми возможными или возникшими потерями или убытками, связанными с любым содержанием Сайта, регистрацией авторских прав и сведениями о такой регистрации, товарами или услугами, доступными на или полученными через внешние сайты или ресурсы либо иные контакты Пользователя, в которые он вступил, используя размещенную на Сайте информацию или ссылки на внешние ресурсы.<br />7.3. Администрация сайта не несет ответственности за:<br />7.3.1. Задержки или сбои в процессе совершения операции, возникшие вследствие непреодолимой силы, а также любого случая неполадок в телекоммуникационных, компьютерных, электрических и иных смежных системах. <br />7.3.2. Действия систем переводов, банков, платежных систем и за задержки связанные с их работой.<br />7.3.3. Надлежащее функционирование Сайта в случае, если Пользователь не имеет необходимых технических средств для его использования, а также не несет никаких обязательств по обеспечению пользователей такими средствами.<br />7.4.Администрация сайта не несет ответственность за качество, безопасность и любые другие потребительские свойства предлагаемых к реализации Товаров и Услуг, а также за правомерность размещения предложений об их продаже, если это условие не противоречит применимому законодательству.<br />7.5. Сайт может содержать ссылки на интернет-сайты (гиперссылки, баннеры) и любой Контент, принадлежащий третьим лицам. Администрация сайта не несет ответственность за любую информацию, размещенную на сайтах третьих лиц, к которым Пользователь получил доступ посредством Сайта.<br />7.6. Пользователь несет в соответствии с применимым законодательством полную ответственность за собственные действия и бездействие при использовании Сайта. Пользователь обязуется прекратить использование Сайта в случае несогласия с какими-либо условиями настоящего Пользовательского Соглашения, Иных Правил или применимого законодательства (в том числе, при несоответствии физического лица тому понятию Пользователя, которое дано в п. 2.5. настоящего Пользовательского Соглашения).<br />В случае нарушения Пользователем применимого законодательства, настоящего Пользовательского Соглашения или Иных Правил ответственность (как имущественную, так и неимущественную) за такие нарушения (как действия, так и бездействие) несут или Пользователь (включая лицо, которое, не соответствуя понятию Пользователя, изложенному в п.2.5. Пользовательского Соглашения, осуществляло права и возлагало на себя обязанности Пользователя), или его родители, усыновители, попечители, опекуны, иные органы и организации, несущие ответственность за совершаемые таким лицом сделки. Также в соответствии с применимым законодательством эти лица отвечают за вред, причиненный несовершеннолетним или недееспособным Пользователем Администрации сайта, Торговому партнеру или другим Пользователям при пользовании Сайтом. <br />Если у совершеннолетнего Пользователя существуют какие-либо ограничения, связанные с возможностью размещать на Сайте Заказы и заключать договоры купли-продажи Товаров на Сайте, то всю ответственность (имущественную и неимущественную) за действия/бездействия такого Пользователя на Сайте несут его родители, усыновители, опекуны или попечители или иные органы и организации, несущие ответственность за совершаемые таким лицом сделки.</p>\r\n<p>8.Нарушение пользовательского соглашения<br />8.1. Администрация сайта вправе без предварительного уведомления Пользователя прекратить и (или) заблокировать доступ к Сайту, если Пользователь нарушил настоящее Соглашение или содержащиеся в иных документах условия пользования Сайтом, а также в случае прекращения действия Сайта либо по причине технической неполадки или проблемы. <br />8.2. Администрация сайта не несет ответственности перед Пользователем или третьими лицами за прекращение доступа к Сайту в случае нарушения Пользователем любого положения настоящего Соглашения или иного документа, содержащего условия пользования Сайтом.<br />8.3. Администрация сайта имеет право раскрыть любую информацию о Пользователе, которую посчитает необходимой для выполнения положений применимого законодательства или судебных решений, обеспечения выполнения условий настоящего Соглашения, иных правил, защиты прав и/или безопасности Администрации сайта, Торговых партнеров, других Пользователей или третьих лиц.</p>\r\n<p>9.Порядок разрешения споров<br />9.1.Администрация сайта прикладывает все усилия для того, чтобы не допустить на Сайте нарушений чьих-либо прав.<br />9.2. В случае, если Пользователь или иное лицо считают, что Администрацией сайта каким либо образом нарушены его права, такое лицо может с целью урегулирования возникшего конфликта в досудебном порядке обратиться к Администрации сайта, направив свою претензию или на адрес электронный почты Администрации сайта, указанный в разделе 11 Соглашения, или через форму обратной связи в Личном кабинете. <br />9.3. Претензия направляется в отсканированном виде с подписью или лица, которое считает, что его права нарушены, или его представителя по доверенности на тот адрес электронной почты Администрации сайта, который указан в разделе 11 Соглашения. <br />9.4. Для того, чтобы у Администрации сайта была возможность рассмотреть полученную претензию по существу и направить на нее ответ, в направляемой претензии нужно указать следующие сведения:<br />&bull; информацию о лице, которое считает, что его права нарушены, в связи с чем оно и предъявляет претензию (полные ФИО, паспортные данные, место жительства);<br />&bull; если претензия подписана представителем лица, которое считает, что его права нарушены &ndash; информацию и о таком лице, и о представителе этого лица (полные ФИО, паспортные данные, место жительства), а также отсканированную копию документа, подтверждающего полномочия такого представителя);<br />&bull; какие именно права нарушены и в чем именно выразилось нарушение прав;<br />&bull; в каких именно действиях Администрации сайта выразилось нарушение прав;<br />&bull; страница Сайта, на которой, по мнению лица, предъявляющего претензию, нарушены его права;<br />&bull; контактные данные для связи или с лицом, которое считает, что его права нарушены, и/или для связи с его представителем (почтовый адрес, номер телефона, адрес электронной почты и т.п.); <br />&bull; иные данные лица, считающего, что его права нарушены, которые необходимы для рассмотрения претензии по существу (например, реквизиты банковского счета такого лица и/или банковской карты такого лица - в случае, если претензия связана с возвратом денежных средств); <br />&bull; иные данные (по желанию Пользователя);<br />&bull; дата и подпись лица, предъявляющего претензию, или подпись представителя такого лица. <br />9.5. Администрация сайта в течение 30 (тридцати) календарных дней со дня получения претензии письменно уведомляет лицо, предъявившее претензию, о результатах ее рассмотрения. <br />9.6. Урегулирование претензии Пользователя к Торговому партнеру или претензии Торгового партнера к Пользователю, если такая претензия возникла в связи с исполнением заключенного между ними договора купли-продажи Товара, не относится к компетенции Администрации сайта. Пользователь и Торговый партнер урегулируют такие претензии самостоятельно без участия Администрации сайта.<br />9.7.При невозможности разрешить спор в досудебном порядке любая из сторон вправе обратиться в суд за защитой своих прав в соответствии с общими правилами подсудности.</p>\r\n<p>10.Заключительные положения<br />10.1. Администрация сайта не принимает встречные предложения от Пользователя относительно изменений настоящего Пользовательского соглашения.<br />10.2. Отзывы Пользователя, размещенные на Сайте, не являются конфиденциальной информацией и могут быть использованы Администрацией сайта без ограничений. <br />10.3. Администрация сайта вправе делать ссылку (в том числе размещать их на сайте) на товарные знаки, знаки обслуживания и фирменные наименования Пользователей, имеющих личные кабинеты на сайте, с целью обозначения круга пользователей. <br />10.4. Настоящим Пользователь выражает свое согласие на получение от Администрации сайта рекламных материалов, связанных с продвижением предоставляемых услуг, путем осуществления прямых контактов с использованием всех средств связи, включая, но не ограничиваясь: почтовая рассылка, СМС-рассылка, голосовая рассылка, рассылка электронных писем. <br />10.5. Настоящее Соглашение вступает в силу с момента его размещения на Сайте unitedmarket.org если иное не предусмотрено новой редакцией Пользовательского соглашения.<br />11.Контактные данные правообладателя<br />Общество с ограниченной ответственностью &laquo;Юнайтед Маркет&raquo;<br />Юридический адрес: 191123, Россия, г.Санкт-Петербург, ул.Маяковского, д.37, литер В, помещение 20-Н.<br />ИНН 7841090220/ КПП 784101001<br />ОГРН 1207800103004</p>\r\n<p>Банковские реквизиты:<br />р/сч 4070281071000072036<br />в АО &laquo;ТИНЬКОФФ БАНК&raquo;<br />ИНН банка 7710140679<br />БИК 044525974<br />к/сч 30101810145250000974</p>\r\n<p>Контактные данные:<br />Конт. Тел. +7&nbsp;999&nbsp;333 54 01<br />Эл.адрес: hello@united-market.ru<br />Генеральный директор: Лихая Елизавета Руслановна</p>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 1, '2021-09-11 10:46:00', '2021-09-11 10:47:03'),
(4, 'Действующим партнерам', 'dejstvuyushim-partneram', '<section class=\"currentPartner\">\r\n<div class=\"container\">\r\n<div class=\"currentPartner__inner\">\r\n<div class=\"currentPartner__text\">Если вы еще не являетесь партнером Onion Market, переходите в раздел <a href=\"#\">Сотрудничество</a></div>\r\n<h2 class=\"currentPartner__title\">Как загрузить товар на сайт?</h2>\r\n<div class=\"currentPartner__wrapper\">\r\n<div class=\"currentPartner__item\">\r\n<div class=\"currentPartner__step\">1. Войти или зарегистрироваться</div>\r\n<div class=\"currentPartner__description\">\r\n<p>Загрузить товар можно только в личном кабинете. Войдите или зарегистрируйтесь на Onion Market</p>\r\n</div>\r\n<div class=\"currentPartner__image\"><img src=\"https://unitedmarket.org/images/currentPartnerOne.svg\" alt=\"\" /></div>\r\n<div class=\"currentPartner__image currentPartner__image--mob\"><img src=\"https://unitedmarket.org/images/currentPartnerOneMob.svg\" alt=\"\" /></div>\r\n</div>\r\n<div class=\"currentPartner__item\">\r\n<div class=\"currentPartner__step\">2. Перейдите в личном кабинете в разделе Загрузка Товаров (Услуг)</div>\r\n<div class=\"currentPartner__description\">\r\n<p>Нажмите на кнопку Загрузить товар</p>\r\n</div>\r\n<div class=\"currentPartner__image\"><img src=\"https://unitedmarket.org/images/currentPartnerTwo.svg\" alt=\"\" /></div>\r\n<div class=\"currentPartner__image currentPartner__image--mob\"><img src=\"https://unitedmarket.org/images/currentPartnerTwoMob.svg\" alt=\"\" /></div>\r\n</div>\r\n<div class=\"currentPartner__item\">\r\n<div class=\"currentPartner__step\">3. Загрузите информацию о товаре (услуге)</div>\r\n<div class=\"currentPartner__description\">\r\n<p>В открывшемся окне загрузите фото товара (услуги) и заполните все поля с данными о товаре (услуге).</p>\r\n<p>Если у вашего товара (услуги) несколько вариаций, от которых зависит стоимость товара, нажмите на Добавить</p>\r\n<p>Конфигурацию, заполните поля Конфигурация (например, размер в см ) и Цена. Нажмите на кнопку Отправить.</p>\r\n</div>\r\n<div class=\"currentPartner__image\"><img src=\"https://unitedmarket.org/images/currentPartnerThree.svg\" alt=\"\" /></div>\r\n<div class=\"currentPartner__image currentPartner__image--mob\"><img src=\"https://unitedmarket.org/images/currentPartnerThreeMob.svg\" alt=\"\" /></div>\r\n</div>\r\n<div class=\"currentPartner__item\">\r\n<div class=\"currentPartner__step\">4. Модерация</div>\r\n<div class=\"currentPartner__description\">\r\n<p>По завершению загрузки данных о товаре (услуге), информация будет отправлена на рассмотрение модератора. После подтверждения модератором товары (услуги) появятся на сайте</p>\r\n</div>\r\n<div class=\"currentPartner__image\"><img src=\"https://unitedmarket.org/images/currentPartnerFour.svg\" alt=\"\" /></div>\r\n<div class=\"currentPartner__image currentPartner__image--mob\"><img src=\"https://unitedmarket.org/images/currentPartnerFourMob.svg\" alt=\"\" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n<section class=\"contacts contacts--partner\">\r\n<div class=\"container\">\r\n<div class=\"contacts__inner\">\r\n<h2 class=\"contacts__title\">Если у Вас остались вопросы, вы можете связаться с нами</h2>\r\n<div class=\"contacts__wrapper\">\r\n<div class=\"contacts__item\">\r\n<div class=\"contacts__name\">\"ООО &laquo;ЮНАЙТЕД МАРКЕТ&raquo;</div>\r\n<ul>\r\n<li>ИНН 7841090220</li>\r\n<li>КПП 784101001</li>\r\n<li>ОГРН 1207800103004</li>\r\n<li>Юридический адрес: 191123, Россия, г. Санкт- Петербург, ул. Маяковского, д. 37, стр. литера В, пом. 20-Н</li>\r\n</ul>\r\n</div>\r\n<div class=\"contacts__item\">\r\n<div class=\"contacts__name\">Свяжитесь с нами</div>\r\n<ul class=\"contacts__media\">\r\n<li class=\"contacts__phone\">+7 999 333 54 01</li>\r\n<li class=\"contacts__mail\">hello@united-market.ru</li>\r\n<li class=\"contacts__map\">191123, Санкт-Петербург, ул. Маяковского 37. литера В, офис 20</li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>', 1, '2021-09-11 10:52:21', '2021-09-11 10:52:21');
