INSERT INTO `products` (`id`, `name`, `partner_id`, `description`, `short_description`, `price`, `sku`, `stock_status`, `quantity`, `image`, `status`, `moderated`, `slug`, `category`, `created_at`, `updated_at`) VALUES
(50, 'delete Букет &quot;Сердце&quot;', 0, '&lt;p&gt;Роза, как известно,− источник поэтического вдохновения, символ женственности и красоты. Поэтому любящее сердце собрано только из этих цветов. Оно чистое и светлое, что свидетельствует об искренности чувств. Кайма из пурпурных бархатистых и томных красавиц все же придает композиции страстный оттенок. Если вы испытываете сердечное томление, оно обязательно передастся вашей возлюбленной.&lt;br&gt;&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Каркас - 1&lt;/p&gt;&lt;p&gt;Лента (Красный) - 1&lt;/p&gt;&lt;p&gt;Роза 60 см (Красный) - 12&lt;/p&gt;&lt;p&gt;Роза 60 см (Белый) - 17&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 5880, '', 'instock', 998, 'catalog/flow/17.jpg', 0, 1, 'Сердце из розы', 'Доставка букетов', '2020-09-04 17:57:54', '2020-12-19 18:58:02'),
(51, 'delete Композиция &quot;Нежное сердце&quot;', 0, '&lt;p&gt;Такое сердце заставит вашу любимую замереть от восторга! Розы с их нежной окраской, оригинальной формой и великолепной фактурой – самые привлекательные цветы для создания подобных эффектных композиций. Превосходным флористическим решением является сочетание крупных и миниатюрных бутонов. Букет в розовых тонах - подарок для молодой женщины.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента большая - 1&lt;/p&gt;&lt;p&gt;Роза 60 см (розовая) - 11&lt;/p&gt;&lt;p&gt;Роза кустовая (розовая) - 10&lt;/p&gt;&lt;p&gt;Роза кустовая (белая) - 25&lt;/p&gt;&lt;p&gt;Пиафлор сердце - 1&amp;nbsp;&lt;/p&gt;', '', 6560, '', 'instock', 999, 'catalog/flow/18.jpg', 0, 1, 'Розовые розы', 'Доставка букетов', '2020-09-04 18:32:18', '2020-12-19 19:15:09'),
(52, 'Счастье', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Cостав:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гербера (оранжевая) - 3&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гиперикум (красный) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (красная) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза кустовая (оранжевая) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Фисташки зелень - 4&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Пленка (красная) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза 50 см (красная) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '002001', 'instock', 1000, 'catalog/flow/22.jpg', 1, 1, 'Счастье', 'Доставка букетов', '2020-09-04 18:54:03', '2021-02-19 17:33:36'),
(53, 'delete Букет &quot;Ривьера&quot;', 0, '&lt;p&gt;Создать хорошее настроение мужчине можно с помощью полноцветного букета, контрастного и сильного. Весёлые краски лета словно зовут и манят за собой, дарят радость и позитив.&lt;/p&gt;&lt;p&gt;Введение в образ отдельно выделяющихся стеблей вместе с каскадной структурой делает композицию динамичной и целеустремлённой.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Cостав:&lt;/p&gt;&lt;p&gt;Альстромерия (желтая) - 4&lt;/p&gt;&lt;p&gt;Альстромерия (оранжевая) - 3&lt;/p&gt;&lt;p&gt;Берграсс (зеленый) - 1&lt;/p&gt;&lt;p&gt;Лента (красная) - 1&lt;/p&gt;&lt;p&gt;Папоротник (зеленый) - 3&lt;/p&gt;&lt;p&gt;Роза 60 см (красная) - 4&lt;/p&gt;&lt;p&gt;Роза кустовая (оранжевая) - 4&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 10&lt;/p&gt;&lt;p&gt;Хризантема одиночная (желтая) - 2&lt;/p&gt;&lt;p&gt;Фисташки зелень - 3&lt;/p&gt;&lt;p&gt;Сетка - 1&lt;/p&gt;', '', 4890, '00200902', 'instock', 997, 'catalog/flowers/23.jpg', 0, 1, 'Букет &quot;Ривьера&quot;', 'Доставка букетов', '2020-09-04 19:14:17', '2020-12-19 18:54:03'),
(54, 'Букет из роз и хризантем', 0, '&lt;p&gt;В этом букете ослепительная белизна хризантем оттеняет нежность роз. Множество полураскрывшихся бутонов еще не показали всей своей красоты, и только воображение подсказывает, как грациозно и величаво будут выглядеть розы в скором времени. Пышная зелень рускуса и фисташки добавляет объема всей композиции.&lt;/p&gt;&lt;p&gt;Этот букет – универсальный подарок женщине, как в праздник, так и в обычный день.&lt;/p&gt;&lt;p data-v-68132a98=&quot;&quot; style=&quot;outline: 0px; color: rgb(58, 58, 58); font-family: SFUIText-Regular, Helvetica, sans-serif; font-size: 13.3333px; font-variant-ligatures: normal; orphans: 2; widows: 2;&quot;&gt;Cостав:&lt;br&gt;&lt;/p&gt;&lt;p&gt;Лента (белая) - 1&lt;/p&gt;&lt;p&gt;Роза кустовая (розовая) - 4&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 5&lt;/p&gt;&lt;p&gt;Хризантема кустовая (белая) - 3&lt;/p&gt;&lt;p&gt;Фисташки зелень - 6&lt;/p&gt;&lt;p&gt;Пленка (розовая) - 1&lt;/p&gt;', '', 2550, '', 'instock', 1000, 'catalog/flow/24.png', 1, 1, 'Букет из роз и хризантем', 'Доставка букетов', '2020-09-04 19:22:42', '2020-11-05 13:12:44'),
(55, 'delete Букет &quot;Красивый&quot;', 0, '&lt;p&gt;Когда-то во Франции среди аристократов был такой красивый обычай. Каждое утро вплоть до свадьбы жених посылал невесте букет цветов, который обязательно включал в себя несколько лилий. Это считалось выражением благодарности за любовь и согласие принять предложение руки и сердца. Конечно, вы не представитель высшего французского общества, но если вы Мужчина, ваша любимая будет получать цветы не только на праздники.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента (белая) - 1&lt;/p&gt;&lt;p&gt;Лилия ветка (белая) - 11&lt;/p&gt;&lt;p&gt;Фетр (зеленый) - 1&lt;/p&gt;&lt;p&gt;Фисташки зелень - 4&lt;/p&gt;&lt;p&gt;Крафт-бумага - 1&lt;/p&gt;', '', 5450, '', 'instock', 1000, 'catalog/flow/25.png', 0, 1, 'Букет Красивый', 'Доставка букетов', '2020-09-04 19:37:48', '2020-12-19 17:47:29'),
(56, 'delete Букет &quot;Вдохновение&quot;', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Идеальная композиция в белых тонах. Свежайшие лилии и неотразимые молочные розы отлично сочетаются в одном букете. Подарив такой букет, вы подарите легкость и свежесть и, конечно же, счастливую улыбку получателю. &lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Доставим букет в любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Cостав:&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Вероника вайт (белый) - 7&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Лента (белая) - 1&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Лилия ветка (белая) - 3&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Роза 60 см (белая) - 10&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Рускус (зеленый) - 10&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;', '', 5540, '', 'instock', 1000, 'catalog/flow/26.png', 0, 1, 'Вдохновение', 'Доставка букетов', '2020-09-05 05:36:56', '2020-12-19 17:44:11'),
(57, 'Грация (букет невесты)', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Нежный красиво сложенный букет прекрасно подойдет к любому празднику! Крупные белоснежные лилии, кустовые розовые розы и милое дополнение - гипсофила отлично сочетаются друг с другом.&amp;nbsp;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Доставим букет в любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Cостав:&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гипсофила (белая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (белая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лилия ветка (белая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза кустовая (розовая) - 4&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Салал - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Стикер - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Фатсия - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Фетр (розовый) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flow/27.jpg', 1, 1, 'Грация (букет невесты)', 'Доставка букетов', '2020-09-05 05:53:10', '2021-02-19 17:31:44'),
(58, 'delete Букет &quot;Сказка&quot;', 0, '&lt;p&gt;Центральное место букета занимают крупные белые лилии, очень женственные и благородные. Их строгая лаконичная красота дополнена небесного цвета озорными ирисами, которые придают композиции лёгкость и одновременно глубину.&lt;/p&gt;&lt;p&gt;Цветы расскажут о романтичности и нежности дарителя, живущих в его сердце!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Ирис (сиреневый) - 20&lt;/p&gt;&lt;p&gt;Лента (сиреневая) - 1&lt;/p&gt;&lt;p&gt;Лилия ветка (белая) - 7&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 20&lt;/p&gt;', '', 7780, '', 'instock', 1000, 'catalog/flow/28.ong.jpg', 0, 1, 'Сказка ', 'Доставка букетов', '2020-09-05 10:43:00', '2020-12-19 18:59:19'),
(59, 'delete Букет &quot;Свет Лилий&quot;', 0, '&lt;p&gt;&amp;nbsp;«Чистейшей прелести чистейший образец» – этой пушкинской строкой вполне можно охарактеризовать лилии. Их дарят детям и юным девушкам. Исключением может стать такой обряд, как крещение. В этот день букет можно подарить любому человеку в знак очищения души. Лилия считается цветком Пресвятой Девы. В любом случае эти цветы всегда являлись признаком хорошего вкуса.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента (зеленая) - 1&lt;/p&gt;&lt;p&gt;Лилия ветка (розовая) - 2&lt;/p&gt;&lt;p&gt;Лилия ветка (белая) - 3&lt;/p&gt;', '«Чистейшей прелести чистейший образец» – этой пушкинской строкой вполне можно охарактеризовать лилии. Их дарят детям и юным девушкам. Исключением может стать такой обряд, как крещение. В этот день букет можно подарить любому человеку в знак очищения души.', 2720, '', 'instock', 1000, 'catalog/flow/29.jpg', 0, 1, 'Букет &quot;Свет Лилий&quot;', 'Доставка букетов', '2020-09-05 10:57:20', '2020-12-19 18:56:59'),
(60, 'delete Букет невесты &quot;Королева&quot;', 0, '&lt;p&gt;В старину жениха и невесту называли «князь» и «княгиня». Свадьбы играли очень пышно и широко. Роскошный букет с бежевыми розами соответствует великолепию свадебного торжества. Бутоны белой эустомы и звездочки гипсофилы добавляют свежести, делают всю композицию более нарядной и трепетной. Их оттеняет игольчатая зелень аспарагуса. С таким букетом невеста будет выглядеть княгиней.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Аспарагус умбеллатус (зеленый) - 1&lt;/p&gt;&lt;p&gt;Бутоньерка - 1&lt;/p&gt;&lt;p&gt;Гипсофила (белая) - 1&lt;/p&gt;&lt;p&gt;Лента (кремовая) - 4&lt;/p&gt;&lt;p&gt;Портбукетница - 1&lt;/p&gt;&lt;p&gt;Роза кустовая (кремовая) - 8&lt;/p&gt;&lt;p&gt;Эустома (лизиантус) (белая) - 5&lt;/p&gt;', '', 4790, '', 'instock', 1000, 'catalog/flow/30.jpg', 0, 1, 'Букет невесты &quot;Королева&quot;', 'Доставка букетов', '2020-09-05 11:11:49', '2020-12-19 19:06:12'),
(61, 'delete Букет невесты &quot;Радость&quot;', 0, '&lt;p&gt;Какая девушка не рисовала в своем воображении сказочные картины будущей чудесной жизни! Мечты о волшебной любви и прекрасном принце знакомы каждой барышне. Если вам выпала честь стать воплощением юных грез, позаботьтесь о букете для своей избранницы, который по обычаю жених преподносит невесте при встрече перед регистрацией или венчанием. Розы в обрамлении флердоранжа сделают вашу любимую еще прекраснее.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Аспарагус умбеллатус (зеленый) - 1&lt;/p&gt;&lt;p&gt;Бутоньерка - 1&lt;/p&gt;&lt;p&gt;Гипсофила (белая) - 3&lt;/p&gt;&lt;p&gt;Лента (белая) - 1&lt;/p&gt;&lt;p&gt;Портбукетница - 1&lt;/p&gt;&lt;p&gt;Роза 60 см (белая) - 5&lt;/p&gt;&lt;p&gt;Роза кустовая (розовая) - 2&lt;/p&gt;', '', 3640, '', 'instock', 1000, 'catalog/flow/31.jpg', 0, 1, 'Букет невесты Радость ', 'Доставка букетов', '2020-09-05 12:00:11', '2020-12-19 19:07:09'),
(62, 'delete Шик', 0, '&lt;p&gt;Шикарный микс из красных и розовых кустовых роз придется по душе любой женщине. Одновременно нежный и страстный, как легкий поцелуй, этот букет вызовет легкий трепет и оставит незабываемые воспоминания. Удивляйте и радуйте своих близких, эти эмоции бесценны.&lt;/p&gt;&lt;p&gt;Cостав:&lt;/p&gt;&lt;p&gt;Гиперикум (красный) - 3&lt;/p&gt;&lt;p&gt;Лента (красная) - 1&lt;/p&gt;&lt;p&gt;Роза Гран-При (красная) - 15&lt;/p&gt;&lt;p&gt;Эвкалипт - 1&lt;/p&gt;&lt;p&gt;Бумага жатая (белая) - 2&lt;/p&gt;&lt;p&gt;Роза кустовая пионовидная (розовая) - 3&lt;/p&gt;&lt;p&gt;Фоамиран (розовый) - 1&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flow/33.png', 0, 1, 'Шик', 'Доставка букетов', '2020-09-05 12:06:31', '2020-12-20 12:50:55'),
(63, 'Крем-брюле', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза 60 см (кремовая) - 6 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза 60 см (белая) - 9 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '.', 0, '', 'instock', 1000, 'catalog/flow/34.png', 1, 1, 'Крем-брюле', 'Доставка букетов', '2020-09-05 12:15:01', '2021-02-19 17:29:56'),
(64, 'delete Мария', 0, '&lt;p&gt;Классический круглый букет, изящная простота которого не скрывает его совершенства и красоты. Сияние, словно идущее изнутри композиции, достигнуто благодаря использованию тёплой розовой гаммы цветов.&lt;/p&gt;&lt;p&gt;Это идеальный подарок для современной молодой женщины, который вызовет в ней приятно волнующие чувства.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Альстромерия (белая) - 3&lt;/p&gt;&lt;p&gt;Гербера (розовая) - 5&lt;/p&gt;&lt;p&gt;Лента (розовая) - 1&lt;/p&gt;&lt;p&gt;Лист аспидистры (зеленый) - 5&lt;/p&gt;&lt;p&gt;Роза 60 см (розовая) - 7&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 10&lt;/p&gt;&lt;p&gt;Фетр (голубой) - 1&lt;/p&gt;&lt;p&gt;Хризантема кустовая (сиреневая) - 8&lt;/p&gt;&lt;p&gt;Хризантема одиночная (белая) - 5&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/flow/35.png', 0, 1, 'Мария', 'Доставка букетов', '2020-09-05 12:22:25', '2020-12-20 12:40:35'),
(65, 'Весна', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Cостав:&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гиперикум (красный) - 3&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Лента (зеленая) - 1&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Роза кустовая (оранжевая) - 5&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Эустома (лизиантус) (розовая) - 4&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Эустома (лизиантус) (белая) - 4&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Фисташки зелень - 6&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Крафт-бумага - 1&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/flow/36.png', 1, 1, 'Весна', 'Доставка букетов', '2020-09-05 12:31:22', '2021-02-19 17:17:13'),
(66, 'Первоцвет', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;br&gt;&lt;/p&gt;&lt;p&gt;Cостав:&lt;/p&gt;&lt;p&gt;Лента&amp;nbsp;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Пиафлор&lt;/p&gt;&lt;p&gt;Хризантема кустовая (белая) - 6 шт&lt;/p&gt;&lt;p&gt;Эустома (лизиантус) (белая) - 5 шт&lt;/p&gt;&lt;p&gt;Пленка&amp;nbsp;&lt;/p&gt;&lt;p&gt;Коробка шляпная (малая)&amp;nbsp;&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flow/37.png', 1, 1, 'Первоцвет', 'Доставка букетов', '2020-09-05 12:38:51', '2020-12-29 08:41:49'),
(67, 'delete Букет &quot;Патриот&quot;', 0, '&lt;p&gt;Прекрасные творения природы воплотили образ российского флага в ярком трёхъярусном букете, где каждый из трёх цветов несёт в себе важное смысловое значение.&lt;/p&gt;&lt;p&gt;Белый символизирует мир, невинность и совершенство, синий – величие, верность и постоянство, а красный – неустрашимость, энергию и силу&lt;/p&gt;&lt;p&gt;Cостав:&lt;/p&gt;&lt;p&gt;Гвоздика (белая) - 13&lt;/p&gt;&lt;p&gt;Декор - 3&lt;/p&gt;&lt;p&gt;Ирис (сиреневый) - 24&lt;/p&gt;&lt;p&gt;Лента (красная) - 1&lt;/p&gt;&lt;p&gt;Лента (белая) - 1&lt;/p&gt;&lt;p&gt;Лента (голубая) - 1&lt;/p&gt;&lt;p&gt;Роза 60 см (красная) - 16&lt;/p&gt;', '', 8680, '', 'instock', 1000, 'catalog/flow/38.png', 0, 1, 'Букет &quot;Патриот&quot;', 'Доставка букетов', '2020-09-05 13:07:18', '2020-12-19 18:50:25'),
(68, 'delete Букет &quot;Победа&quot;', 0, '&lt;p&gt;Биография гвоздики тесно связана с трагическими эпизодами мировой истории. В разное время была и символом борьбы, и эмблемой, вместе с которой жертвы террора всходили на эшафот. Букет из красных и белых гвоздик – для ветеранов, выстоявших в это суровое время на фронте или в тяжелом тылу. Мы склоняем головы перед теми, кто не склонился перед врагом.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гвоздика (красная) - 23&lt;/p&gt;&lt;p&gt;Гвоздика (белая) - 22&lt;/p&gt;&lt;p&gt;Лента - 1&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 10&lt;/p&gt;', '', 5670, '', 'instock', 1000, 'catalog/flow/39.png', 0, 1, 'Букет &quot;Победа&quot;', 'Доставка букетов', '2020-09-05 13:13:17', '2020-12-19 18:51:25'),
(69, 'Букет &quot;Настроение&quot;', 0, '&lt;p&gt;Праздничный, но не лишённый доли строгости и силы благодаря своей устремлённости ввысь букет для представителя сильной половины человечества.&lt;/p&gt;&lt;p&gt;Розы, ирисы и хризантемы подчёркивают искреннее расположение к человеку, а художественно уложенные тёмно-зелёные листья являются прекрасным фоном для цветов.&lt;/p&gt;&lt;p&gt;Cостав:&lt;/p&gt;&lt;p&gt;Альстромерия (оранжевая) - 2&lt;/p&gt;&lt;p&gt;Ирис (сиреневый) - 8&lt;/p&gt;&lt;p&gt;Лента (зеленая) - 1&lt;/p&gt;&lt;p&gt;Лист аспидистры (зеленый) - 10&lt;/p&gt;&lt;p&gt;Роза 60 см (оранжевая) - 6&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 10&lt;/p&gt;&lt;p&gt;Хризантема кустовая (желтая) - 3&lt;/p&gt;&lt;p&gt;Хризантема одиночная (белая) - 2&lt;/p&gt;&lt;p&gt;Сетка (оранжевая) - 1&lt;/p&gt;', '', 4020, '', 'instock', 1000, 'catalog/flow/40.png', 1, 1, 'Букет &quot;Настроение&quot;', 'Доставка букетов', '2020-09-05 13:22:21', '2020-12-19 17:56:15'),
(70, 'delete Композиция &quot;Малинка&quot;', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Удивительно милый и очаровательный букет покорит сердце каждого! Сочетание белых альстромерий, пушистых белых хризантем, эустом и кустовых роз выглядит красиво и притягательно.&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Доставим в любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Cостав:&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Альстромерия (белая) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Пиафлор - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза кустовая (розовая) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Хризантема кустовая (белая) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Эустома (лизиантус) (белая) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Фисташки зелень - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Пленка - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 2340, '', 'instock', 1000, 'catalog/flow/41.png', 0, 1, 'Композиция &quot;Малинка&quot;', 'Доставка букетов', '2020-09-05 13:29:46', '2020-12-19 19:14:00'),
(71, 'delete Композиция &quot;Улыбка&quot;', 0, '&lt;p&gt;Ожидание долгожданной встречи наполняет светом душу, будоражит воображение и обостряет чувства. Как этот букет, составленный в контрастах белого и бордового: одновременно нежен и ярок.&lt;/p&gt;&lt;p&gt;Этот букет является цветочной композицией, собранной в пиафлоре (цветочном оазисе).&lt;/p&gt;&lt;p&gt;Cостав:&lt;/p&gt;&lt;p&gt;Лента (красная) - 1&lt;/p&gt;&lt;p&gt;Орхидея (белая) - 1&lt;/p&gt;&lt;p&gt;Папоротник (зеленый) - 2&lt;/p&gt;&lt;p&gt;Пиафлор - 1&lt;/p&gt;&lt;p&gt;Роза 60 см (красная) - 1&lt;/p&gt;&lt;p&gt;Фетр - 1&lt;/p&gt;&lt;p&gt;Хризантема кустовая (красная) - 1&lt;/p&gt;&lt;p&gt;Хризантема кустовая (белая) - 1&lt;/p&gt;&lt;p&gt;Фисташки зелень - 2&lt;/p&gt;&lt;p&gt;Хризантема одноголовая (белая) - 1&lt;/p&gt;', '', 1800, '', 'instock', 1000, 'catalog/flow/42.png', 0, 1, 'Композиция &quot;Улыбка&quot;', 'Доставка букетов', '2020-09-05 13:37:44', '2020-12-20 12:36:38'),
(72, 'Александра', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Cостав:&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (белая)&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза 60 см (белая) - 5 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Рускус (зеленый) - 10 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Хризантема кустовая (белая) - 7 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Пленка (зеленая)&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гербера мини (белая) - 5 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Obschie/BuketAleksandra.jpg', 1, 1, 'Александра', 'Доставка букетов', '2020-09-05 13:44:42', '2021-02-19 17:14:56'),
(73, 'delete Радужье', 0, '&lt;p&gt;Нежные розы и эустомы, позитивные герберы и хризантемы, фантазийный озотамнус и альстромерии – насколько красив каждый цветок этого букета, настолько прекрасна вся композиция, бережно укутанная в кружевное &quot;покрывало&quot;. Глядя на это чудо, хочется сказать: &quot;Остановись, мгновенье! Ты - прекрасно!&quot; Если вы хотите, чтобы жизнь любимого человека состояла из счастливых мгновений, дарите ему красивые букеты.&lt;/p&gt;&lt;p&gt;Cостав:&lt;/p&gt;&lt;p&gt;Альстромерия (белая) - 2&lt;/p&gt;&lt;p&gt;Лента (белая) - 1&lt;/p&gt;&lt;p&gt;Хризантема кустовая (белая) - 3&lt;/p&gt;&lt;p&gt;Эустома (лизиантус) (белая) - 2&lt;/p&gt;&lt;p&gt;Фисташки зелень - 5&lt;/p&gt;&lt;p&gt;Пленка (белая) - 1&lt;/p&gt;&lt;p&gt;Озотамнус - 2&lt;/p&gt;&lt;p&gt;Гербера мини (розовая) - 3&lt;/p&gt;&lt;p&gt;Роза кустовая пионовидная (розовая) 3&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flow/44.png', 0, 1, 'Радужье', 'Доставка букетов', '2020-09-05 13:49:51', '2020-12-20 12:44:06'),
(74, 'Весеннее настроение', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Cостав:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Альстромерия (желтая) - 3 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гербера (красная) - 4 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Джут&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (красная)&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лист аспидистры (зеленый) - 7 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Рускус (зеленый) - 10 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Хризантема кустовая (белая) - 3шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Крафт-бумага&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flow/45.png', 1, 1, 'Весеннее настроение', 'Доставка букетов', '2020-09-05 13:55:37', '2021-02-19 17:15:48'),
(75, 'delete Букет из 15 белых хризантем', 0, '&lt;p&gt;Ни один цветок не завоевал популярности так быстро, как хризантема. Увлечение хризантемами сейчас очень велико. Эти цветы ныне торжествуют. Белые хризантемы наполнят душу покоем и умиротворенностью. Иногда нам необходима «холодность для глаз». Подарите этот букет женщине, например в День весны, и он долгое время будет напоминать ей о вас.&lt;/p&gt;&lt;p&gt;Cостав:&lt;/p&gt;&lt;p&gt;Лента (зеленая) - 1&lt;/p&gt;&lt;p&gt;Органза (зеленая) - 1&lt;/p&gt;&lt;p&gt;Хризантема одиночная (белая) - 15&lt;/p&gt;', '', 4660, '', 'instock', 1000, 'catalog/flow/46.png', 0, 1, 'Букет из 15 белых хризантем', 'Доставка букетов', '2020-09-05 14:00:14', '2020-12-19 19:03:08'),
(76, 'delete Букет из 11 желтых хризантем', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Удивительно солнечные и яркие хризантемы дарят солнечное настроение и лучезарные улыбки! Прекрасное настроение гарантировано!&amp;nbsp;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Доставим в любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (зеленая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Хризантема одиночная (желтая) - 11&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Пленка - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 3360, '', 'instock', 1000, 'catalog/flow/47.png', 0, 1, 'Букет из 11 желтых хризантем', 'Доставка букетов', '2020-09-05 14:04:45', '2020-12-19 19:02:10'),
(77, 'delete Жгучее сердце', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Очаровательный пылающий букет подарит тепло и любовь своему получателю. Шикарное сочное сочетание ярких альстромерий, алых роз и насыщенных красных гербер удивит каждого.&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Доставим в любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Альстромерия (красная) - 5&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гербера (красная) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза 60 см (оранжевая) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза кустовая (красная) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Хризантема кустовая (красная) - 5&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Фисташки зелень - 5&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Крафт-бумага - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flow/48.png', 0, 1, 'Жгучее сердце', 'Доставка букетов', '2020-09-05 14:12:57', '2020-12-19 19:11:35'),
(78, 'delete Букет &quot;Очарование&quot;', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;Милый небольшой букетик очаровывает с первого взгляда. В композиции прекрасно сочетаются нежные розовые альстромерии, герберы, пышные хризантемы и прекрасная гипсофила.&amp;nbsp;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;Доставим в любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Cостав:&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Альстромерия (розовая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гербера (розовая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гипсофила (белая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (розовая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лист аспидистры (зеленый) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Рускус (зеленый) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Фетр (розовый) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Фетр (зеленый) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot; style=&quot;background-color: rgb(255, 255, 255);&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Хризантема кустовая (белая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 1400, '', 'instock', 998, 'catalog/flow/49.png', 0, 1, 'Букет &quot;Очарование&quot;', 'Доставка букетов', '2020-09-05 14:18:26', '2020-12-19 18:50:07'),
(79, 'delete Букет &quot;Радужная осень&quot;', 0, '&lt;p&gt;Солнечного цвета хризантемы, белая эустома и зелень фисташки, укутанные в сверкающую упаковку, придают всему букету яркий, позитивный вид. Хотите украсить день солнечным светом? Вы не ошибетесь с выбором, подарив эти цветы.&lt;/p&gt;&lt;p&gt;Букет поднимет настроение в любой праздник и станет лучиком света просто так, без повода, и женщине, и мужчине. И долой стереотипы. Ведь желтый цвет – этот цвет радости.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента (белая) - 1&lt;/p&gt;&lt;p&gt;Фетр (желтый) - 2&lt;/p&gt;&lt;p&gt;Хризантема кустовая (желтая) - 4&lt;/p&gt;&lt;p&gt;Эустома (лизиантус) (белая) - 7&lt;/p&gt;&lt;p&gt;Фисташки зелень - 5&lt;/p&gt;&lt;p&gt;Пленка - 2&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', 3390, '', 'instock', 1000, 'catalog/flow/50.png', 0, 1, 'Букет &quot;Радужная осень&quot;', 'Доставка букетов', '2020-09-05 14:27:17', '2020-12-19 18:53:46'),
(80, 'Пушистое чудо', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Cостав:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Альстромерия (белая) - 3 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гиперикум (зеленый) - 2 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Ирис (сиреневый) - 3 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (белая)&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Статица (сиреневая) - 2 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Эустома (лизиантус) (белая) - 3 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Тласпия - 1 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Пленка (зеленая)&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Хризантема одноголовая (белая) - 3 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Эрингиум - 2 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flow/51.png', 1, 1, 'Пушистое чудо', 'Доставка букетов', '2020-09-05 14:31:58', '2021-02-19 17:50:37'),
(81, 'delete Букет из 51 белой хризантемы', 0, '&lt;p&gt;Чистота цвета всегда выражает чистоту символического значения. Белые хризантемы, пленяющие неяркой, северной красотой, олицетворяют совершенство, свет и гармонию. Торжественный подарок не только будет приятен получателю, но и настроит его на правильные отношения с миром, окружающими и самим собой.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента большая (желтая) - 2&lt;/p&gt;&lt;p&gt;Хризантема кустовая (белая)&amp;nbsp; - 51&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flow/52.png', 0, 1, 'Букет из 51 белой хризантемы', 'Доставка букетов', '2020-09-05 14:35:18', '2020-12-19 19:03:58'),
(82, 'delete Букет &quot;Чудо&quot;', 0, '&lt;p&gt;Вы не найдете откровенной радости на послушных и податливых лепестках сиреневых хризантем. Но как выразительна их задумчивая улыбка! Общий приглушенный тон композиции придает ей лирическое звучание. Осенний букет можно подарить педагогу.&lt;/p&gt;&lt;p&gt;Cостав:&lt;/p&gt;&lt;p&gt;Гипсофила (белая) - 3&lt;/p&gt;&lt;p&gt;Лента (зеленая) - 1&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 6&lt;/p&gt;&lt;p&gt;Фетр (зеленый) - 1&lt;/p&gt;&lt;p&gt;Хризантема кустовая (сиреневая) - 11&lt;/p&gt;', '', 3020, '', 'instock', 1000, 'catalog/flow/53.png', 0, 1, 'Букет &quot;Чудо&quot;', 'Доставка букетов', '2020-09-05 14:40:16', '2020-12-19 19:01:50'),
(83, 'delete Композиция &quot;Легкий бриз&quot;', 0, '&lt;p style=&quot;outline: 0px;&quot;&gt;Яркая зелень листвы подчеркивает белизну бутонов роз, лилий и хризантем. Игра контрастов придает торжественности всей композиции.&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Этот букет является цветочной композицией, собранной в пиафлоре (цветочном оазисе).&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Состав:&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Гиперикум (зеленый) - 1&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Лента - 1&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Лилия ветка (белая) - 1&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Пиафлор - 1&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Роза 60 см (белая) - 3&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Хризантема кустовая (белая) - 1&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Эвкалипт - 1&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Тласпия - 1&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Пленка - 1&lt;/p&gt;', '', 2400, '', 'instock', 1000, 'catalog/flowers/lili/kompoza.jpg', 0, 1, 'Композиция &quot;Легкий бриз&quot;', 'Доставка букетов', '2020-09-06 18:32:50', '2020-12-19 19:13:38'),
(84, 'delete Композиция &quot;Нежные ночи&quot;', 0, '&lt;p&gt;Сверкающая корзинка цветов – это частичка благоухающего сада, главное украшение которого, как и в садах из известных арабских сказок,- «роза необыкновенная… огонь радости, пышная заря…» Композиции в корзинах обычно дарят на особые случаи - юбилеи, званые обеды, свадьбы… А после праздника цветы оживят интерьер дома виновницы торжества.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Альстромерия (розовая) - 4&lt;/p&gt;&lt;p&gt;Астер (белый) - 7&lt;/p&gt;&lt;p&gt;Лилия ветка (розовая) - 2&lt;/p&gt;&lt;p&gt;Пиафлор большой - 2&lt;/p&gt;&lt;p&gt;Роза кустовая (розовая) - 3&lt;/p&gt;&lt;p&gt;Роза кустовая (белая) - 2&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 10&lt;/p&gt;&lt;p&gt;Триферн (аспарагус) (зеленый) - 5&lt;/p&gt;&lt;p&gt;Корзина большая - 1&lt;/p&gt;&lt;p&gt;Роза 50 см (красная) - 34&lt;/p&gt;', '', 12820, '', 'instock', 1000, 'catalog/flowers/lili/korzinka.jpg', 0, 1, 'Композиция &quot;Нежные ночи&quot;', 'Доставка букетов', '2020-09-06 18:37:06', '2020-12-20 12:36:02'),
(85, 'delete Букет &quot;Песнь лилий&quot;', 0, '&lt;p&gt;Камерная, трогательная композиция, передающая образ непорочности и чистоты. Романтические бледно-розовые лилии соседствуют с воздушной, как вуаль, гипсофилой. Зеленые листья аспидистры – прекрасный наполнитель букета. Юной невесте будет удобно держать его в руке во время венчания или свадебного обряда.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гипсофила (белая) - 3&lt;/p&gt;&lt;p&gt;Декор - 1&lt;/p&gt;&lt;p&gt;Лента (белая) - 1&lt;/p&gt;&lt;p&gt;Лилия ветка (розовая) - 2&lt;/p&gt;&lt;p&gt;Лист аспидистры (зеленый) - 5&lt;/p&gt;&lt;p&gt;Органза (розовая) - 1&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 10&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', 2950, '', 'instock', 1000, 'catalog/flowers/lili/pesnjalilij.jpg', 0, 1, 'Букет &quot;Песнь лилий&quot;', 'Доставка букетов', '2020-09-06 18:40:34', '2020-12-19 18:50:47'),
(86, 'delete Букет &quot;Снежный замок&quot;', 0, '&lt;p&gt;Белый замок ассоциируется у нас с неким сокровищем (и не обязательно материальным), прекрасной девой и благородным рыцарем. Это символ материализации чуда. Если в вашей жизни чудо уже произошло и вы нашли свое единственное сокровище, преподнесите Ей это белое очарование из роз, гербер и лилий. Изящная ваза – прочное основание сказочного «замка».&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Ваза - 1&lt;/p&gt;&lt;p&gt;Гербера (белая) - 8&lt;/p&gt;&lt;p&gt;Гипсофила (белая) - 4&lt;/p&gt;&lt;p&gt;Декор - 1&lt;/p&gt;&lt;p&gt;Лилия ветка (белая) - 3&lt;/p&gt;&lt;p&gt;Роза 60 см (белая) - 9&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 20&lt;/p&gt;', '', 7680, '', 'instock', 1000, 'catalog/flowers/lili/belyjzamok.jpg', 0, 1, 'Букет &quot;Снежный замок&quot;', 'Доставка букетов', '2020-09-06 18:43:18', '2020-12-19 19:00:03'),
(87, 'Винтаж', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гипсофила (белая) - 4 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (белая)&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лилия ветка (белая) - 5 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза 60 см (красная) - 15 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Рускус (зеленый) - 20 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flowers/lili/krasnyjzamok.jpg', 1, 1, 'Винтаж', 'Доставка букетов', '2020-09-06 18:52:59', '2021-02-19 17:18:11'),
(88, 'delete Букет &quot;Кристи&quot;', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Прекрасная классическая композиция очарует вас с первых секунд. Давно полюбившееся сочетание больших красных роз и белоснежных крупных лилий придутся по душе каждому, кому подарят такой букет!&amp;nbsp;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Доставим в любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гипсофила (белая) - 2&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (красная) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лилия ветка (белая) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза 60 см (красная) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза 60 см (белая) - 6&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Рускус (зеленый) - 10&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 3770, '', 'instock', 1000, 'catalog/flowers/lili/622af58fea182ca756a5629dd643905e.jpg', 0, 1, 'Букет &quot;Кристи&quot;', 'Доставка букетов', '2020-09-06 19:01:57', '2020-12-19 17:48:34'),
(89, 'delete Букет &quot;Карнавал&quot;', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Яркий букет сочетает в себе широкую палитру красок. Необычная композиция передает нежность и заряд хорошего настроения. Микс из альстромерий прекрасно сочетается с герберами и точно порадует каждого, кому подарят такой букет.&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Доставим в любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Альстромерия (розовая) - 4&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Альстромерия (белая) - 5&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Альстромерия (оранжевая) - 5&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гербера (красная) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гербера (розовая) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гербера (желтая) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (красная) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Рускус (зеленый) - 10&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 4450, '', 'instock', 1000, 'catalog/flowers/gerber/999cd348915fec0c85e3abd6178ffe10.jpg', 0, 1, 'Букет &quot;Карнавал&quot;', 'Доставка букетов', '2020-09-07 05:39:38', '2020-12-19 17:46:27'),
(91, 'delete Букет &quot;Необыкновенное чудо&quot;', 0, '&lt;p&gt;Круглый компактный букет новорожденной девочке. И дымчатые складки орхидей, и полупрозрачные лепестки хризантем, и нарядные юбочки гербер кажутся озаренными каким-то внутренним сиянием, словно и они сопереживают этому чуду – рождению новой жизни.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Альстромерия (розовая) - 6&lt;/p&gt;&lt;p&gt;Гербера (розовая) - 6&lt;/p&gt;&lt;p&gt;Гипсофила (белая) - 1&lt;/p&gt;&lt;p&gt;Декор - 1&lt;/p&gt;&lt;p&gt;Лента (розовая) - 1&lt;/p&gt;&lt;p&gt;Лист аспидистры (зеленый) - 3&lt;/p&gt;&lt;p&gt;Орхидея (розовый) - 3&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 7&lt;/p&gt;&lt;p&gt;Фетр (зеленый) - 1&lt;/p&gt;&lt;p&gt;Хризантема кустовая (белая) - 3&lt;/p&gt;', '', 4490, '', 'instock', 1000, 'catalog/flowers/gerber/9f7181c22a7377deac69d35beb41f431.jpg', 0, 1, 'Букет &quot;Необыкновенное чудо&quot;', 'Доставка букетов', '2020-09-07 05:47:23', '2020-12-19 18:35:37');
