(92, 'delete Букет &quot;Жаркое лето&quot;', 0, '&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Притягательный сочный букет обязательно обратит на себя внимание и подарит солнечное настроение. Композиция сочетает в себе прекрасные герберы, яркие хризантемы, розы и дополнен другими прекрасными цветами.&amp;nbsp;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Доставим букет в любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гербера (желтая) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гиперикум (зеленый) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (оранжевая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лист аспидистры (зеленый) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза 60 см (желтая) - 5&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Рускус (зеленый) - 8&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Сизаль (зеленый) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Солидаго (желтый) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Хризантема кустовая (желтая) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Хризантема одиночная (желтая) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Краспедия (желтая) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Тысячелистник - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 5190, '', 'instock', 1000, 'catalog/flowers/gerber/aed3ba7883357c42852d6634d52a9793.jpg', 0, 1, 'Букет &quot;Жаркое лето&quot;', 'Доставка букетов', '2020-09-07 05:52:39', '2020-12-19 17:45:17'),
(93, 'delete Букет &quot;Дары Ириды&quot;', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Яркий и необычный букет станет достойным подарком на любой праздник. Композиция сочетает в себе яркие желтые герберы, притягательные алые гвоздики, пушистые зеленые хризантемы и прекрасно дополнена другими элементами.&amp;nbsp;&lt;br&gt;Доставим у любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гербера (желтая) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гиперикум (красный) - 4&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гвоздика (красная) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гипсофила (белая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (оранжевая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лист аспидистры (зеленый) - 5&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Рускус (зеленый) - 7&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Хризантема шамрок (зеленая) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 3450, '', 'instock', 1000, 'catalog/flowers/gerber/f5ef92a7959d301a6e2b439fd1b7b25d.jpg', 0, 1, 'Букет &quot;Дары Ириды&quot;', 'Доставка букетов', '2020-09-07 05:56:00', '2020-12-19 17:44:35'),
(94, 'delete Букет &quot;Лесная сказка&quot;', 0, '&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Свежая зелень этого букета выглядит очень сочно и необычно. Интересное сочетание ярких красных гербер, нежных альстромерий, розовых кустовых роз и пышных зеленых хризантем принесет радость и тепло.&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Доставим в любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Альстромерия (зеленая) - 5&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гербера (красная) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (зеленая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза кустовая (оранжевая) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Хризантема одиночная (зеленая) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Фисташки зелень - 6&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Тласпия - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Бумага жатая - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 3800, '', 'instock', 1000, 'catalog/flowers/gerber/6bb09b02f84a8c852807196f6301093b.jpg', 0, 1, 'Букет &quot;Лесная сказка&quot;', 'Доставка букетов', '2020-09-07 05:58:55', '2020-12-19 17:48:51'),
(96, 'delete Композиция &quot;Жаркий полдень&quot;', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Прекрасный теплый и романтичный букет, который будет отличным подарком. Яркая акцентная гербера превосходно сочетается с пышными хризантемами и кустовыми розами.&amp;nbsp;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Доставим в любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гербера (красная) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гиперикум (красный) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Пиафлор - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза кустовая (красная) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Хризантема кустовая (белая) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Хризантема одиночная (зеленая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Фисташки зелень - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Пленка - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 1690, '', 'instock', 1000, 'catalog/flowers/gerber/dcc7dc036170414da14010e615de1442.jpg', 0, 1, 'Композиция &quot;Жаркий полдень&quot;', 'Доставка букетов', '2020-09-07 06:06:31', '2020-12-19 19:12:49'),
(97, 'Цветочное признание', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Альстромерия (красная) - 3 шт&lt;/p&gt;&lt;p&gt;Гербера (красная) - 3 шт&lt;/p&gt;&lt;p&gt;Гиперикум (красный) - 2 шт&lt;/p&gt;&lt;p&gt;Лента&amp;nbsp;&lt;/p&gt;&lt;p&gt;Хризантема кустовая (белая) - 5 шт&lt;/p&gt;&lt;p&gt;Хризантема одиночная (белая) - 1 шт&lt;/p&gt;&lt;p&gt;Эвкалипт - 2 шт&lt;/p&gt;&lt;p&gt;Фисташки зелень - 4 шт&lt;/p&gt;&lt;p&gt;Пленка (красная)&lt;/p&gt;&lt;p&gt;Лаванда - 2 шт&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flowers/gerber/a84ae0fe6c31150aaf54e6fc7f52792e.jpg', 1, 1, 'Цветочное признание', 'Доставка букетов', '2020-09-07 06:09:46', '2021-02-19 17:54:18'),
(98, 'delete Композиция &quot;Место жительство любви&quot;', 0, '&lt;p&gt;Формованный букет в виде сердца выполнен из бледных кремовых роз. Тем более ярким огнем горит на их фоне красная крупная гербера – флористы словно обозначили исток вашего горячего чувства. Красный гиперикум и жемчужные бусины – прекрасный материал для создания фактурного контраста. Подарите красоту вашего сердца молодой барышне, которая обожает украшения и милые женские «штучки».&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гербера (красная) - 1&lt;/p&gt;&lt;p&gt;Гиперикум (красный) - 1&lt;/p&gt;&lt;p&gt;Декор - 1&lt;/p&gt;&lt;p&gt;Папоротник (зеленый) - 1&lt;/p&gt;&lt;p&gt;Роза кустовая (кремовая) - 5&lt;/p&gt;&lt;p&gt;Пиафлор сердце мини - 1&lt;/p&gt;', '', 2230, '', 'instock', 1000, 'catalog/flowers/gerber/ffbce575c0df5021c5bf93d6584b619a.jpg', 0, 1, 'Композиция &quot;Место жительство любви&quot;', 'Доставка букетов', '2020-09-07 06:19:39', '2020-12-19 19:14:43'),
(99, 'Краски осени', 0, '&lt;p&gt;Словно разноцветные солнышки, красные, розовые, белые, желтые головки гербер и пробивающаяся сквозь них зелень фисташки и эвкалипта напоминают об ушедшем лете. Вся композиция, упакованная в шляпную коробку, выглядит нарядной и радостной.&lt;/p&gt;&lt;p&gt;Любая женщина будет рада такому подарку, потому что он будет от вас!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гербера (красная) - 2&lt;/p&gt;&lt;p&gt;Гербера (розовая) - 5&lt;/p&gt;&lt;p&gt;Гербера (белая) - 5&lt;/p&gt;&lt;p&gt;Гербера (желтая) - 3&lt;/p&gt;&lt;p&gt;Лента (белая) - 1&lt;/p&gt;&lt;p&gt;Пиафлор - 2&lt;/p&gt;&lt;p&gt;Эвкалипт - 3&lt;/p&gt;&lt;p&gt;Фисташки зелень - 3&lt;/p&gt;&lt;p&gt;Пленка - 1&lt;/p&gt;&lt;p&gt;Коробка шляпная (малая) - 1&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flowers/gerber/72b617d7af5774768fd8cdf44b59609c.jpg', 0, 1, 'Краски осени', 'Доставка букетов', '2020-09-07 06:22:11', '2020-12-11 17:34:26'),
(100, 'delete Букет &quot;Розовый рубин&quot;', 0, '&lt;p&gt;Лучшими друзьями девушек, как говорят, являются бриллианты. А почему не рубины? Каждая девушка и женщина будет рада получить в подарок такой «рубин» из 25 розовых гвоздик в стильном обрамлении. Ажурные, нежные махровые цветы долго сохранят свою привлекательность. Такой букет станет драгоценным подарком женщине на годовщину свадьбы, а юной девушке – к любому празднику. Пусть она почувствует себя королевой.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гвоздика (розовая) - 25&lt;/p&gt;&lt;p&gt;Лента (розовая) - 1&lt;/p&gt;&lt;p&gt;Пленка - 3&lt;/p&gt;', '', 3840, '', 'instock', 1000, 'catalog/flowers/gvozd/gvozdi.jpg', 0, 1, 'Букет &quot;Розовый рубин&quot;', 'Доставка букетов', '2020-09-07 06:42:40', '2020-12-19 18:54:56'),
(101, 'delete Букет &quot;Созвездие девы&quot;', 0, '&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гвоздика (сиреневая) - 3&lt;/p&gt;&lt;p&gt;Ирис (сиреневый) - 2&lt;/p&gt;&lt;p&gt;Лента (сиреневая) - 1&lt;/p&gt;&lt;p&gt;Лента (голубая) - 1&lt;/p&gt;&lt;p&gt;Роза 60 см (белая) - 3&lt;/p&gt;&lt;p&gt;Эустома (лизиантус) (белая) - 2&lt;/p&gt;&lt;p&gt;Эустома (лизиантус) (сиреневая) - 1&lt;/p&gt;&lt;p&gt;Эвкалипт - 1&lt;/p&gt;&lt;p&gt;Фисташки зелень - 3&lt;/p&gt;&lt;p&gt;Орхидея ванда (сиреневая) - 3&lt;/p&gt;&lt;p&gt;Пленка (сиреневая) - 3&lt;/p&gt;&lt;p&gt;Астильба - 3&lt;/p&gt;&lt;p&gt;Хризантема одноголовая (розовая) - 3&lt;/p&gt;&lt;p&gt;Лагурус (сиреневый) - 6&lt;/p&gt;&lt;p&gt;Амарантус (розовый) - 2&lt;/p&gt;', '', 5540, '', 'instock', 1000, 'catalog/flowers/gvozd/gvozdikikikikikikikiki.jpg', 0, 1, 'Букет &quot;Созвездие девы&quot;', 'Доставка букетов', '2020-09-07 06:46:49', '2020-12-19 19:00:47'),
(102, 'Букет &quot;Лунная соната&quot;', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Нежный загадочный букет очарует вас сочетанием цветов и приятной цветовой гаммой. Удивительные сиреневые ирисы прекрасно сочетаются с белыми розами и невесомыми сиреневыми эустомами.&amp;nbsp;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Доставим букет в любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гвоздика (зеленая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Ирис (сиреневый) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (сиреневая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Статица (сиреневая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Эустома (лизиантус) (сиреневая) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Эвкалипт - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Фисташки зелень - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Пленка (Хамелеон) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза 50 см (белая) - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Дельфиниум - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Фоамиран (сиреневый) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 2560, '', 'instock', 1000, 'catalog/flowers/gvozd/10d4661427ab380130bb5c075d396379.jpg', 1, 1, 'Букет &quot;Лунная соната&quot;', 'Доставка букетов', '2020-09-07 06:50:19', '2020-12-19 17:54:15'),
(103, 'delete Букет &quot;Прохладный день&quot;', 0, '&lt;p style=&quot;outline: 0px;&quot;&gt;Центром внимания этого букета является сиреневая гортензия. Вокруг нее уютно расположились махровые головки лунной гвоздики и пышные шапки хризантем. Пробивающиеся сквозь них белые эустомы и зеленые веточки эвкалипта создают в этой романтичной композиции, по замыслу флориста, художественный беспорядок.&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Такой нежный букет отзовется теплом в сердце девушки, сделает ее праздничный день незабываемым.&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Состав:&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Гортензия (гидрангия) (сиреневая) - 1&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Лента - 1&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Статица - 2&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Хризантема одиночная (белая) - 2&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Эустома (лизиантус) (белая) - 4&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Эвкалипт - 2&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Гвоздика лунная (сиреневая) - 5&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Фисташки зелень - 2&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Пленка (сиреневая) - 3&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;b&gt;Внимание! &lt;/b&gt;Используется сезонный цветок.&lt;/p&gt;', '', 4400, '', 'instock', 1000, 'catalog/flowers/gvozd/4e6ccee511d728ccbd6e5e5f1e4f15b2.jpg', 0, 1, 'Букет &quot;Прохладный день&quot;', 'Доставка букетов', '2020-09-07 06:57:34', '2020-12-19 18:53:18'),
(104, 'delete Свадебный вальс (букет невесты)', 0, '&lt;p&gt;Вслед за модой в стиле rustic (деревенский) в свадебную флористику пришла мода на растрепанные букеты. В этом букете нет четких линий, букет выглядит пышным и естественным. Это заставляет заострить внимание на каждом цветке. Ярким акцентом букета являются пышные пионы. В соседстве с ними – нежные лизиантусы и махровые гвоздики. А белые розы добавляют всей композиции изящество и утонченность.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Альстромерия (розовая) - 2&lt;/p&gt;&lt;p&gt;Гвоздика (белая) - 2&lt;/p&gt;&lt;p&gt;Лента (белая) - 1&lt;/p&gt;&lt;p&gt;Лента (кремовая) - 1&lt;/p&gt;&lt;p&gt;Пион (розовый) - 3&lt;/p&gt;&lt;p&gt;Роза 60 см (белая) - 5&lt;/p&gt;&lt;p&gt;Эустома (лизиантус) (розовая) - 2&lt;/p&gt;&lt;p&gt;Маттиола - 3&lt;/p&gt;&lt;p&gt;Озотамнус - 3&lt;/p&gt;&lt;p&gt;&lt;b&gt;Внимание!&lt;/b&gt; Используется сезонный цветок.&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flowers/gvozd/d94ec90d012d4ff4202f99c03144581f.jpg', 0, 1, 'Свадебный вальс (букет невесты)', 'Доставка букетов', '2020-09-07 07:02:29', '2020-12-19 18:22:16'),
(105, 'delete Композиция &quot;Феерия красок&quot;', 0, '&lt;p&gt;Разноцветные краски лета собраны в этом миниатюрном букете. Кажется вот-вот запорхают над ним яркие летние бабочки.&lt;/p&gt;&lt;p&gt;Этот букет является цветочной композицией, собранной в пиафлоре (цветочном оазисе).&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента - 1&lt;/p&gt;&lt;p&gt;Пиафлор - 1&lt;/p&gt;&lt;p&gt;Роза 60 см (белая) - 2&lt;/p&gt;&lt;p&gt;Хризантема кустовая (белая) - 1&lt;/p&gt;&lt;p&gt;Эустома (лизиантус) (сиреневая) - 1&lt;/p&gt;&lt;p&gt;Эвкалипт - 1&lt;/p&gt;&lt;p&gt;Гвоздика лунная (сиреневая) - 2&lt;/p&gt;&lt;p&gt;Пленка - 1&lt;/p&gt;&lt;p&gt;Гербера мини (оранжевая) - 3&lt;/p&gt;', '', 2190, '', 'instock', 1000, 'catalog/flowers/gvozd/4bdc0c29f7b5d3630b92c8d973ebf686.jpg', 0, 1, 'Композиция &quot;Феерия красок&quot;', 'Доставка букетов', '2020-09-07 07:05:18', '2020-12-20 12:38:23'),
(106, 'delete Букет &quot;Снежное сердце&quot;', 0, '&lt;p&gt;Основной цвет букета – ослепительно белый, благодаря розам, эустомам и маттиоле. Нежно-голубое оформление подчеркивает чистоту намерений. Но в отношениях намечается интрига – так ярко это выражено присутствием в букете вызывающе желтой орхидеи. Такой букет может быть, как подарком с глубоким смыслом, так и просто оригинальным и изысканным презентом обожаемой женщине.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента (голубая) - 1&lt;/p&gt;&lt;p&gt;Роза 60 см (белая) - 5&lt;/p&gt;&lt;p&gt;Эустома (лизиантус) (белая) - 3&lt;/p&gt;&lt;p&gt;Орхидея цимбидиум (желтая) - 5&lt;/p&gt;&lt;p&gt;Фисташки зелень - 2&lt;/p&gt;&lt;p&gt;Пленка (голубая) - 1&lt;/p&gt;&lt;p&gt;Маттиола - 8&lt;/p&gt;&lt;p&gt;Фоамиран (голубой) - 1&lt;/p&gt;', '', 4600, '', 'instock', 1000, 'catalog/flowers/orhidei/1324eb6eb4931a2b7ae4f304eca12163.jpg', 0, 1, 'Букет &quot;Снежное сердце&quot;', 'Доставка букетов', '2020-09-07 15:35:53', '2020-12-19 18:59:34'),
(107, 'delete Букет &quot;Поцелую орхидеи&quot;', 0, '&lt;p&gt;Восхитительные алые розы так и манят своей красотой. Орхидеи в этой композиции напоминают тропических бабочек, слетевшихся на пьянящий аромат цветов. Букет из роз и орхидей в розовых тонах выглядит одновременно изысканно и романтично. Он вызовет восторг у женщины любого возраста – подчеркнет достоинство дамы бальзаковского возраста и станет признанием в любви молодой женщине.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента (голубая) - 1&lt;/p&gt;&lt;p&gt;Орхидея (белая) - 5&lt;/p&gt;&lt;p&gt;Роза 60 см (розовая) - 6&lt;/p&gt;&lt;p&gt;Фисташки зелень - 10&lt;/p&gt;&lt;p&gt;Крафт-бумага - 1&lt;/p&gt;', '', 3140, '', 'instock', 1000, 'catalog/flowers/orhidei/67f765fd1d715ed867f840b41e021e01.jpg', 0, 1, 'Букет &quot;Поцелую орхидеи&quot;', 'Доставка букетов', '2020-09-07 15:38:44', '2020-12-19 18:51:41'),
(108, 'delete Букет &quot;Ночь перед карнавалом&quot;', 0, '&lt;p&gt;Если вы были в Венеции, то вам знакома особенная, светло-южная красота этого города. От зеленых берегов исходит душистый пар, а серебристая луна блестит среди прозрачных облаков. Все чувства, как и краски города, обостряются и становятся пронзительнее и ярче. Ох, эти, венецианские ночи!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Альстромерия (зеленая) - 2&lt;/p&gt;&lt;p&gt;Лента (желтая) - 1&lt;/p&gt;&lt;p&gt;Роза 60 см (оранжевая) - 5&lt;/p&gt;&lt;p&gt;Солидаго (желтый) - 3&lt;/p&gt;&lt;p&gt;Эустома (лизиантус) (белая) - 1&lt;/p&gt;&lt;p&gt;Эустома (лизиантус) (сиреневая) - 1&lt;/p&gt;&lt;p&gt;Фисташки зелень - 7&lt;/p&gt;&lt;p&gt;Тласпия - 1&lt;/p&gt;&lt;p&gt;Орхидея ванда (сиреневая) - 3&lt;/p&gt;&lt;p&gt;Бумага крафт - 1&lt;/p&gt;', '', 4040, '', 'instock', 1000, 'catalog/flowers/orhidei/2d5d306800465143e105adbe46512e48.jpg', 0, 1, 'Букет &quot;Ночь перед карнавалом&quot;', 'Доставка букетов', '2020-09-07 15:41:35', '2020-12-19 18:49:07'),
(109, 'delete Букет &quot;Красота&quot;', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Удивительное сочетание любимых цветов всегда популярно и актуально. Композиция прекрасно сочетает в себе классические красные розы и шикарные белые орхидеи и станет желанным подарком к любому празднику.&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Доставим в любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (красная) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Орхидея (белая) - 6&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза 60 см (красная) - 9&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Фисташки зелень - 4&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Фоамиран (голубой) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Тишью (белый) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 3400, '', 'instock', 1000, 'catalog/flowers/orhidei/e5c8c4bbe4a6160bf80f9abf63641e7a.jpg', 0, 1, 'Букет &quot;Красота&quot;', 'Доставка букетов', '2020-09-07 15:44:08', '2020-12-19 17:48:05'),
(110, 'delete Композиция &quot;Фрегат&quot;', 0, '&lt;p&gt;Нестандартным подарком для мужчины может стать особенно трогательное флористическое произведение – цветочная скульптура. Фрегат, выполненный из самых замечательных цветов, выразит ваше исключительное отношение к человеку, которому будет дорого такое внимание.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гипсофила (белая) - 1&lt;/p&gt;&lt;p&gt;Декор - 1&lt;/p&gt;&lt;p&gt;Лист аспидистры (зеленый) - 3&lt;/p&gt;&lt;p&gt;Роза 60 см (белая) - 5&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 2&lt;/p&gt;&lt;p&gt;Статица (сиреневая) - 4&lt;/p&gt;&lt;p&gt;Эустома (лизиантус) (белая) - 3&lt;/p&gt;&lt;p&gt;Пиафлор малый - 1&lt;/p&gt;&lt;p&gt;Корзинка - 1&lt;/p&gt;&lt;p&gt;Орхидея ванда (сиреневая) - 5&lt;/p&gt;', '', 4960, '', 'instock', 1000, 'catalog/flowers/orhidei/756fb970a2a1104780be063462ab72c8.jpg', 0, 1, 'Композиция &quot;Фрегат&quot;', 'Доставка букетов', '2020-09-07 15:52:17', '2020-12-20 12:39:39'),
(111, 'delete Сюзанна', 0, '&lt;p&gt;Тропическая красавица, орхидея фаленопсис в переводе с греческого означает – похожая на бабочку. И этот букет – как будто стайка ярких мотыльков, облепивших прутик. Композиция с веткой орхидеи лаконична и самодостаточна. Оригинальное оформление делает букет изысканным и эффектным.&lt;/p&gt;&lt;p&gt;Орхидеи часто дарят близким людям. Эти цветы будут уместны к торжественному случаю, как дорогой, достойный цветочный презент.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента - 1&lt;/p&gt;&lt;p&gt;Орхидея ветка (розовая) - 1&lt;/p&gt;&lt;p&gt;Пленка (кремовая) - 3&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flowers/orhidei/6f9a3c0e9a19a6fc2739e122ae1fd1f0.jpg', 0, 1, 'Сюзанна', 'Доставка букетов', '2020-09-07 15:58:28', '2020-12-11 10:08:06'),
(112, 'delete Букет &quot;Признание&quot;', 0, '&lt;p&gt;Орхидеи непостижимым образом превращают любой букет в сказочное чудо. Очертания их лепестков делают композицию одновременно яркой и легкой, захватывающей и трогательной. Бледные экзотические красавицы уравновешивают напряженность красного цвета альстромерий и декоративных украшений. Получив от вас такой подарок, женщина и сама словно расцветет.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Альстромерия (красная) - 7&lt;/p&gt;&lt;p&gt;Берграсс (зеленый) - 1&lt;/p&gt;&lt;p&gt;Декор - 2&lt;/p&gt;&lt;p&gt;Лента (красная) - 1&lt;/p&gt;&lt;p&gt;Лист аспидистры (зеленый) - 7&lt;/p&gt;&lt;p&gt;Орхидея (белая) - 5&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 4&lt;/p&gt;&lt;p&gt;Триферн (аспарагус) (зеленый) - 6&lt;/p&gt;&lt;p&gt;Фетр (желтый) - 1&lt;/p&gt;', '', 4100, '', 'instock', 1000, 'catalog/flowers/orhidei/b49b1fd915b485321e32c3d08877792d.jpg', 0, 1, 'Букет &quot;Признание&quot;', 'Доставка букетов', '2020-09-07 16:02:49', '2020-12-19 18:52:42'),
(113, 'delete Композиция &quot;Дыхание августа&quot;', 0, '&lt;p&gt;Как известно, первым, кто подарил обожаемой женщине букет в шляпной коробке, был английский писатель Бернард Шоу. И сейчас считается, что дарить такие кокетливые композиции – значит говорить избраннице о любви и верности. Особенно это касается розовой орхидеи – символа счастья и любви.&lt;/p&gt;&lt;p&gt;Женщина любого возраста оценит такой романтичный подарок, который запомнится надолго!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента (розовая) - 1&lt;/p&gt;&lt;p&gt;Лента (белая) - 1&lt;/p&gt;&lt;p&gt;Орхидея (розовая) - 20&lt;/p&gt;&lt;p&gt;Пиафлор - 2&lt;/p&gt;&lt;p&gt;Фисташки зелень - 4&lt;/p&gt;&lt;p&gt;Пленка (розовая) - 1&lt;/p&gt;&lt;p&gt;Коробка шляпная (малая) - 1&lt;/p&gt;&lt;p&gt;Эвкалипт мини - 2&lt;/p&gt;', '', 6600, '', 'instock', 1000, 'catalog/flowers/orhidei/68a011777bcacf9e02b81f7e955e9e12.jpg', 0, 1, 'Композиция &quot;Дыхание августа&quot;', 'Доставка букетов', '2020-09-07 16:05:34', '2020-12-19 19:12:21'),
(114, 'delete Композиция &quot;Белая жемчужина&quot;', 0, '&lt;p style=&quot;outline: 0px;&quot;&gt;Ярко, роскошно и дорого выглядит эта композиция из орхидей в шляпной коробке. Кажется, будто вся она наполнена жемчугом. Такое впечатление создает игра оттенков бело-розовых орхидей на фоне зеленой листвы фисташки и эвкалипта. Контрастный красный цвет шляпной коробки усиливает жемчужные переливы, благодаря чему вся композиция выглядит богато и статусно.&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Достойный подарок женщине любого возраста!&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Состав:&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Лента (белая) - 1&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Орхидея (белая) - 18&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Пиафлор - 2&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Фисташки зелень - 4&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Пленка (кремовая) - 1&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Коробка шляпная (малая) - 1&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Эвкалипт мини - 2&lt;br&gt;&lt;/p&gt;', 'Ярко, роскошно и дорого выглядит эта композиция из орхидей в шляпной коробке. Кажется, будто вся она наполнена жемчугом. Такое впечатление создает игра оттенков бело-розовых орхидей на фоне зеленой листвы фисташки и эвкалипта. Контрастный красный цвет шля', 6070, '', 'instock', 1000, 'catalog/flowers/orhidei/f5628144cea13c57b9f4850a4f20d0dc.jpg', 0, 1, 'Композиция &quot;Белая жемчужина&quot;', 'Доставка букетов', '2020-09-07 16:08:07', '2020-12-10 11:41:37'),
(115, 'delete Композиция &quot;Тропический зной&quot;', 0, '&lt;p&gt;Солнечное чудо – эта композиция из желтых орхидей, дополненная неувядающей зеленью эвкалипта. Цветы символизируют дружбу и новые начинания, а веточки эвкалипта с их терпким, бодрящим ароматом – изобилие и покровительство. Упакованная в шляпную коробку такого же солнечного цвета, эта композиция станет самодостаточным подарком, приятным сюрпризом близкому человеку, как женщине, так и мужчине.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента (красная) - 1&lt;/p&gt;&lt;p&gt;Орхидея (желтая) - 14&lt;/p&gt;&lt;p&gt;Пиафлор - 2&lt;/p&gt;&lt;p&gt;Эвкалипт - 2&lt;/p&gt;&lt;p&gt;Фисташки зелень - 4&lt;/p&gt;&lt;p&gt;Пленка (красная) - 1&lt;/p&gt;&lt;p&gt;Коробка шляпная (малая) - 1&lt;/p&gt;', '', 5140, '', 'instock', 1000, 'catalog/flowers/orhidei/7c00d9c12607961b13998f69405f1bb4.jpg', 0, 1, 'Композиция &quot;Тропический зной&quot;', 'Доставка букетов', '2020-09-07 16:10:14', '2020-12-10 11:42:17'),
(116, 'delete Букет &quot;Прогноз на любовь&quot;', 0, '&lt;p&gt;Завораживающий букет с королевскими орхидеями, чьи крупные листья словно лоснятся от впитанного ими солнечного света. Изысканные фрезии и ягоды гиперикума смягчают их чёткие контуры, придавая композиции объём. Привлекательна и яркая окраска композиции, которая заряжает позитивом и энергией. Преподнесите её любимой даме.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гиперикум (красный) - 4&lt;/p&gt;&lt;p&gt;Лента (красная) - 1&lt;/p&gt;&lt;p&gt;Лист аспидистры (зеленый) - 9&lt;/p&gt;&lt;p&gt;Орхидея (зеленая) - 9&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 7&lt;/p&gt;&lt;p&gt;Фрезия (желтая) - 10&lt;/p&gt;&lt;p&gt;Сетка (оранжевая) - 2&lt;/p&gt;', '', 5480, '', 'instock', 1000, 'catalog/flowers/orhidei/687704e6869b4dca6e0cae371b78ab77.jpg', 0, 1, 'Букет &quot;Прогноз на любовь&quot;', 'Доставка букетов', '2020-09-07 16:13:13', '2020-12-19 18:52:59'),
(117, 'delete Букет &quot;Серенада&quot;', 0, '&lt;p&gt;Стиль «растрепанный букет», в котором выполнена эта композиция, сейчас на пике популярности. Он собран как будто небрежно из цветов и зелени разных видов. Букет цепляет, заставляет присмотреться к экзотическим орхидеям, обратить внимание на нежность эустом, восхититься элегантностью роз, умилиться миниатюрностью альстромерии. Девушка испытает трепетные чувства, получив такой цветочный подарок!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Альстромерия (белая) - 2&lt;/p&gt;&lt;p&gt;Гиперикум (розовый) - 1&lt;/p&gt;&lt;p&gt;Лента (розовая) - 2&lt;/p&gt;&lt;p&gt;Орхидея (белая) - 3&lt;/p&gt;&lt;p&gt;Эустома (лизиантус) (белая) - 3&lt;/p&gt;&lt;p&gt;Эвкалипт - 4&lt;/p&gt;&lt;p&gt;Фисташки зелень - 2&lt;/p&gt;&lt;p&gt;Пленка (голубая) - 2&lt;/p&gt;&lt;p&gt;Роза кустовая пионовидная (розовая) - 3&lt;/p&gt;&lt;p&gt;Хризантема одноголовая (белая) - 1&lt;/p&gt;&lt;p&gt;Кружево (голубое) - 2&lt;/p&gt;', '', 4400, '', 'instock', 1000, 'catalog/flowers/orhidei/8f4be29abd83ecc8f62fc44a88022051.jpg', 0, 1, 'Букет &quot;Серенада&quot;', 'Доставка букетов', '2020-09-07 16:16:34', '2020-12-19 18:59:02'),
(118, 'Танец бабочек', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;br&gt;&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента (красная) - 1&lt;/p&gt;&lt;p&gt;Лента (розовая) - 1&lt;/p&gt;&lt;p&gt;Орхидея (белая) - 16&lt;/p&gt;&lt;p&gt;Пиафлор - 2&lt;/p&gt;&lt;p&gt;Роза (красная) - 15&lt;/p&gt;&lt;p&gt;Эвкалипт - 5&lt;/p&gt;&lt;p&gt;Пленка - 1&lt;/p&gt;&lt;p&gt;Коробка шляпная - 1&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flowers/orhidei/c962a64eb4261bc539d14ba757dd24a2.jpg', 0, 1, 'Танец бабочек', 'Доставка букетов', '2020-09-07 16:19:14', '2020-12-11 17:33:15'),
(119, 'Букет &quot;Маленькая любовь&quot;', 0, '&lt;p&gt;Невозможно щемящий нежно-розовый цвет прекрасных орхидей ассоциируется с юностью и чистотой. Даже самая недогадливая девушка поймет, что вы желаете перевести отношения в новое русло.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Берграсс (зеленый) - 1&lt;/p&gt;&lt;p&gt;Лента (розовая) - 1&lt;/p&gt;&lt;p&gt;Лист аспидистры (зеленый) - 7&lt;/p&gt;&lt;p&gt;Орхидея (розовая) - 5&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 9&lt;/p&gt;&lt;p&gt;Фетр (белый) - 1&lt;/p&gt;', '', 2540, '', 'instock', 1000, 'catalog/flowers/orhidei/malekajaljubov.jpg', 1, 1, 'Букет &quot;Маленькая любовь&quot;', 'Доставка букетов', '2020-09-07 16:23:17', '2020-12-19 17:55:21'),
(120, 'Время летит', 0, '&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (сиреневая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Хризантема кустовая (белая) - 5&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Фисташки зелень - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Орхидея ванда (сиреневая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Пленка (сиреневая) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Пленка (хамелеон) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 1582, '', 'instock', 1000, 'catalog/flowers/orhidei/047b9276be8864c35fd1ab9faec72d88.jpg', 1, 1, 'Время летит', 'Доставка букетов', '2020-09-07 16:26:16', '2021-02-19 17:19:19'),
(121, 'delete Букет &quot;Сентябрь за  окном&quot;', 0, '&lt;p&gt;Первый учитель и первый звонок… Немного грустно, потому что наступила осень. Но ярко и празднично – потому что впереди веселые школьные дни, полные событиями и новыми знакомствами. Это настроение – праздника и грусти, передает композиция, в которой оранжевые солнышки гербер и красные розы оттеняют нежную сирень гладиолусов и ирисов.&lt;/p&gt;&lt;p&gt;Букет подчеркнет торжественность момента в День знаний.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гербера (оранжевая) - 2&lt;/p&gt;&lt;p&gt;Ирис (сиреневый) - 2&lt;/p&gt;&lt;p&gt;Лента (сиреневая) - 1&lt;/p&gt;&lt;p&gt;Роза (красная) - 3&lt;/p&gt;&lt;p&gt;Эвкалипт - 1&lt;/p&gt;&lt;p&gt;Фисташки зелень - 1&lt;/p&gt;&lt;p&gt;Пленка (розовая) - 1&lt;/p&gt;&lt;p&gt;Фоамиран (сиреневый) - 1&lt;/p&gt;&lt;p&gt;Гладиолус (сиреневый) - 2&lt;/p&gt;', '', 2690, '', 'instock', 1000, 'catalog/flowers/iris/67dc8e7cfeb77b9c68befa37a35a71d9.jpg', 0, 1, 'Букет &quot;Сентябрь за  окном&quot;', 'Доставка букетов', '2020-09-07 16:49:01', '2020-12-19 18:57:38'),
(122, 'delete Букет из ирисов', 0, '&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Удивительная красота сиреневых ирисов очаровывает при одном взгляде. Нежные необыкновенные цветы станут отличным подарком на любое торжество!&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Доставим букет в любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;outline-color: initial; outline-style: initial;&quot;&gt;&lt;b&gt;Внимание!&lt;/b&gt;&lt;/span&gt;&amp;nbsp;При доставке ирисы могут быть в не раскрывшемся состоянии и отличаться от букета на фото.&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Ирис (сиреневый) - 15&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Пленка - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (синяя) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 2360, '', 'instock', 1000, 'catalog/flowers/iris/irisy.jpg', 0, 1, 'Букет из ирисов', 'Доставка букетов', '2020-09-07 18:40:39', '2020-12-19 19:04:57'),
(123, 'delete Букет &quot;Трио&quot;', 0, '&lt;p&gt;Ансамбль желтых роз, холодных утонченных ирисов и хрупких белых альстромерий. Цветы, которые благодаря своей чувственности, а также неповторимому аромату классически подойдут для романтичного подарка.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Альстромерия (белая) - 3&lt;/p&gt;&lt;p&gt;Гипсофила (белая) - 1&lt;/p&gt;&lt;p&gt;Ирис (сиреневый) - 6&lt;/p&gt;&lt;p&gt;Лента (сиреневая) - 1&lt;/p&gt;&lt;p&gt;Лист аспидистры (зеленый) - 7&lt;/p&gt;&lt;p&gt;Органза (желтая) - 1&lt;/p&gt;&lt;p&gt;Роза 60 см (желтая) - 3&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 5&lt;/p&gt;', '', 3090, '', 'instock', 1000, 'catalog/flowers/iris/5523a5055ef62d43f4aaa10be9e85ca4.jpg', 0, 1, 'Букет &quot;Трио&quot;', 'Доставка букетов', '2020-09-07 18:43:06', '2020-12-19 19:01:27'),
(124, 'delete Букет &quot;Ночной блюз&quot;', 0, '&lt;p&gt;Холодные ирисы как будто наполнены морозной свежестью и морским ветром. Но некоторую строгость их смягчают хитроумно приспособленные бусины. Основная роль здесь принадлежит цвету. Оттенки синего любят мечтатели, романтики и люди искусства.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Внимание!&lt;/b&gt; При доставке ирисы могут быть в не раскрывшемся состоянии и отличаться от букета на фото.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Берграсс (зеленый) - 2&lt;/p&gt;&lt;p&gt;Декор - 2&lt;/p&gt;&lt;p&gt;Ирис (сиреневый) - 21&lt;/p&gt;&lt;p&gt;Лента (синяя) - 1&lt;/p&gt;&lt;p&gt;Органза (голубая) - 1&lt;/p&gt;', '', 3680, '', 'instock', 1000, 'catalog/flowers/iris/932913eae2ace879500898e525a6091d.jpg', 0, 1, 'Букет &quot;Ночной блюз&quot;', 'Доставка букетов', '2020-09-07 18:45:03', '2020-12-19 18:36:59'),
(125, 'delete Букет из 51 белого и сиреневого ириса', 0, '&lt;p style=&quot;outline: 0px;&quot;&gt;Букет из восхитительных ирисов уравновешен и спокоен, благороден и тих. Белые цветы добавляют фиолетовым яркости, пронзительности, отчего их и без того глубокий оттенок становится ещё более определённым. Такая синь, что невозможно оторвать глаз!&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Универсальная композиция, которая выразит вашу преданность как женщине, так и мужчине.&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;&lt;b&gt;Внимание!&amp;nbsp;&lt;/b&gt;При доставке ирисы могут быть в не раскрывшемся состоянии и отличаться от букета на фото.&amp;nbsp;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Состав:&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Ирис (белый) - 17&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Ирис (сиреневый) - 34&lt;/p&gt;&lt;p style=&quot;outline: 0px;&quot;&gt;Лента большая (сиреневая) - 1&lt;/p&gt;', '', 4890, '', 'instock', 1000, 'catalog/flowers/iris/7fab3abef977dded931452a578633219.jpg', 0, 1, 'Букет из 51 белого и сиреневого ириса', 'Доставка букетов', '2020-09-07 18:47:50', '2020-12-19 19:03:36'),
(126, 'delete Букет из 51 ириса', 0, '&lt;p&gt;Спокойные тона всегда универсальны, поэтому букет из 51 ириса может предназначаться как даме, так и джентльмену. Эти цветы принесут не только эстетическое наслаждение. По мнению учёных, фиолетовый цвет способствует радостному настроению, успокаивает нервную систему, повышает творческую активность и оказывает влияние на духовное развитие человека.&lt;/p&gt;&lt;p&gt;&lt;b&gt;Внимание! &lt;/b&gt;При доставке ирисы могут быть в не раскрывшемся состоянии и отличаться от букета на фото.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Ирис (сиреневый) - 51&lt;/p&gt;&lt;p&gt;Лента (сиреневая) - 1&lt;/p&gt;', '', 7280, '', 'instock', 1000, 'catalog/flowers/iris/62d49cecae83d1fc74215a1e7883a351.jpg', 0, 1, 'Букет из 51 ириса', 'Доставка букетов', '2020-09-07 18:49:29', '2020-12-19 19:04:27'),
(127, 'delete Подарок', 0, '&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Ирис (сиреневый) - 8&lt;/p&gt;&lt;p&gt;Лента (сиреневая) - 1&lt;/p&gt;&lt;p&gt;Эустома (лизиантус) (белая) - 5&lt;/p&gt;&lt;p&gt;Эвкалипт - 2&lt;/p&gt;&lt;p&gt;Фисташки зелень - 3&lt;/p&gt;&lt;p&gt;Бумага жатая (белая) - 2&lt;/p&gt;&lt;p&gt;Фоамиран (розовый) - 1&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flowers/iris/e626416ad0870730ee221a5cd16e5cf4.jpg', 0, 1, 'Подарок', 'Доставка букетов', '2020-09-07 18:52:06', '2020-12-20 12:43:35'),
(128, 'Голубые огоньки', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Альстромерия (красная) - 4 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Альстромерия (желтая) - 3 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Ирис (сиреневый) - 7 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (красная)&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лист аспидистры (зеленый) - 7 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Роза 60 см (желтая) - 5 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Рускус (зеленый) - 11 шт&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Крафт-бумага&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 4250, '', 'instock', 1000, 'catalog/flowers/iris/f8a007921a2178de6d20b051c2630b1c.jpg', 1, 1, 'Голубые огоньки', 'Доставка букетов', '2020-09-07 18:54:47', '2021-02-19 17:20:24'),
(129, 'delete Вечернее озеро', 0, '&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Нежный загадочный букет раскроет ваши нежные чувства и подарит прекрасное настроение получателю. В композиции идеально сочетаются необыкновенные сиреневые ирисы, нежные эустомы и розовые герберы.&amp;nbsp;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;Доставим букет в любой уголок вашего города!&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Ирис (сиреневый) - 10&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Лента (сиреневая) - 1&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Статица (сиреневая) - 2&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Эустома (лизиантус) (розовая) - 4&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Эвкалипт - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Фисташки зелень - 6&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Крафт-бумага - 3&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гербера мини (розовая) - 7&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flowers/iris/75b83c8c74c455ef07104afd9d225df0.jpg', 0, 1, 'Вечернее озеро', 'Доставка букетов', '2020-09-07 18:57:28', '2020-12-19 19:08:48'),
(130, 'delete Букет невесты &quot;Взрыв эмоций&quot;', 0, '&lt;p&gt;Феерия чувств и страсть соединились в этом изысканном свадебном букете из роз и лилий. Они передают торжество и счастье самого главного момента в жизни. Соседство этих цветов не случайно: белая лилия, которую древние славяне называли «принцессой цветов» – символ чистоты и преданности, а «королева цветов» красная роза – посланница любви. Для самых смелых невест!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Аспарагус умбеллатус (зеленый) - 1&lt;/p&gt;&lt;p&gt;Берграсс (зеленый) - 1&lt;/p&gt;&lt;p&gt;Бутоньерка - 1&lt;/p&gt;&lt;p&gt;Гипсофила (белая) - 1&lt;/p&gt;&lt;p&gt;Лента (красная) - 4&lt;/p&gt;&lt;p&gt;Лилия ветка (белая) - 2&lt;/p&gt;&lt;p&gt;Портбукетница - 1&lt;/p&gt;&lt;p&gt;Роза 60 см (красная) - 7&lt;/p&gt;&lt;p&gt;Хризантема кустовая (белая) - 1&lt;/p&gt;', '', 4220, '', 'instock', 1000, 'catalog/flowers/svadba/d869a9e6e67f1e74b1b76a5b50b30d20.jpg', 0, 1, 'Букет невесты &quot;Взрыв эмоций&quot;', 'Доставка букетов', '2020-09-07 19:12:57', '2020-12-19 19:05:35'),
(131, 'delete Букет невесты &quot;Первая леди&quot;', 0, '&lt;p&gt;От аромата и страстной красоты бархатистых бордовых роз кружится голова. Еще большую выразительность придает им контраст с белыми герберами. Букет подчеркнет чувственную женственность молодой дамы. Белая шелковая лента скрывает стебли цветов, завершая художественный образ. Круглая форма композиции с ее плавными очертаниями превосходна и сама по себе, но особенно хорошо сочетается с классическим нарядом невесты, так как смягчает строгие линии платья.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гербера (белая) - 5&lt;/p&gt;&lt;p&gt;Гипсофила (белая) - 1&lt;/p&gt;&lt;p&gt;Декор - 1&lt;/p&gt;&lt;p&gt;Лента (белая) - 4&lt;/p&gt;&lt;p&gt;Лист галакса - 10&lt;/p&gt;&lt;p&gt;Роза 50 см (красная) - 15&lt;/p&gt;', '', 5250, '', 'instock', 1000, 'catalog/flowers/svadba/483df6e8076073b0f7708c4f0cf3084e.jpg', 0, 1, 'Букет невесты &quot;Первая леди&quot;', 'Доставка букетов', '2020-09-07 20:50:20', '2020-12-19 19:06:45'),
(132, 'delete Букет невесты &quot;Аэлита&quot;', 0, '&lt;p&gt;Букет для новобрачной из роз и ирисов выполнен в традиционной круглой форме, но из насыщенной плотной части выходят выразительные линии, созданные стеблями вероники вайт. Такая игра фактур придает композиции некоторую фантастическую окраску и буквально притягивает к ней внимание. Необычную красоту флористического образа должна подчеркнуть изысканная простота элегантного белого наряда невесты.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Вероника вайт (сиреневый) - 10&lt;/p&gt;&lt;p&gt;Ирис (сиреневый) - 10&lt;/p&gt;&lt;p&gt;Лента (белая) - 4&lt;/p&gt;&lt;p&gt;Роза 60 см (белая) - 11&lt;/p&gt;&lt;p&gt;Лист галакса - 10&lt;/p&gt;', '', 6270, '', 'instock', 1000, 'catalog/flowers/svadba/6b6dd1c5168a0c746a7c4ecf9bf1ac7b.jpg', 0, 1, 'Букет невесты &quot;Аэлита&quot;', 'Доставка букетов', '2020-09-07 20:52:21', '2020-12-19 19:05:14');
INSERT INTO `products` (`id`, `name`, `partner_id`, `description`, `short_description`, `price`, `sku`, `stock_status`, `quantity`, `image`, `status`, `moderated`, `slug`, `category`, `created_at`, `updated_at`) VALUES
(133, 'delete Букет невесты &quot;Виндзорская красавица&quot;', 0, '&lt;p&gt;Прекрасно выполненный роскошный букет придаст невесте уверенности в себе, а потому поистине королевский вид. Белые розы и бледно-розовые фрезии, похожие на тончайшие кружева, – сочетание истинного аристократизма, торжественности и женственности. Пышная композиция составит гармоничный ансамбль со светлым подвенечным платьем молодой красавицы.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента (розовая) - 2&lt;/p&gt;&lt;p&gt;Лента (белая) - 2&lt;/p&gt;&lt;p&gt;Роза 60 см (белая) - 11&lt;/p&gt;&lt;p&gt;Фрезия (розовая) - 20&lt;/p&gt;', '', 5850, '', 'instock', 1000, 'catalog/flowers/svadba/32dbba0c3fe8bfb2fae1c2ed9fbaaf4b.jpg', 0, 1, 'Букет невесты &quot;Виндзорская красавица&quot;', 'Доставка букетов', '2020-09-07 20:54:22', '2020-12-19 19:05:58'),
(134, 'delete Букет невесты &quot;Очарование&quot;', 0, '&lt;p&gt;Композиция из неярких, но прекрасных роз сделает более заметными природную красоту и женственность невесты, создаст ощущение чистоты и невинности. Традиционный круглый букет, декорированный искусственным розовым жемчугом. Благодаря портбукетнице удобно лежит в руке. Очень подходит для украшения возвышенного обряда, символизирующего соединение любящих друг друга людей.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Берграсс (зеленый) - 1&lt;/p&gt;&lt;p&gt;Бутоньерка - 1&lt;/p&gt;&lt;p&gt;Лента (белая) - 4&lt;/p&gt;&lt;p&gt;Портбукетница - 1&lt;/p&gt;&lt;p&gt;Роза 60 см (розовая) - 7&lt;/p&gt;&lt;p&gt;Роза 60 см (белая) - 8&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 7&lt;/p&gt;&lt;p&gt;Декор бусины - 1&lt;/p&gt;', '', 5250, '', 'instock', 1000, 'catalog/flowers/svadba/ecdd79953353aa4ad5db6849c8b38c55.jpg', 0, 1, 'Букет невесты &quot;Очарование&quot;', 'Доставка букетов', '2020-09-07 20:56:32', '2020-12-19 19:06:27'),
(135, 'delete Букет невесты &quot;Страсть&quot;', 0, '&lt;p&gt;Розы – классическая составляющая букета невесты. А бордовые розы – главный символ любви. Такие цветы очень пойдут девушке с темными волосами и смуглой кожей. Такое сочетание внесет легкий флер испанской экзотики. В этом образе угадывается таящийся до поры до времени страстный темперамент.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Бутоньерка - 1&lt;/p&gt;&lt;p&gt;Лента (белая) - 4&lt;/p&gt;&lt;p&gt;Портбукетница - 1&lt;/p&gt;&lt;p&gt;Роза 50 см (красная) - 21&lt;/p&gt;', '', 5120, '', 'instock', 1000, 'catalog/flowers/svadba/6a0e83189aa1c81a690062076b1d9cea.jpg', 0, 1, 'Букет невесты &quot;Страсть&quot;', 'Доставка букетов', '2020-09-07 20:58:09', '2020-12-19 19:07:44'),
(136, 'delete Букет невесты &quot;Тиффани&quot;', 0, '&lt;p&gt;Интересное решение дизайнера – этот свадебный букет, источающий тонкий аромат. Белые розы и эустомы придают ему нежность, голубые шапки гортензии – объем и пышность, зеленые вкрапления фисташки – краски и свежесть, а махровые гвоздики – особый шарм всей композиции.&lt;/p&gt;&lt;p&gt;Букет может стать украшением свадьбы, как в качестве букета невесты, так и цветочного подарка молодоженам.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гвоздика - 5&lt;/p&gt;&lt;p&gt;Гортензия (гидрангия) (голубая) - 1&lt;/p&gt;&lt;p&gt;Лента (белая) - 1&lt;/p&gt;&lt;p&gt;Лента (голубая) - 1&lt;/p&gt;&lt;p&gt;Роза 60 см (белая) - 5&lt;/p&gt;&lt;p&gt;Эустома (лизиантус) (белая) - 3&lt;/p&gt;&lt;p&gt;Фисташки зелень - 3&lt;/p&gt;', '', 4490, '', 'instock', 1000, 'catalog/flowers/svadba/b5d81e7184cc5b5f2b36dc7cd7ee2cfb.jpg', 0, 1, 'Букет невесты &quot;Тиффани&quot;', 'Доставка букетов', '2020-09-07 21:00:52', '2020-12-19 19:08:07'),
(138, 'Свадебный марш (букет невесты)', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;br&gt;&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Альстромерия (сиреневая) - 3&lt;/p&gt;&lt;p&gt;Гипсофила (белая) - 2&lt;/p&gt;&lt;p&gt;Лента (сиреневая) - 4&lt;/p&gt;&lt;p&gt;Роза 60 см (белая) - 3&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 5&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flowers/svadba/e0f75d51616190d27c9d38de85e44b83.jpg', 1, 1, 'Свадебный марш', 'Доставка букетов', '2020-09-07 21:17:10', '2021-02-19 17:32:47'),
(139, 'delete Композиция из 17 белых роз в шляпной коробке', 0, '&lt;p&gt;Монобукет из роз – это изящество, стиль, интеллигентный минимализм. Своеобразной вазой для цветов служит шляпная коробка, которая одновременно является и декоративным элементом, украшающим как сам букет, так и интерьер.&lt;/p&gt;&lt;p&gt;Очень элегантная композиция и удобный практичный цветочный комплимент.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента (белая) - 2&lt;/p&gt;&lt;p&gt;Роза 60 см (белая) - 17&lt;/p&gt;&lt;p&gt;Фетр (белый) - 1&lt;/p&gt;&lt;p&gt;Коробка шляпная (малая) (синяя) - 1&lt;/p&gt;', '', 4500, '', 'instock', 1000, 'catalog/flowers/17white-shlapa2000.png', 0, 1, 'Композиция из 17 белых роз в шляпной коробке', 'Доставка букетов', '2020-09-07 21:33:06', '2020-12-10 20:36:08'),
(140, 'delete Композиция из 25 красных роз в шляпной коробке', 0, '&lt;p&gt;Лаконичный букет из тёмно-красных роз оформлен с помощью шляпной коробки, которая выполняет роль вазы и решает вопрос, куда поставить цветы.&lt;/p&gt;&lt;p&gt;Интересная упаковка придаёт яркой композиции особенный характер. Утончённость этого образа, его красота и удобство для адресата налицо!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента (белая) - 2&lt;/p&gt;&lt;p&gt;Роза 60 см (красная) - 25&lt;/p&gt;&lt;p&gt;Фетр (белый) - 1&lt;/p&gt;&lt;p&gt;Коробка шляпная - 1&lt;/p&gt;', '', 5900, '', 'instock', 1000, 'catalog/flowers/25redshlapa2500.png', 0, 1, 'Композиция из 25 красных роз в шляпной коробке', 'Доставка букетов', '2020-09-07 21:35:49', '2020-12-20 12:40:09'),
(141, 'Скромница', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;br&gt;&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента (белая)&amp;nbsp;&lt;/p&gt;&lt;p&gt;Пиафлор - 2 шт&lt;/p&gt;&lt;p&gt;Хризантема кустовая (белая) - 6 шт&lt;/p&gt;&lt;p&gt;Фисташки зелень - 3 шт&lt;/p&gt;&lt;p&gt;Пленка&amp;nbsp;&lt;/p&gt;&lt;p&gt;Коробка шляпная (черная)&amp;nbsp;&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/flow/edafb8a322c624476a8ef3cb737a892e.jpg', 0, 1, 'Скромница', 'Доставка букетов', '2020-09-07 21:38:35', '2020-12-19 17:31:25'),
(142, 'delete Композиция &quot;Красота сердца&quot;', 0, '&lt;p&gt;Оригинальное цветочное сердце – общепризнанный символ любви, прекрасный элемент таких важных событий, как свадьба, Праздник влюбленных или юбилей. Практически каждая роза этого сердца хранит свою «жемчужину». Эта композиция полностью соответствует неповторимой красоте праздника.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Декор - 2&lt;/p&gt;&lt;p&gt;Каркас - 1&lt;/p&gt;&lt;p&gt;Лента большая - 1&lt;/p&gt;&lt;p&gt;Роза 60 см (красная) - 27&lt;/p&gt;&lt;p&gt;Роза 60 см (желтая) - 56&lt;/p&gt;', '', 16730, '', 'instock', 1000, 'catalog/flow/aebc3643d4e8872de00b87c5785aa2e5.jpg', 0, 1, 'Композиция &quot;Красота сердца&quot;', 'Доставка букетов', '2020-09-07 21:41:17', '2020-12-19 19:13:11'),
(145, 'delete Адель', 0, '&lt;p&gt;Нежный фантазийный букет для настоящих сладкоежек!&lt;/p&gt;&lt;p&gt;Удивительное сочетание клубники и шоколада подарит получателю непередаваемые эмоции и истинное наслаждение!&lt;/p&gt;&lt;p&gt;Состав: клубника свежая, белый шоколад, молочный шоколад, розовый шоколад, кондитерская посыпка.&lt;/p&gt;', 'Нежный фантазийный букет для настоящих сладкоежек!\r\nУдивительное сочетание клубники и шоколада подарит получателю непередаваемые эмоции и истинное наслаждение!\r\nСостав: клубника свежая, белый шоколад, молочный шоколад, розовый шоколад, кондитерская посыпк', 0, '', 'instock', 1000, 'catalog/sedobnyebukety/095258eb-e483-49a6-9.jpg', 0, 1, 'Адель', 'Доставка букетов', '2020-09-28 07:08:18', '2020-12-19 17:39:33'),
(146, 'delete Дамский Каприз', 0, '&lt;p&gt;Если Вы хотите произвести впечатление, то этот букет именно то, что Вам нужно!&lt;/p&gt;&lt;p&gt;Сочетание алой клубники и белых роз способно растопить любое сердце!&lt;/p&gt;&lt;p&gt;Состав: клубника свежая, розы.&lt;/p&gt;', 'Если Вы хотите произвести впечатление, то этот букет именно то, что Вам нужно!\r\n\r\nСочетание алой клубники и белых роз способно растопить любое сердце!\r\n\r\nСостав: клубника свежая, розы.', 0, '', 'instock', 1000, 'catalog/sedobnyebukety/sweet_s_rozami_belymi4.jpg', 0, 1, 'Дамский Каприз', 'Доставка букетов', '2020-09-28 07:09:51', '2020-12-17 15:24:02'),
(147, 'Анастасия', 0, '&lt;p&gt;Яркий, сочный, неординарный! Букет, который сочетает в себе несочетаемое!&lt;/p&gt;&lt;p&gt;Если хотите произвести впечатление, то этот букет именно то, что Вам нужно!&lt;/p&gt;&lt;p&gt;Состав: яблоки, лук, чеснок, хлопок, цветы.&lt;/p&gt;', 'Яркий, сочный, неординарный! Букет, который сочетает в себе несочетаемое!\r\n\r\nЕсли хотите произвести впечатление, то этот букет именно то, что Вам нужно!\r\n\r\nСостав: яблоки, лук, чеснок, хлопок, цветы.', 3890, '', 'instock', 1000, 'catalog/sedobnyebukety/bb6ee615df8603bc594bbbe7c48a53b7.jpg', 1, 1, 'Анастасия', 'Доставка букетов', '2020-09-28 07:11:32', '2020-12-19 17:20:12'),
(148, 'Яблочное настроение', 0, '&lt;p&gt;Яркий и сочный букет, очарует своим ароматом и подарит заряд бодрости на весь день!&lt;/p&gt;&lt;p&gt;Состав: яблоки, лимон, цветы.&lt;/p&gt;', 'Яркий и сочный букет, очарует своим ароматом и подарит заряд бодрости на весь день!\r\n\r\nСостав: яблоки, лимон, цветы.', 0, '', 'instock', 1000, 'catalog/sedobnyebukety/limonchello2-1200x630.jpg', 1, 1, 'Яблочное настроение', 'Доставка букетов', '2020-09-28 07:13:19', '2021-01-18 13:36:11'),
(149, 'delete Букет &quot; Летний день&quot;', 0, '&lt;p&gt;Яркий и сочный букет, очарует своим ароматом и подарит заряд бодрости на весь день!&lt;/p&gt;&lt;p&gt;Состав: яблоки, виноград, апельсин, грецкий орех, кумкват, бергамот.&lt;/p&gt;', 'Яркий и сочный букет, очарует своим ароматом и подарит заряд бодрости на весь день!\r\n\r\nСостав: яблоки, виноград, апельсин, грецкий орех, кумкват, бергамот.', 4240, '', 'instock', 1000, 'catalog/sedobnyebukety/fruktovi-buket-iz-apelsionov-yablok-vinograda.jpg', 0, 1, 'Букет &quot;Летний день&quot;', 'Доставка букетов', '2020-09-28 07:17:51', '2020-12-19 17:42:19'),
(150, 'delete Букет &quot; Тринити&quot;', 0, '&lt;p&gt;Яркий и сочный букет, очарует своим ароматом и подарит получателю незабываемые эмоции!&lt;/p&gt;&lt;p&gt;Состав: яблоки, груши, гранат, персик.&lt;/p&gt;', 'Яркий и сочный букет, очарует своим ароматом и подарит получателю незабываемые эмоции!\r\n\r\nСостав: яблоки, груши, гранат, персик.', 3300, '', 'instock', 1000, 'catalog/sedobnyebukety/b8abd3af6bfe943b5b104ee2795faeef.jpg', 0, 1, 'Букет &quot;Тринити&quot;', 'Доставка букетов', '2020-09-28 07:19:11', '2020-12-19 17:43:15'),
(151, 'delete Букет &quot;Paris&quot;', 0, '&lt;p&gt;Романтичный, чувственный, благородный!&amp;nbsp;&amp;nbsp;&lt;/p&gt;&lt;p&gt;Идеальный букет, чтобы рассказать близкому человеку о своих чувствах.&lt;/p&gt;&lt;p&gt;Состав: розы, клубника свежая, шоколад.&lt;/p&gt;', 'Романтичный, чувственный, благородный!  \r\n\r\nИдеальный букет, чтобы рассказать близкому человеку о своих чувствах.\r\n\r\nСостав: розы, клубника свежая, шоколад.', 5660, '', 'instock', 1000, 'catalog/sedobnyebukety/cvetochnaya-kompoziciyah-iz-klubniki-i-krasnyh-roz-s-shokoladnym-pirozhnym-v-forme-serdca-s-kokosovoj-kroshkoj-iskristoe-schaste.jpg', 0, 1, 'Букет &quot;Paris&quot;', 'Доставка букетов', '2020-09-28 07:20:22', '2020-12-19 17:43:46'),
(152, 'delete Букет &quot;Камилла&quot;', 0, '&lt;p&gt;Фантастический букет, сочетающий в себе все самые яркие нотки лета!&lt;/p&gt;&lt;p&gt;Заставит улыбнуться даже в самый хмурый день!&lt;/p&gt;&lt;p&gt;Состав: яблоки, абрикосы, клубника, черешня, роза кустовая.&lt;/p&gt;', 'Фантастический букет, сочетающий в себе все самые яркие нотки лета!\r\n\r\nЗаставит улыбнуться даже в самый хмурый день!\r\n\r\nСостав: яблоки, абрикосы, клубника, черешня, роза кустовая.', 3770, '', 'instock', 1000, 'catalog/sedobnyebukety/buket-iz-fruktov.jpg', 0, 1, 'Букет &quot;Камилла&quot;', 'Доставка букетов', '2020-09-28 07:21:22', '2020-12-19 17:45:46'),
(153, 'Букет &quot;Мелисса&quot;', 0, '&lt;p&gt;Сочетание ароматной свежей клубники и розового шоколада- лучший подарок для нежной и мечтательной натуры!&lt;/p&gt;&lt;p&gt;Получатель будет в восторге!&lt;/p&gt;&lt;p&gt;Состав: клубника свежая, розовый шоколад.&lt;/p&gt;', 'Сочетание ароматной свежей клубники и розового шоколада- лучший подарок для нежной и мечтательной натуры!\r\n\r\nПолучатель будет в восторге!\r\n\r\nСостав: клубника свежая, розовый шоколад.', 3300, '', 'instock', 1000, 'catalog/sedobnyebukety/1563787927_50260319.jpg', 1, 1, 'Букет &quot;Мелисса&quot;', 'Доставка букетов', '2020-09-28 07:22:18', '2020-12-19 17:55:32'),
(154, 'Букет &quot;Модерн&quot;', 0, '&lt;p&gt;Ягодный букет для ценителей утончённого вкуса.&lt;/p&gt;&lt;p&gt;Сочетание сладкой клубники и освежающей ежевики понравится мечтательным натурам, стремящимся к лёгкости и изысканности в каждой детали.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Состав: клубника свежая, ежевика свежая.&lt;/p&gt;', 'Ягодный букет для ценителей утончённого вкуса.\r\n\r\nСочетание сладкой клубники и освежающей ежевики понравится мечтательным натурам, стремящимся к лёгкости и изысканности в каждой детали. \r\n\r\nСостав: клубника свежая, ежевика свежая.', 3770, '', 'instock', 1000, 'catalog/sedobnyebukety/ovoshchnoy-buket9.jpg', 1, 1, 'Букет &quot;Модерн&quot;', 'Доставка букетов', '2020-09-28 07:23:15', '2020-12-19 17:56:06'),
(155, 'Нежность', 0, '&lt;p&gt;Нежный фантазийный букет для настоящих сладкоежек!&lt;/p&gt;&lt;p&gt;Удивительное сочетание клубники и шоколада подарит получателю непередаваемые эмоции и истинное наслаждение!&lt;/p&gt;&lt;p&gt;Состав: клубника свежая, молочный шоколад, белый шоколад, розовый шоколад, кондитерская посыпка.&lt;/p&gt;', 'Нежный фантазийный букет для настоящих сладкоежек!\r\n\r\nУдивительное сочетание клубники и шоколада подарит получателю непередаваемые эмоции и истинное наслаждение!\r\n\r\nСостав: клубника свежая, молочный шоколад, белый шоколад, розовый шоколад, кондитерская по', 0, '', 'instock', 1000, 'catalog/sedobnyebukety/c98a50ebd5a21606c3715f72bf74e5c1.jpg', 0, 1, 'Нежность', 'Доставка букетов', '2020-09-28 07:24:10', '2020-12-23 08:22:51'),
(156, 'delete Букет &quot;Особенный&quot;', 0, '&lt;p&gt;Яркий, необычный, озорной! Именно так можно сказать про этот букет!&lt;/p&gt;&lt;p&gt;Отличный вариант подарка на любой праздник!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Состав: яблоки свежие, миндаль, кешью, конфеты Raffaello и Ferrero.&lt;/p&gt;', 'Яркий, необычный, озорной! Именно так можно сказать про этот букет!\r\n\r\nОтличный вариант подарка на любой праздник! \r\n\r\nСостав: яблоки свежие, миндаль, кешью, конфеты Raffaello и Ferrero.', 2590, '', 'instock', 1000, 'catalog/sedobnyebukety/22b68f366c524462a07e7323b02204fe.jpg', 0, 1, 'Букет &quot;Особенный&quot;', 'Доставка букетов', '2020-09-28 07:25:14', '2020-12-19 18:49:47'),
(157, 'delete Букет &quot;Престиж&quot;', 0, '&lt;p&gt;Потрясающий, неповторимый, чувственный! Этот букет покорит любое сердце, будьте уверены!&lt;/p&gt;&lt;p&gt;Состав: розы, клубника свежая, клубника в шоколаде, зефир, мята.&lt;/p&gt;', 'Потрясающий, неповторимый, чувственный! Этот букет покорит любое сердце, будьте уверены!\r\n\r\nСостав: розы, клубника свежая, клубника в шоколаде, зефир, мята.', 5300, '', 'instock', 1000, 'catalog/sedobnyebukety/s1200(1).png', 0, 1, 'Букет &quot;Престиж&quot;', 'Доставка букетов', '2020-09-28 07:26:14', '2020-12-19 18:52:01'),
(158, 'delete Букет &quot;Стелла&quot;', 0, '&lt;div&gt;Буйство красок и непередаваемая нежность.. Сочетание легкости, свежести и красоты.&lt;/div&gt;&lt;div&gt;Этот букет очарует и подарит незабываемые эмоции своему получателю!&lt;/div&gt;&lt;div&gt;Состав: яблоки свежие, макаруны, гранат, розы кустовые, мята.&lt;/div&gt;', 'Буйство красок и непередаваемая нежность.. Сочетание легкости, свежести и красоты.\r\nЭтот букет очарует и подарит незабываемые эмоции своему получателю!\r\nСостав: яблоки свежие, макаруны, гранат, розы кустовые, мята.', 5190, '', 'instock', 1000, 'catalog/sedobnyebukety/3-new-2.jpg', 0, 1, 'Букет &quot;Стелла&quot;', 'Доставка букетов', '2020-09-28 07:27:10', '2020-12-19 19:01:08'),
(159, 'delete Клубничное счастье', 0, '&lt;p&gt;Нежный, романтичный букет в форме сердца для настоящих сладкоежек!&lt;/p&gt;&lt;p&gt;Расскажет о Ваших чувствах без слов!&lt;/p&gt;&lt;p&gt;Состав: клубника в шоколаде, кондитерская посыпка, хризантемы.&lt;/p&gt;', 'Нежный, романтичный букет в форме сердца для настоящих сладкоежек!\r\n\r\nРасскажет о Ваших чувствах без слов!\r\n\r\nСостав: клубника в шоколаде, кондитерская посыпка, хризантемы.', 0, '', 'instock', 1000, 'catalog/sedobnyebukety/64424ff2-800x800.jpg', 0, 1, 'Клубничное счастье', 'Доставка букетов', '2020-09-28 07:28:23', '2020-12-19 19:11:58'),
(160, 'delete Воздушные шары в ассортименте', 0, '&lt;p&gt;Замечательные воздушные шары из 100% латекса, готовы украсить собой любое торжество!&lt;/p&gt;&lt;p&gt;Цвета в ассортименте.&lt;/p&gt;', 'Замечательные воздушные шары из 100% латекса, готовы украсить собой любое торжество!\r\n\r\nЦвета в ассортименте.', 100, '', 'instock', 1000, 'catalog/sedobnyebukety/vozdushnyeshary/6b9459a0ecbb7a0fadcac9db1a5088de.jpg', 0, 1, 'Воздушные шары в ассортименте', 'Доставка букетов', '2020-09-28 07:34:09', '2020-12-19 19:09:05'),
(161, 'delete Воздушный шар &quot; 1 сентября&quot;', 0, '&lt;p&gt;Замечательные воздушные шары из 100% латекса, создадут невероятную атмосферу и украсят собой этот важный праздничный день!&lt;/p&gt;&lt;p&gt;Цвета в ассортименте.&lt;/p&gt;', 'Замечательные воздушные шары из 100% латекса, создадут невероятную атмосферу и украсят собой этот важный праздничный день!\r\n\r\nЦвета в ассортименте.', 100, '', 'instock', 1000, 'catalog/sedobnyebukety/vozdushnyeshary/img_4785-1400x1400.jpg', 0, 1, 'Воздушный шар &quot; 1 сентября&quot;', 'Доставка букетов', '2020-09-28 07:35:17', '2020-12-19 19:09:24'),
(162, 'delete Воздушный шар &quot;День Рождения&quot;', 0, '&lt;p&gt;Замечательные воздушные шары из 100% латекса, создадут невероятную атмосферу праздника и подарят получателю незабываемые эмоции!&lt;/p&gt;&lt;p&gt;Цвета в ассортименте.&lt;/p&gt;', 'Замечательные воздушные шары из 100% латекса, создадут невероятную атмосферу праздника и подарят получателю незабываемые эмоции!\r\n\r\nЦвета в ассортименте.', 100, '', 'instock', 1000, 'catalog/sedobnyebukety/vozdushnyeshary/denrozhdenija3.png', 0, 1, 'Воздушный шар &quot;День Рождения&quot;', 'Доставка букетов', '2020-09-28 07:36:19', '2020-12-19 19:09:43'),
(163, 'delete Воздушный шар &quot;День Святого Валентина&quot;', 0, '&lt;p&gt;Замечательные воздушные шары из 100% латекса, создадут неповторимую романтичную атмосферу и будут радовать получателя своей красотой!&lt;/p&gt;&lt;p&gt;Цвета: белый, красный.&lt;/p&gt;', 'Замечательные воздушные шары из 100% латекса, создадут неповторимую романтичную атмосферу и будут радовать получателя своей красотой!\r\n\r\nЦвета: белый, красный.', 100, '', 'instock', 1000, 'catalog/sedobnyebukety/vozdushnyeshary/5e496f97b14a1661e2788c1b.jpg', 0, 1, 'Воздушный шар &quot;День Святого Валентина&quot;', 'Доставка букетов', '2020-09-28 07:37:14', '2020-12-19 19:10:04'),
