(193, 'delete Топпер &quot;От всей души&quot;', 0, '&lt;p&gt;Изящные деревянные топперы украсят цветочную композицию&amp;nbsp;и придадут изюминку Вашему букету!&lt;br&gt;&lt;/p&gt;', 'Изящные деревянные топперы украсят цветочную композицию и придадут изюминку Вашему букету!', 100, '', 'instock', 1000, 'catalog/flowers/toppery/2510c233101920462894ce3aa7e4b54d.ctg.jpg', 0, 1, 'Топпер &quot;От всей души&quot;', 'Доставка букетов', '2020-09-28 08:47:21', '2020-12-20 12:47:35'),
(194, 'delete Топпер &quot;Поздравляю&quot;', 0, '&lt;p&gt;Изящные деревянные топперы украсят цветочную композицию&amp;nbsp;и придадут изюминку Вашему букету!&lt;br&gt;&lt;/p&gt;', 'Изящные деревянные топперы украсят цветочную композицию и придадут изюминку Вашему букету!', 100, '', 'instock', 997, 'catalog/flowers/toppery/pozdravlayu2-1000x800.jpg', 0, 1, 'Топпер &quot;Поздравляю&quot;', 'Доставка букетов', '2020-09-28 08:48:30', '2020-12-20 12:48:04'),
(195, 'delete Топпер &quot;С Юбилеем&quot;', 0, '', '', 100, '', 'instock', 1000, 'catalog/flowers/toppery/s1200.jpg', 0, 1, 'Топпер &quot;С Юбилеем&quot;', 'Доставка букетов', '2020-09-28 08:49:28', '2020-12-20 12:48:36'),
(196, 'Страсть', 0, '&lt;p class=&quot;p1&quot; style=&quot;margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;&lt;p class=&quot;p1&quot; style=&quot;margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&quot;&gt;Состав:&lt;/p&gt;&lt;p class=&quot;p1&quot; style=&quot;margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&quot;&gt;Роза 50см- 5 шт&lt;/p&gt;&lt;p class=&quot;p1&quot; style=&quot;margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&quot;&gt;Эвкалипт- 1 шт&lt;/p&gt;&lt;p class=&quot;p1&quot; style=&quot;margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&quot;&gt;Фисташка- 3 шт&lt;/p&gt;&lt;p class=&quot;p1&quot; style=&quot;margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&quot;&gt;Упаковка&lt;/p&gt;&lt;p class=&quot;p1&quot; style=&quot;margin-bottom: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;&quot;&gt;Лента&lt;/p&gt;', 'Розы не перестают удивлять и восхищать своей красотой, как в этом букете в комбинации с зеленью эвкалипта и фисташки. Обрамленная нарядной упаковкой, вся цветочная композиция выглядит роскошно и презентабельно.', 0, '', 'instock', 999, 'catalog/flowers/strast.jpg', 1, 1, 'Страсть', 'Доставка букетов', '2020-11-20 11:22:39', '2020-12-28 19:56:50'),
(198, 'Ксения', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза белая -50 шт&lt;/p&gt;&lt;p&gt;Крафтовая упаковка&lt;/p&gt;&lt;p&gt;Лента&lt;br&gt;&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Penza/buketizbelihroz_Kseniya.jpg', 1, 1, 'Ксения', 'Доставка букетов', '2020-11-21 14:22:07', '2020-12-28 19:59:32'),
(199, 'Яркий микс', 0, '&lt;p&gt;Букеты из кустовых роз прочно занимают ведущие позиции среди трендов этого сезона. Они настолько полюбились милым женщинам, что, наверняка, еще не один год сохранят свою популярность. И все это благодаря красоте множества маленьких бутонов на стеблях с сочно-зеленой листвой. Они выглядят очаровательно, придают всей композиции пышность, как в этом букете – ярком, позитивном и одновременно трогательном.&lt;/p&gt;&lt;p&gt;Состав: &lt;/p&gt;&lt;p&gt;Роза кустовая микс- 15 шт&lt;/p&gt;&lt;p&gt;Лента&lt;br&gt;&lt;/p&gt;', '', 2366, '', 'instock', 1000, 'catalog/Penza/buketizkustovihroz.jpg', 1, 1, 'Микс', 'Доставка букетов', '2020-11-21 14:25:40', '2020-12-19 18:02:10'),
(200, 'Антракт', 0, '&lt;p&gt;Вы состоялись в жизни и имеете многое? Да, но как часто не хватает деловым и успешным людям сущего «пустяка» − времени на личную жизнь, на разные романтические «глупости». Но если у вас есть главное − желание порадовать женщину, − сделайте небольшую паузу, закажите искусный букет, который создали профессионалы флористики. Это будет грамотной инвестицией в развитие ваших отношений.&lt;/p&gt;&lt;p&gt;Состав: &lt;/p&gt;&lt;p&gt;Роза- 7 шт&lt;/p&gt;&lt;p&gt;Альстромерия- 7 шт&lt;/p&gt;&lt;p&gt;Аспидистра- 7шт&lt;/p&gt;&lt;p&gt;Гипсофила- 3шт&lt;/p&gt;&lt;p&gt;Упаковка &lt;/p&gt;&lt;p&gt;Лента&lt;br&gt;&lt;/p&gt;', 'Вы состоялись в жизни и имеете многое? Да, но как часто не хватает деловым и успешным людям сущего «пустяка» − времени на личную жизнь, на разные романтические «глупости». Но если у вас есть главное − желание порадовать женщину, − сделайте небольшую паузу', 2174, '', 'instock', 1000, 'catalog/Penza/buket_antrakt.jpg', 1, 1, 'Антракт', 'Доставка букетов', '2020-11-21 14:43:12', '2020-11-30 13:01:22'),
(201, 'Белоснежка', 0, '&lt;p&gt;Белоснежные полупрозрачно-акварельные цветки хризантем создают ощущение чистоты и праздничного сияния, а веточки солидаго, похожие на мимозу, привносят в композицию весенние нотки. Оригинальный и привлекательный элемент букета – круглые пуховки, которые контрастируют с величавостью основных цветов, добавляя образу эфирную лёгкость.&lt;/p&gt;&lt;p&gt;Состав:&amp;nbsp;&lt;/p&gt;&lt;p&gt;Хризантема Баккарди- 5 шт&lt;/p&gt;&lt;p&gt;Солидаго жёлтый- 5 шт&lt;/p&gt;&lt;p&gt;Рускус- 5 шт&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;&lt;p&gt;Лента&lt;/p&gt;', 'Белоснежные полупрозрачно-акварельные цветки хризантем создают ощущение чистоты и праздничного сияния, а веточки солидаго, похожие на мимозу, привносят в композицию весенние нотки. Оригинальный и привлекательный элемент букета – круглые пуховки, которые к', 1726, '', 'instock', 1000, 'catalog/Penza/buket_belosnezhka.jpg', 1, 1, 'Белоснежка', 'Доставка букетов', '2020-11-21 14:53:35', '2020-11-30 13:01:41'),
(202, 'Летнее небо', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;br&gt;&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Тюльпан- 21 шт&lt;/p&gt;&lt;p&gt;Ирис синий- 7 шт&lt;/p&gt;&lt;p&gt;Рускус- 7 шт&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;&lt;p&gt;Лента&lt;br&gt;&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Penza/buket_letneenebo.jpg', 1, 1, 'Летнее небо', 'Доставка букетов', '2020-11-21 15:02:08', '2021-02-19 17:30:55'),
(203, 'Малиновые сны', 0, '&lt;p&gt;Такая цветочная композиция поднимет настроение в любой праздник своим нарядным видом. Но можно и не ждать особого случая. Дарите цветы просто так!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза- 11 шт&lt;/p&gt;&lt;p&gt;Фисташка- 5 шт&lt;/p&gt;&lt;p&gt;Хризантема Балтика- 5 шт&lt;/p&gt;&lt;p&gt;Лизиантус белый- 3 шт&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;&lt;p&gt;Лента&lt;br&gt;&lt;/p&gt;', 'Такая цветочная композиция поднимет настроение в любой праздник своим нарядным видом. Но можно и не ждать особого случая. Дарите цветы просто так!', 2558, '', 'instock', 1000, 'catalog/Penza/buket_malinoviesni.jpg', 1, 1, 'Малиновые сны', 'Доставка букетов', '2020-11-21 15:25:14', '2020-11-30 13:02:47'),
(204, 'Радостный день', 0, '&lt;p&gt;Здесь сошлись такие теплые, такие жизнелюбивые краски! Сочная зелень, расположенная по кругу, объединяет в единое целое герберы, альстромерии и хризантемы. Красиво расположенные цветы придают букету выразительность и экспрессию. В тон основным цветам, герберам, подобрана декоративная сетка. Вместе с букетом вы подарите всплеск чувств, ощущение того, что жизнь прекрасна!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гербера- 5 шт&lt;/p&gt;&lt;p&gt;Хризантема Баккарди- 3 шт&lt;/p&gt;&lt;p&gt;Альстромерия жёлтая- 3 шт&lt;/p&gt;&lt;p&gt;Аспидистра- 7 шт&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;&lt;p&gt;Лента&lt;br&gt;&lt;/p&gt;', 'Здесь сошлись такие теплые, такие жизнелюбивые краски! Сочная зелень, расположенная по кругу, объединяет в единое целое герберы, альстромерии и хризантемы. Красиво расположенные цветы придают букету выразительность и экспрессию. В тон основным цветам, гер', 1816, '', 'instock', 1000, 'catalog/Penza/buket_radostnijden.jpg', 1, 1, 'Радостный день', 'Доставка букетов', '2020-11-21 15:34:52', '2020-11-30 13:03:14'),
(205, 'Радость', 0, '&lt;p&gt;Как часто вы говорите своей маме, что любите ее? В повседневной суете и заботах мы иногда забываем говорить маме эти простые и такие нужные слова. Поздравьте свою маму с праздником ярким букетом из благородных роз и гербер, он передаст ей всю силу вашей любви. Не бойтесь выражать свои чувства и не забывайте говорить маме такие важные для нее слова.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гербера- 3 шт&lt;/p&gt;&lt;p&gt;Роза- 3 шт&lt;/p&gt;&lt;p&gt;Кустовая роза- 3 шт&lt;/p&gt;&lt;p&gt;Гиперикум красный- 3 шт&lt;/p&gt;&lt;p&gt;Фисташка зелень- 3 шт&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;&lt;p&gt;Лента&lt;br&gt;&lt;/p&gt;', 'Как часто вы говорите своей маме, что любите ее? В повседневной суете и заботах мы иногда забываем говорить маме эти простые и такие нужные слова. Поздравьте свою маму с праздником ярким букетом из благородных роз и гербер, он передаст ей всю силу вашей л', 2097, '', 'instock', 1000, 'catalog/Penza/buket_radost.jpg', 1, 1, 'Радость', 'Доставка букетов', '2020-11-21 15:38:26', '2020-11-30 13:03:27'),
(206, 'Теплые чувства', 0, '&lt;p&gt;Нежность и восхищение, очарование и теплые чувства - так много можно передать одним букетом цветов из хрупких альстромерий. Будет к лицу милой женщине.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Фисташка зелень- 3 шт&lt;/p&gt;&lt;p&gt;Альстромерия микс- 20 шт&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;&lt;p&gt;Лента&lt;br&gt;&lt;/p&gt;', 'Нежность и восхищение, очарование и теплые чувства - так много можно передать одним букетом цветов из хрупких альстромерий. Будет к лицу милой женщине.', 2430, '', 'instock', 1000, 'catalog/Penza/Buket_Tepliechuvstva.jpg', 1, 1, 'Теплые чувства', 'Доставка букетов', '2020-11-21 15:46:02', '2020-12-19 18:01:51'),
(207, 'Добрые слова', 0, '&lt;p&gt;Теплые нежные слова приятны любому человеку. Но сказать о своих чувствах можно не только словами, но и цветами. Удивительно нежный и покоряющий чистотой букет из белых роз и хризантем невольно притягивает взгляд, источая тонкий аромат. Благодаря множеству белоснежных лепестков вся композиция выглядит воздушно, как взбитые сливки.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Хризантема Балтика-5 шт&lt;/p&gt;&lt;p&gt;Роза- 5 шт&lt;/p&gt;&lt;p&gt;Рускус- 3 шт&lt;/p&gt;&lt;p&gt;Упаковка &lt;/p&gt;&lt;p&gt;Лента&lt;br&gt;&lt;/p&gt;', 'Теплые нежные слова приятны любому человеку. Но сказать о своих чувствах можно не только словами, но и цветами. Удивительно нежный и покоряющий чистотой букет из белых роз и хризантем невольно притягивает взгляд, источая тонкий аромат. Благодаря множеству', 1513, '', 'instock', 1000, 'catalog/Penza/buket_dobrieslova.jpg', 1, 1, 'Добрые слова', 'Доставка букетов', '2020-11-21 15:59:21', '2020-12-11 10:46:24'),
(208, 'Весенний рассвет', 0, '&lt;p&gt;Прекрасной красоты букет из 21 нежной альстромерии порадует ваших любимых!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Альстромерии - 21 шт&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'Прекрасной красоты букет из 21 нежной альстромерии порадует ваших любимых!', 3050, '', 'instock', 1000, 'catalog/Omsk/5.jpg', 1, 1, 'Весенний рассвет', 'Доставка букетов', '2020-11-21 19:04:49', '2020-11-30 12:56:01'),
(209, 'Хризантемы и розы', 0, '&lt;p&gt;Милый букет из белых пушистых хризантем станет желанным подарком для каждого!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Кустовая хризантема Бакарди- 9 шт&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;', 'Милый букет из белых пушистых хризантем станет желанным подарком для каждого!', 1598, '', 'instock', 1000, 'catalog/Penza/buket_dobrieslova.jpg', 1, 1, 'Хризантемы и розы', 'Доставка букетов', '2020-11-21 19:38:26', '2020-12-19 18:02:00'),
(211, 'Солнечные веснушки', 0, '&lt;p&gt;Милый разноцветный букетик обрадует получателя и расскажет о ваших самых нежных чувствах.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гипсофила&lt;/p&gt;&lt;p&gt;Фисташка&lt;/p&gt;&lt;p&gt;Коробка (+оазис)&lt;/p&gt;', 'Милый разноцветный букетик обрадует получателя и расскажет о ваших самых нежных чувствах.', 1390, '', 'instock', 999, 'catalog/Omsk/8.jpg', 1, 1, 'Солнечные веснушки', 'Доставка букетов', '2020-11-22 12:36:47', '2020-12-14 14:00:43'),
(212, 'Белое облачко', 0, '&lt;p&gt;Совершенно очаровательный белоснежный букет будет очень приятным подарком на любое торжество!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Хризантема Магнум&lt;/p&gt;&lt;p&gt;Рускус&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;', 'Совершенно очаровательный белоснежный букет будет очень приятным подарком на любое торжество!', 2763, '', 'instock', 1000, 'catalog/Omsk/1.jpg', 1, 1, 'Белое облачко', 'Доставка букетов', '2020-11-22 12:42:47', '2020-11-30 12:55:24'),
(213, 'Очарование', 0, '&lt;p&gt;Очаровательный букет с особенным настроением. Будьте уверены, что эта композиция станет приятным подарком.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза Кенди лайт&lt;/p&gt;&lt;p&gt;Альстромерии&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;', 'Очаровательный букет с особенным настроением. Будьте уверены, что эта композиция станет приятным подарком.', 3048, '', 'instock', 1000, 'catalog/Omsk/7.jpg', 1, 1, 'Очарование', 'Доставка букетов', '2020-11-22 12:53:49', '2020-11-30 12:57:50'),
(214, 'Красочное безумие', 0, '&lt;p&gt;Нежные краски цветов в этой композиции прекрасно сочетаются вместе! Выбирайте этот букет и дарите счастье!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза кустовая&lt;/p&gt;&lt;p&gt;Альстромерии&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'Нежные краски цветов в этой композиции прекрасно сочетаются вместе! Выбирайте этот букет и дарите счастье!', 2870, '', 'instock', 1000, 'catalog/Omsk/2.jpg', 1, 1, 'Красочное безумие', 'Доставка букетов', '2020-11-22 13:04:27', '2020-11-30 12:56:51');
