(215, 'Нежное безумие', 0, '&lt;p&gt;Удивительное сочетание нежных цветов в этой композиции вызовет самые приятные чувства у тех, кто получит ее в подарок.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Эустома&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Альстромерия&lt;/p&gt;&lt;p&gt;Фисташка&lt;/p&gt;&lt;p&gt;Эвкалипт&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'Удивительное сочетание нежных цветов в этой композиции вызовет самые приятные чувства у тех, кто получит ее в подарок.', 1707, '', 'instock', 1000, 'catalog/Omsk/3.jpg', 1, 1, 'Нежное безумие', 'Доставка букетов', '2020-11-22 13:12:50', '2020-11-30 12:57:24'),
(216, 'Розовое наслаждение', 0, '&lt;p&gt;Легкий восхитительный букет, прекрасно подобранные цветы в розовых тонах - прекрасный подарок на ваш праздник!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Эустома&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Альстромерия&lt;/p&gt;&lt;p&gt;Фисташка&lt;/p&gt;&lt;p&gt;Эвкалипт&lt;/p&gt;&lt;p&gt;Гербера&lt;/p&gt;', 'Легкий восхитительный букет, прекрасно подобранные цветы в розовых тонах - прекрасный подарок на ваш праздник!', 1707, '', 'instock', 1000, 'catalog/Omsk/6.jpg', 1, 1, 'Розовое наслаждение', 'Доставка букетов', '2020-11-22 13:28:03', '2020-11-30 12:58:17'),
(217, 'Алые розы', 0, '&lt;p&gt;Прекрасный яркий букет из роз. Такой букет точно обрадует получателя и станет прекрасным подарком!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы (цвет в ассортименте)- 25 шт&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;', 'Прекрасный яркий букет из роз. Такой букет точно обрадует получателя и станет прекрасным подарком!', 3635, '', 'instock', 1000, 'catalog/Omsk/ymDgHEep99M(1).jpg', 1, 1, 'Алые розы', 'Доставка букетов', '2020-11-23 08:15:38', '2021-01-22 08:55:48'),
(218, 'Коралловое восхищение', 0, '&lt;div style=&quot;text-align: justify;&quot;&gt;&lt;font size=&quot;1&quot; face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Сочетание легких оттенков цветов позволит передать все нежные эмоции для Ваших любимых и родных.&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;text-align: justify;&quot;&gt;&lt;font size=&quot;1&quot; face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Состав:&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Гербера&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;text-align: justify;&quot;&gt;&lt;span style=&quot;font-size: 12px; font-family: Arial;&quot;&gt;Роза кустовая&lt;/span&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Эустома&lt;/span&gt;&lt;/font&gt;&lt;/div&gt;&lt;div style=&quot;text-align: justify;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 12px;&quot;&gt;Рускус&lt;/span&gt;&lt;br&gt;&lt;/font&gt;&lt;/div&gt;', '', 1854, '', 'instock', 1000, 'catalog/Miass/Korallovoevoshischenie.jpg', 1, 1, 'Коралловое восхищение', 'Доставка букетов', '2020-11-24 19:41:43', '2020-12-22 18:14:59'),
(219, 'Яркий момент', 0, '&lt;p&gt;Яркие цветы для яркого события оставят незабываемое впечатления в этот день.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гербера&lt;/p&gt;&lt;p&gt;Роза белая&lt;/p&gt;&lt;p&gt;Гортензия&lt;/p&gt;&lt;p&gt;Эустома&lt;/p&gt;&lt;p&gt;Рускус&lt;/p&gt;&lt;p&gt;Монстера&lt;/p&gt;&lt;p&gt;Альстромерия&lt;/p&gt;', 'Яркие цветы для яркого события оставят незабываемое впечатления в этот день.', 3645, '', 'instock', 1000, 'catalog/Miass/YArkijmoment.jpg', 1, 1, 'Яркий момент', 'Доставка букетов', '2020-11-24 19:49:06', '2020-12-22 18:15:29'),
(220, 'Осенний сюрприз', 0, '&lt;p&gt;Композиция-комплимент отлично подойдет как для Ваших родных так и для коллег.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Альстромерия&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Лимониум&lt;/p&gt;&lt;p&gt;Фисташка&lt;br&gt;&lt;/p&gt;', 'Композиция-комплимент отлично подойдет как для Ваших родных так и для коллег.', 959, '', 'instock', 1000, 'catalog/Miass/Osennijsyurpriz.jpg', 1, 1, 'Осенний сюрприз', 'Доставка букетов', '2020-11-24 19:54:08', '2020-12-22 18:18:10'),
(221, 'Приятный комплимент', 0, '&lt;p&gt;Розы в оригинальной упаковке — незабываемый подарок для представительниц прекрасного пола.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Гипсофила&lt;/p&gt;', 'Розы в оригинальной упаковке — незабываемый подарок для представительниц прекрасного пола.', 1598, '', 'instock', 1000, 'catalog/Miass/Priyatnijkompliment.jpg', 1, 1, 'Приятный комплимент', 'Доставка букетов', '2020-11-24 19:59:19', '2020-12-22 18:17:00'),
(222, 'Лавандовая прелесть', 0, '&lt;p&gt;Сочетание белых и сиреневых хризантем подарят весеннее настроение на весь день.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Хризантема&lt;/p&gt;&lt;p&gt;Солидаго (милка)&lt;br&gt;&lt;/p&gt;', 'Сочетание белых и сиреневых хризантем подарят весеннее настроение на весь день.', 703, '', 'instock', 999, 'catalog/Miass/Lavandovayaprelest.jpg', 1, 1, 'Лавандовая прелесть', 'Доставка букетов', '2020-11-24 20:01:36', '2020-12-22 18:17:41'),
(223, 'Яркий день', 0, '&lt;p&gt;Дуэт ярко- розовых и нежно -розовых цветов в этом букете подарят позитивные эмоции.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гербера&lt;/p&gt;&lt;p&gt;Эустома&lt;/p&gt;&lt;p&gt;Альстромерия&lt;/p&gt;&lt;p&gt;Рускус&lt;br&gt;&lt;/p&gt;', 'Дуэт ярко- розовых и нежно -розовых цветов в этом букете подарят позитивные эмоции.', 1406, '', 'instock', 1000, 'catalog/Miass/YArkijden.jpg', 1, 1, 'Яркий день', 'Доставка букетов', '2020-11-24 20:08:34', '2020-12-22 18:18:55'),
(224, 'Для неё', 0, '&lt;p&gt;Микс нежных и ароматных цветов могут без слов рассказать о Ваших пожеланиях.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Эустома&lt;/p&gt;&lt;p&gt;Альстромерия&lt;/p&gt;&lt;p&gt;Гвоздика кустовая&lt;/p&gt;&lt;p&gt;Гиперикум&lt;/p&gt;&lt;p&gt;Салал&lt;br&gt;&lt;/p&gt;', 'Микс нежных и ароматных цветов могут без слов рассказать о Ваших пожеланиях.', 2941, '', 'instock', 1000, 'catalog/Miass/dlyanee.jpg', 1, 1, 'Для неё', 'Доставка букетов', '2020-11-24 20:13:19', '2020-12-22 18:19:42'),
(225, 'Для тебя', 0, '&lt;p&gt;Красные розы всегда популярны,а в сочетании с орхидеями придают букету презентабельность и оригинальность.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Эустома&lt;/p&gt;&lt;p&gt;Орхидея&lt;/p&gt;&lt;p&gt;Лимониум&lt;/p&gt;&lt;p&gt;Аспидистра&lt;br&gt;&lt;/p&gt;', 'Красные розы всегда популярны,а в сочетании с орхидеями придают букету презентабельность и оригинальность.', 2494, '', 'instock', 1000, 'catalog/Miass/«Dlyatebya».jpg', 1, 1, 'Для тебя', 'Доставка букетов', '2020-11-24 20:26:59', '2020-12-22 18:20:37'),
(226, 'Маленькая радость', 0, '&lt;p&gt;Небольшая композиция из ярких роз доказывает ,что и самое простое может быть интересным.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Гипсофила&lt;/p&gt;&lt;p&gt;Рускус&lt;br&gt;&lt;/p&gt;', 'Небольшая композиция из ярких роз доказывает ,что и самое простое может быть интересным.', 703, '', 'instock', 1000, 'catalog/Miass/Malenkayaradost.jpg', 1, 1, 'Маленькая радость', 'Доставка букетов', '2020-11-24 20:50:38', '2020-12-22 18:21:37'),
(227, 'Прикосновение вальса', 0, '&lt;p&gt;Этот букет покоряет роскошными цветами собранные в нежно-розовой гамме.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза кустовая&lt;/p&gt;&lt;p&gt;Альстромерия&lt;/p&gt;&lt;p&gt;Фисташка&lt;/p&gt;&lt;p&gt;Рускус&lt;br&gt;&lt;/p&gt;', 'Этот букет покоряет роскошными цветами собранные в нежно-розовой гамме.', 3197, '', 'instock', 1000, 'catalog/Miass/Prikosnovenievalsa.jpg', 1, 1, 'Прикосновение вальса', 'Доставка букетов', '2020-11-25 13:31:24', '2020-12-22 18:22:13'),
(228, 'Бабочки в листве', 0, '&lt;p&gt;Классическое сочетания красного и зеленого всегда предают букету роскошный вид.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Орхидея&lt;/p&gt;&lt;p&gt;Хризантема&lt;/p&gt;&lt;p&gt;Рускус&lt;br&gt;&lt;/p&gt;', 'Классическое сочетания красного и зеленого всегда предают букету роскошный вид.', 2174, '', 'instock', 1000, 'catalog/Miass/Babochkivlistve.jpg', 1, 1, 'Бабочки в листве', 'Доставка букетов', '2020-11-25 13:35:26', '2020-12-22 18:22:42'),
(229, 'Нежность', 0, '&lt;p&gt;Белые цветы, классический вариант как&amp;nbsp; для торжественных событий так и для приятных сюрпризов.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лилия&lt;/p&gt;&lt;p&gt;Гвоздика штучная&lt;/p&gt;&lt;p&gt;Гвоздика кустовая&lt;/p&gt;&lt;p&gt;Рускус&lt;/p&gt;&lt;p&gt;Берграсс&lt;br&gt;&lt;/p&gt;', 'Белые цветы, классический вариант как  для торжественных событий так и для приятных сюрпризов.', 1215, '', 'instock', 1000, 'catalog/Miass/Nezhnost.jpg', 1, 1, 'Нежность', 'Доставка букетов', '2020-11-25 13:37:41', '2020-12-22 18:23:20'),
(230, 'Приятный комплимент 2', 0, '&lt;p&gt;Розы в оригинальной упаковке — незабываемый подарок для представительниц прекрасного пола.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза&amp;nbsp;&lt;/p&gt;&lt;p&gt;Гипсофила&lt;/p&gt;', 'Розы в оригинальной упаковке — незабываемый подарок для представительниц прекрасного пола.', 1470, '', 'instock', 1000, 'catalog/Miass/Priyatnijkompliment2.jpg', 1, 1, 'Приятный комплимент 2', 'Доставка букетов', '2020-11-25 13:45:48', '2020-12-22 18:24:14'),
(231, 'Восхищение', 0, '&lt;p&gt;Роскошное сочетание бело-розовых оттенков придают букету объемный и изысканный вид,что без сомнения вызовет только восхищение.&amp;nbsp;&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гортензия&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Эустома&lt;/p&gt;&lt;p&gt;Эвкалипт&lt;/p&gt;&lt;p&gt;Гвоздика кустовая&lt;/p&gt;&lt;p&gt;Матиола&lt;/p&gt;', 'Роскошное сочетание бело-розовых оттенков придают букету объемный и изысканный вид,что без сомнения вызовет только восхищение. ', 4476, '', 'instock', 1000, 'catalog/Miass/Voshischenie.jpg', 1, 1, 'Восхищение', 'Доставка букетов', '2020-11-25 13:49:54', '2020-12-22 18:24:54'),
(232, 'Солнечное настроение', 0, '&lt;p&gt;Солнечные цвета закружат Вас в вихре ярких красок и позитивных эмоций.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Хризантема&lt;/p&gt;&lt;p&gt;Лилия&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Фисташка&lt;br&gt;&lt;/p&gt;', 'Солнечные цвета закружат Вас в вихре ярких красок и позитивных эмоций.', 1790, '', 'instock', 1000, 'catalog/Miass/Solnechnoenastroenie.jpg', 1, 1, 'Солнечное настроение', 'Доставка букетов', '2020-11-25 13:53:09', '2020-12-22 18:25:29'),
(233, 'Летняя поляна', 0, '&lt;p&gt;Синий и оранжевый оттенки всегда привлекают внимание.Такое сочетание может заинтересовать даже искушенный взгляд.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гортензия&lt;/p&gt;&lt;p&gt;Гербера&lt;/p&gt;&lt;p&gt;Хризантема&lt;/p&gt;&lt;p&gt;Роза кустовая&lt;/p&gt;&lt;p&gt;Рускус&lt;br&gt;&lt;/p&gt;', 'Синий и оранжевый оттенки всегда привлекают внимание.Такое сочетание может заинтересовать даже искушенный взгляд.', 2174, '', 'instock', 1000, 'catalog/Miass/Letnyayapolyana.jpg', 1, 1, 'Летняя поляна', 'Доставка букетов', '2020-11-25 13:59:48', '2020-12-22 18:26:03'),
(234, 'Сладкое настроение', 0, '&lt;p&gt;Набор: цветы и конфеты, это классический и интересный подарок для интересного человека.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза кустовая&lt;/p&gt;&lt;p&gt;Хризантема&lt;/p&gt;&lt;p&gt;Гипсофила&lt;/p&gt;&lt;p&gt;Конфеты&lt;br&gt;&lt;/p&gt;', 'Набор :цветы и конфеты, это классический и интересный подарок для интересного человека.', 1215, '', 'instock', 1000, 'catalog/Miass/Sladkoenastroenie.jpg', 1, 1, 'Сладкое настроение', 'Доставка букетов', '2020-11-25 14:03:05', '2020-12-22 18:27:11'),
(235, 'Веселый микс', 0, '&lt;p&gt;Ассорти разных цветов в подарочной коробке напомнит о лете и солнечных днях.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Хризантема&lt;/p&gt;&lt;p&gt;Эустома&lt;/p&gt;&lt;p&gt;Альстромерия&lt;/p&gt;&lt;p&gt;Фисташка&lt;br&gt;&lt;/p&gt;', 'Ассорти разных цветов в подарочной коробке напомнит о лете и солнечных днях.', 1087, '', 'instock', 1000, 'catalog/Miass/Veselijmiks.jpg', 1, 1, 'Веселый микс', 'Доставка букетов', '2020-11-25 14:07:43', '2020-12-22 18:27:41'),
(236, 'Торжественный дуэт', 0, '&lt;p&gt;Этот букет отлично подойдет для любого торжества.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Лилия&lt;/p&gt;&lt;p&gt;Гербера&lt;/p&gt;&lt;p&gt;Роза кустовая&lt;/p&gt;&lt;p&gt;Гипсофила&lt;/p&gt;&lt;p&gt;Рускус&lt;br&gt;&lt;/p&gt;', 'Этот букет отлично подойдет для любого торжества.', 4476, '', 'instock', 1000, 'catalog/Miass/torzhestvennijduet.jpg', 1, 1, 'Торжественный дуэт', 'Доставка букетов', '2020-11-25 14:10:11', '2020-12-22 18:28:21'),
