(259, 'Осенний', 0, '&lt;p&gt;Яркий микс из подсолнуха, хризантемы, экзотических эрингиума и целлозии с добавлением веточки сезонной калины и сухоцветов в стильном газетном крафте с ярким акцентом.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Хризантема&lt;/p&gt;&lt;p&gt;Подсолнух&lt;/p&gt;&lt;p&gt;Эрингиум&lt;/p&gt;&lt;p&gt;Целлозия&lt;/p&gt;&lt;p&gt;Калина&lt;/p&gt;&lt;p&gt;Сухоцветы&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;', 'Яркий микс из подсолнуха, хризантемы, экзотических эрингиума и целлозии с добавлением веточки сезонной калины и сухоцветов в стильном газетном крафте с ярким акцентом.', 0, '', 'instock', 1000, 'catalog/Sankt-Peterburg/buketosennij.jpg', 1, 1, 'Осенний', 'Доставка букетов', '2020-11-27 17:56:29', '2020-12-23 14:31:01'),
(260, 'Комплимент', 0, '&lt;p&gt;Нежный букет в крафтовой упаковке в пастельных тонах из кустовой хризантемы, розы, альстромерии и лизиантуса. Цветы дополняет ароматная зелень эвкалипта и немного сухоцветов.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Хризантема кустовая&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Альстромерия&lt;/p&gt;&lt;p&gt;Лизиантус&lt;/p&gt;&lt;p&gt;Эвкалипт&lt;/p&gt;&lt;p&gt;Сухоцветы&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;', 'Нежный букет в крафтовой упаковке в пастельных тонах из кустовой хризантемы, розы, альстромерии и лизиантуса. Цветы дополняет ароматная зелень эвкалипта и немного сухоцветов.', 0, '', 'instock', 999, 'catalog/Sankt-Peterburg/buketkompliment.jpg', 1, 1, 'Комплимент', 'Доставка букетов', '2020-11-27 18:00:28', '2020-12-24 13:11:13'),
(261, 'Свежесть', 0, '&lt;p&gt;Пять крупных белых роз в сочетании с модной крашенной гипсофилой и сухоцветами в стильной ассиметричной упаковке.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза белая&lt;/p&gt;&lt;p&gt;Гипсофила&lt;/p&gt;&lt;p&gt;Сухоцветы&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;', 'Пять крупных белых роз в сочетании с модной крашенной гипсофилой и сухоцветами в стильной ассиметричной упаковке.', 0, '', 'instock', 1000, 'catalog/Sankt-Peterburg/buketsvezhest.jpg', 1, 1, 'Свежесть', 'Доставка букетов', '2020-11-27 18:02:52', '2020-12-23 14:32:10'),
(262, 'Микс', 0, '&lt;p&gt;В составе стильная сиреневая роза, осенняя астра, немного гипсофилы и зелени эвкалипта. Акцентом является пучок ярких сухоцветов и комбинорованная многослойная упаковка.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Астра&lt;/p&gt;&lt;p&gt;Гипсофила&lt;/p&gt;&lt;p&gt;Эвкалипт&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'В составе стильная сиреневая роза, осенняя астра, немного гипсофилы и зелени эвкалипта. Акцентом является пучок ярких сухоцветов и комбинорованная многослойная упаковка.', 0, '', 'instock', 1000, 'catalog/Sankt-Peterburg/BuketMiks.jpg', 1, 1, 'Микс', 'Доставка букетов', '2020-11-27 18:11:03', '2020-12-24 13:12:02'),
(263, 'Букет с гортензией', 0, '&lt;p&gt;Благородная розовая гортензия в окружении зелени эвкалипта, ярких сухоцветов и лимониума в лаконичной упаковке.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гортензия&lt;/p&gt;&lt;p&gt;Эвкалипт&lt;/p&gt;&lt;p&gt;Сухоцветы&lt;/p&gt;&lt;p&gt;Лимониум&lt;/p&gt;', 'Благородная розовая гортензия в окружении зелени эвкалипта, ярких сухоцветов и лимониума в лаконичной упаковке.', 2367, '', 'instock', 1000, 'catalog/Sankt-Peterburg/buketsgortenziej.jpg', 1, 1, 'Букет с гортензией', 'Доставка букетов', '2020-11-27 18:15:05', '2020-12-23 14:33:19'),
(264, 'Композиция в лукошке', 0, '&lt;p&gt;Летняя композиция в полевом стиле из мелких кустовых розочек, ромашек, гипсофилы и свежей зелени с добавлением сухоцветов — колосков.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза кустовая&lt;/p&gt;&lt;p&gt;Ромашка&lt;/p&gt;&lt;p&gt;Гипсофила&lt;/p&gt;&lt;p&gt;Зелень&lt;/p&gt;&lt;p&gt;Сухоцветы&lt;/p&gt;', 'Летняя композиция в полевом стиле из мелких кустовых розочек, ромашек, гипсофилы и свежей зелени с добавлением сухоцветов — колосков.', 0, '', 'instock', 1000, 'catalog/Sankt-Peterburg/kompoziciyavlukoshke.jpg', 1, 1, 'Композиция в лукошке', 'Доставка букетов', '2020-11-27 18:19:12', '2020-12-23 14:33:55'),
