(266, 'Композиция в кружке', 0, '&lt;p&gt;Очень удобный вариант композиции — милая керамическая кружка, наполненная розами, лизиантусом, статицей и свежей зеленью.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы&lt;/p&gt;&lt;p&gt;Лизиантус&lt;/p&gt;&lt;p&gt;Статица&lt;/p&gt;&lt;p&gt;Зелень&lt;/p&gt;&lt;p&gt;Кружка&lt;/p&gt;', 'Очень удобный вариант композиции — милая керамическая кружка, наполненная розами, лизиантусом, статицей и свежей зеленью.', 0, '', 'instock', 1000, 'catalog/Sankt-Peterburg/uompoziciyavkruzhke.jpg', 1, 1, 'Композиция в кружке', 'Доставка букетов', '2020-11-27 18:31:10', '2020-12-24 13:16:08'),
(267, 'Композиция в жестяном бидоне', 0, '&lt;p&gt;Нежная хризантема разных сортов, гипсофила и сухоцветы в стильном металлическом бидоне с ручкой.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Хризантема&lt;/p&gt;&lt;p&gt;Гипсофила&lt;/p&gt;&lt;p&gt;Сухоцветы&lt;/p&gt;&lt;p&gt;Металлический бидон&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', 'Нежная хризантема разных сортов, гипсофила и сухоцветы в стильном металлическом бидоне с ручкой', 0, '', 'instock', 1000, 'catalog/Sankt-Peterburg/Kompoziciyavzhestyanombidone.jpg', 1, 1, 'Композиция в жестяном бидоне', 'Доставка букетов', '2020-11-27 18:36:30', '2020-12-23 14:36:34'),
