(270, '15 роз', 0, '&lt;p&gt;Сочетание двух цветов – розового и белого в одном букете, придает всей композиции нежность и элегантность. Следуя цветочному словарю, подарить розы – значит, сказать о симпатии, зарождающейся любви и светлых чувствах.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы - 15 шт&lt;/p&gt;', '15 роз', 2878, '', 'instock', 1000, 'catalog/Nalchik/buketiz15roz_.jpg', 1, 1, '15 роз', 'Доставка букетов', '2020-11-29 13:38:46', '2021-01-22 08:20:34'),
(271, '17 роз', 0, '&lt;p&gt;Классическая простота букета для истинных ценителей благородной красоты. Белый оттенок роз несёт в себе ощущение мира, совершенства, непорочности и чистоты.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы - 17 шт&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;', '', 3262, '', 'instock', 1000, 'catalog/Nalchik/5.jpg', 1, 1, '17 роз', 'Доставка букетов', '2020-11-29 13:48:03', '2021-01-22 08:18:24'),
(272, 'Вдохновение', 0, '&lt;p&gt;Ни один цветок не завоевал популярности так быстро, как хризантема. Увлечение хризантемами сейчас очень велико. Эти цветы ныне торжествуют. Белые хризантемы наполнят душу покоем и умиротворенностью. Подарите этот букет женщине, например в День весны, и он долгое время будет напоминать ей о вас.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Хризантемы&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', 4477, '', 'instock', 1000, 'catalog/Nalchik/Buketizhrizantem.jpg', 1, 1, 'Вдохновение', 'Доставка букетов', '2020-11-29 13:55:09', '2020-12-19 17:58:11'),
(273, 'С наилучшими пожеланиями', 0, '&lt;p&gt;Прекрасная композиция для подарка любимым!&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', 5244, '', 'instock', 1000, 'catalog/Nalchik/Akciya!.jpg', 1, 1, 'С наилучшими пожеланиями', 'Доставка букетов', '2020-11-29 14:05:00', '2020-12-19 17:59:05'),
(274, 'Для самой любимой', 0, '&lt;p&gt;Такой букет порадует даже самых избирательных. Подарите счастливую улыбку - подарите этот букет!&lt;/p&gt;&lt;p&gt;Игрушка не входит в стоимость.&lt;/p&gt;', '', 3837, '', 'instock', 1000, 'catalog/Nalchik/Akciya_2.jpg', 1, 1, 'Для самой любимой', 'Доставка букетов', '2020-11-29 14:09:03', '2020-12-19 17:58:24'),
(275, 'Розы и конфеты', 0, '&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы - 9 шт&lt;/p&gt;&lt;p&gt;Коробка - 1 шт&lt;/p&gt;&lt;p&gt;Конфеты шоколадные&lt;/p&gt;', '', 3582, '', 'instock', 1000, 'catalog/Nalchik/Kompoziciyakonfetiirozi.jpeg', 1, 1, 'Розы и конфеты', 'Доставка букетов', '2020-11-29 14:18:05', '2020-12-19 17:58:54'),
(276, 'Композиция из гипсофилы', 0, '&lt;p&gt;Творческий союз природы и художника, когда цветы становятся выразителями самых искренних и добросердечных чувств.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гипсофила&lt;/p&gt;&lt;p&gt;Шляпная коробка&lt;/p&gt;&lt;p&gt;Лента&lt;/p&gt;', '', 3837, '', 'instock', 1000, 'catalog/Nalchik/Kompoziciyaizgipsofil.JPG', 1, 1, 'Композиция из гипсофилы', 'Доставка букетов', '2020-11-29 14:23:46', '2020-11-30 12:01:28'),
(277, 'Композиция из гипсофилы 2', 0, '&lt;p&gt;Интересная упаковка придаёт яркой композиции особенный характер. Утончённость этого образа, его красота очарует получателя!&lt;/p&gt;&lt;p&gt;Состав:&amp;nbsp;&lt;/p&gt;&lt;p&gt;Гипсофила&lt;/p&gt;&lt;p&gt;Коробка&lt;/p&gt;&lt;p&gt;Лента&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;', '', 2814, '', 'instock', 1000, 'catalog/Nalchik/Kompoziciyaizgipsofili2.jpeg', 1, 1, 'Композиция из гипсофилы 2', 'Доставка букетов', '2020-11-29 14:41:12', '2020-12-19 17:58:35'),
(278, 'Композиция из роз', 0, '&lt;p&gt;Лаконичный букет из тёмно-красных роз оформлен с помощью шляпной коробки, которая выполняет роль вазы и решает вопрос, куда поставить цветы.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы&lt;/p&gt;&lt;p&gt;Шляпная коробка&lt;/p&gt;', '', 4477, '', 'instock', 1000, 'catalog/Nalchik/Kompoziciyaizroz.jpeg.jpeg', 1, 1, 'Композиция из роз', 'Доставка букетов', '2020-11-29 14:45:07', '2020-11-30 12:02:01'),
(279, 'Кустовые розы', 0, '&lt;p&gt;Букеты из кустовых роз настолько полюбились милым женщинам, что, наверняка, еще не один год сохранят свою популярность. И все это благодаря красоте множества маленьких бутонов на стеблях с сочно-зеленой листвой. Они выглядят очаровательно, придают всей композиции пышность, как в этом букете – ярком, позитивном и одновременно трогательном.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы кустовые&lt;/p&gt;&lt;p&gt;Упаковка&lt;/p&gt;', '', 3582, '', 'instock', 1000, 'catalog/Nalchik/Buketizkustovihroz_.jpg', 1, 1, 'Кустовые розы', 'Доставка букетов', '2020-11-29 14:48:16', '2021-01-22 08:53:47'),
(280, '7 красных роз в крафте', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза (красная) 40 см- 7&lt;/p&gt;&lt;p&gt;Крафт-бумага - 1&lt;/p&gt;&lt;p&gt;Лента красная - 1&lt;br&gt;&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Obschie/Buketiz7krasnihrozvkrafte.jpg', 1, 1, '7 красных роз в крафте', 'Доставка букетов', '2020-11-30 11:53:00', '2021-02-17 17:20:14'),
(281, '11 красных роз в крафте', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза (красная) 40 см - 11 шт&lt;br&gt;&lt;/p&gt;&lt;p&gt;Крафт-бумага&amp;nbsp;&lt;/p&gt;&lt;p&gt;Лента&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1001, 'catalog/Obschie/Buketiz11krasnihrozvkrafte.jpg', 1, 1, '11 красных роз в крафте', 'Доставка букетов', '2020-11-30 19:16:13', '2021-02-17 17:09:03'),
(283, '35 красных роз в крафте', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента красная - 1&lt;br&gt;&lt;/p&gt;&lt;p&gt;Крафт-бумага - 1&lt;/p&gt;&lt;p&gt;Роза (красная) - 35 шт&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 999, 'catalog/Obschie/Buketiz35krasnihrozvkrafte.jpg', 1, 1, '35 красных роз в крафте', 'Доставка букетов', '2020-11-30 19:25:44', '2021-02-17 17:17:59'),
(284, '7 белых роз', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;br&gt;&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы белые 40 см - 7 шт&lt;/p&gt;', '', 0, '', 'instock', 998, 'catalog/Obschie/Buketiz7belihroz.jpg', 1, 1, '7 белых роз', 'Доставка букетов', '2020-11-30 19:31:56', '2021-02-17 17:28:12'),
