(286, '15 красных роз', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы красные - 15 шт&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Obschie/Buketiz15krasnihroz.jpg', 1, 1, '15 красных роз', 'Доставка букетов', '2020-11-30 19:44:29', '2021-02-17 17:23:10'),
(287, '15 белых и красных роз', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента красная&amp;nbsp;&lt;/p&gt;&lt;p&gt;Роза (белая) - 8 шт&lt;/p&gt;&lt;p&gt;Роза (красная) - 7 шт&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1001, 'catalog/Obschie/Buketiz15belihikrasnihroz.jpg', 1, 1, '15 белых и красных роз', 'Доставка букетов', '2020-11-30 19:51:35', '2021-02-17 21:37:32'),
(288, '15 белых роз', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы белые 40 см- 15 шт&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Obschie/Buketiz15belihroz.jpg', 1, 1, '15 белых роз', 'Доставка букетов', '2020-11-30 20:01:32', '2021-02-17 17:30:53'),
(289, 'Как, было же 18', 0, '&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы - 1 шт&lt;/p&gt;&lt;p&gt;Зелень&lt;/p&gt;&lt;p&gt;Поздравительный шар&lt;/p&gt;', '', 2367, '', 'instock', 1000, 'catalog/Tomsk/Kak,bilozhe18.jpg', 1, 1, 'Как, было же 18', 'Доставка букетов', '2020-12-01 12:00:13', '2020-12-19 18:16:43'),
(290, 'Кристина', 0, '&lt;p&gt;Сочетание ярких и легких оттенков цветов позволит&amp;nbsp; передать все&amp;nbsp; эмоции для Ваших любимых и родных.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Герберы&lt;/p&gt;&lt;p&gt;Розы&lt;/p&gt;&lt;p&gt;Роза кустовые&lt;/p&gt;&lt;p&gt;Альстромерии&lt;/p&gt;&lt;p&gt;Фисташка&lt;/p&gt;&lt;p&gt;Хризантемы кустовые&lt;br&gt;&lt;/p&gt;', '', 2814, '', 'instock', 1000, 'catalog/Miass/Miass2/5(1).jpg', 1, 1, 'Кристина', 'Доставка букетов', '2020-12-01 12:13:29', '2020-12-22 18:31:20'),
(291, 'Камилла', 0, '&lt;p&gt;Эта композиция отличный подарок для мамы в ее знаменательный день.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы&lt;/p&gt;&lt;p&gt;Розы кустовые&lt;/p&gt;&lt;p&gt;Фисташка&lt;/p&gt;', '', 2303, '', 'instock', 1000, 'catalog/Miass/Miass2/14.jpg', 1, 1, 'Камилла', 'Доставка букетов', '2020-12-01 12:18:00', '2020-12-22 18:31:47'),
(292, 'Арлекин', 0, '&lt;p&gt;Яркие краски цветов придают букету незабываемый вид. Такие же яркие эмоции будут и у тех, кто получит его в подарок.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы&lt;/p&gt;&lt;p&gt;Розы кустовые&lt;/p&gt;&lt;p&gt;Фисташка&lt;/p&gt;&lt;p&gt;Хризантемы кустовые&lt;/p&gt;', '', 2367, '', 'instock', 1000, 'catalog/Miass/Miass2/9.jpg', 1, 1, 'Арлекин', 'Доставка букетов', '2020-12-01 12:21:03', '2020-12-22 18:32:17'),
(293, 'Сладкий бриз', 0, '&lt;p&gt;Контрастное сочетание белого и синего, всегда привлекают внимание, а в комплекте со сладостями&amp;nbsp; оставят незабываемый&amp;nbsp; приятный восторг.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лилия&lt;/p&gt;&lt;p&gt;Гвоздика кустовая&lt;/p&gt;&lt;p&gt;Роза кустовая&lt;/p&gt;&lt;p&gt;Эвкалипт&lt;/p&gt;&lt;p&gt;Лимониум&lt;/p&gt;&lt;p&gt;Рахат- лукум&lt;/p&gt;&lt;p&gt;Щербет&lt;/p&gt;&lt;p&gt;Нуга&lt;/p&gt;', '', 2367, '', 'instock', 1000, 'catalog/Miass/Miass2/15.jpg', 1, 1, 'Сладкий бриз', 'Доставка букетов', '2020-12-01 12:47:08', '2020-12-20 18:40:34'),
(294, 'Белла', 0, '&lt;p&gt;Воздушный и нежный букет с шикарными розовыми розами хороший выбор для знаменательного торжества.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Гвоздика кустовая&lt;/p&gt;&lt;p&gt;Эустома&lt;/p&gt;&lt;p&gt;Эвкалипт&lt;/p&gt;', '', 2111, '', 'instock', 1000, 'catalog/Miass/Miass2/3(1).jpg', 1, 1, 'Белла', 'Доставка букетов', '2020-12-01 12:49:17', '2020-12-20 18:44:06'),
(295, 'Привет, мама', 0, '&lt;p&gt;Все красивое- просто. Три розы с топпером для мамы ,отличный способ передать ей «привет».&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы&lt;/p&gt;', '', 640, '', 'instock', 1000, 'catalog/Miass/Miass2/2(1).jpg', 1, 1, 'Привет, мама', 'Доставка букетов', '2020-12-01 12:50:44', '2020-12-22 18:33:02'),
(296, 'Грация', 0, '&lt;p&gt;Композиция из белоснежных роз и нежно- розовых эустом. Отличный подарок как для родных ,так и для дорогих друзей.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Эустома&lt;/p&gt;&lt;p&gt;Лимониум&lt;/p&gt;&lt;p&gt;Фисташка&lt;/p&gt;', '', 1280, '', 'instock', 1000, 'catalog/Miass/Miass2/1(1).jpg', 1, 1, 'Грация', 'Доставка букетов', '2020-12-01 12:54:07', '2020-12-22 18:33:35'),
(297, 'Эванжелина', 0, '&lt;p&gt;«Сама нежность» ,только так можно описать этот&amp;nbsp; букет. Монохромное сочетание розового&amp;nbsp; придает элегантность, а ярко- розовые кустовые розы изюминку данному букету.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гербера&lt;/p&gt;&lt;p&gt;Роза кустовая&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Эвкалипт&lt;br&gt;&lt;/p&gt;', '', 2559, '', 'instock', 1000, 'catalog/Miass/Miass2/10.jpg', 1, 1, 'Эванжелина', 'Доставка букетов', '2020-12-01 12:57:58', '2020-12-22 18:34:14'),
(298, 'Бархат 1', 0, '&lt;p&gt;Красные «бархатные» розы-классический подарок на любое мероприятие.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы&lt;/p&gt;', '', 1471, '', 'instock', 1000, 'catalog/Miass/Miass2/8.jpg', 1, 1, 'Бархат 1', 'Доставка букетов', '2020-12-01 13:00:30', '2020-12-22 18:34:47'),
(299, 'Бархат 2', 0, '&lt;p&gt;Красные «бархатные» розы-классический подарок на любое мероприятие.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы&lt;/p&gt;', '', 1919, '', 'instock', 1000, 'catalog/Miass/Miass2/7.jpg', 1, 1, 'Бархат 2', 'Доставка букетов', '2020-12-01 13:01:56', '2020-12-22 18:35:20'),
(300, 'Клементина', 0, '&lt;p&gt;Такое прекрасное&amp;nbsp; сочетание цветов и расцветки в композиции , оценит даже самый требовательный ценитель.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гербера&lt;/p&gt;&lt;p&gt;Хризантема кустовая&lt;/p&gt;&lt;p&gt;Ирисы&lt;/p&gt;&lt;p&gt;Эустома&lt;/p&gt;&lt;p&gt;Солидаго&lt;/p&gt;&lt;p&gt;Статица&lt;/p&gt;&lt;p&gt;Фисташка&lt;br&gt;&lt;/p&gt;', '', 1599, '', 'instock', 1000, 'catalog/Miass/Miass2/16.jpg', 1, 1, 'Клементина', 'Доставка букетов', '2020-12-01 13:04:40', '2020-12-22 18:36:05'),
(301, 'Радость', 0, '&lt;p&gt;&amp;nbsp;Ярко-желтые и ярко- оранжевые розы в интересной подарочной коробочке подарят позитивные эмоции Вашим родным и близким.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Роза кустовая&lt;/p&gt;&lt;p&gt;Эустома&lt;/p&gt;&lt;p&gt;Фисташка&lt;br&gt;&lt;/p&gt;', '', 1471, '', 'instock', 1000, 'catalog/Miass/Miass2/13.jpg', 1, 1, 'Радость', 'Доставка букетов', '2020-12-01 13:07:05', '2020-12-22 18:36:32'),
(302, 'Нежность', 0, '&lt;p&gt;Нежные белые розы подходят&amp;nbsp; к любому оттенку букета или композиции, но в сочетании с лиловым смотрится просто превосходно.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Эустома&lt;/p&gt;&lt;p&gt;Хризантема кустовая&lt;/p&gt;&lt;p&gt;Солидаго&lt;/p&gt;&lt;p&gt;Рускус&lt;br&gt;&lt;/p&gt;', '', 1598, '', 'instock', 1000, 'catalog/Miass/Miass2/12.jpg', 1, 1, 'Нежность', 'Доставка букетов', '2020-12-01 13:09:02', '2020-12-23 08:07:57'),
(303, 'Стелла', 0, '&lt;p&gt;Дуэт красный и белый всегда выигрышный вариант для торжественного момента.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Альстромерия&lt;/p&gt;&lt;p&gt;Фисташка&lt;br&gt;&lt;/p&gt;', '', 2175, '', 'instock', 1000, 'catalog/Miass/Miass2/4(2).jpg', 1, 1, 'Стелла', 'Доставка букетов', '2020-12-01 13:10:29', '2020-12-22 18:37:55'),
(304, 'Анжелика', 0, '&lt;p&gt;Сочный ,яркий и объемный букет. Насыщенные расцветки розового и малинового вызывают только радостные эмоции.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гербера&lt;/p&gt;&lt;p&gt;Роза&lt;/p&gt;&lt;p&gt;Роза кустовая&lt;/p&gt;&lt;p&gt;Альстромерия&lt;/p&gt;&lt;p&gt;Фисташка&lt;br&gt;&lt;/p&gt;', '', 2367, '', 'instock', 1000, 'catalog/Miass/Miass2/6.jpg', 1, 1, 'Анжелика', 'Доставка букетов', '2020-12-01 13:12:28', '2020-12-22 18:38:24'),
(305, 'Летний секрет', 0, '&lt;p&gt;Синий и оранжевый оттенки всегда привлекают внимание. Такое сочетание напоминает летнюю поляну усеянную всеми цветами радуги благоухающих цветов.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гербера&lt;/p&gt;&lt;p&gt;Хризантема кустовая&lt;/p&gt;&lt;p&gt;Эустома&lt;/p&gt;&lt;p&gt;Статица&lt;/p&gt;&lt;p&gt;Лимониум&lt;/p&gt;&lt;p&gt;Салал&lt;br&gt;&lt;/p&gt;', '', 1280, '', 'instock', 1000, 'catalog/Miass/Miass2/11.jpg', 1, 1, 'Летний секрет', 'Доставка букетов', '2020-12-01 13:17:49', '2020-12-22 18:39:11'),
(306, 'LOWE', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза 60 см (красная) - 21 шт&lt;br&gt;&lt;/p&gt;&lt;p&gt;Пленка розовая&amp;nbsp;&lt;/p&gt;&lt;p&gt;Фоамиран розовый&lt;/p&gt;&lt;p&gt;Лента красная&amp;nbsp;&lt;br&gt;&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Obschie/Love.jpg', 0, 1, 'LOWE', 'Доставка букетов', '2020-12-01 13:43:02', '2020-12-23 11:33:36'),
(307, 'Воздушный десерт', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента белая&amp;nbsp;&lt;/p&gt;&lt;p&gt;Фисташки зелень&amp;nbsp;&lt;/p&gt;&lt;p&gt;Пленка&amp;nbsp;&lt;/p&gt;&lt;p&gt;Хризантема одноголовая (белая) - 7 шт&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Obschie/Vozdushnijdesert.jpg', 1, 1, 'Воздушный десерт', 'Доставка букетов', '2020-12-01 13:45:57', '2021-02-19 17:36:58'),
(308, 'Идеальное утро', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Альстромерия (розовая) - 3 шт&lt;/p&gt;&lt;p&gt;Гербера (розовая) - 3 шт&lt;/p&gt;&lt;br&gt;', '', 0, '', 'instock', 1000, 'catalog/Obschie/idealnoeutro.jpg', 1, 1, 'Идеальное утро', 'Доставка букетов', '2020-12-01 18:07:31', '2021-04-13 13:46:19'),
