(310, '11 белых роз', 0, '&lt;p&gt;Классическая простота букета для истинных ценителей благородной красоты. Белый оттенок роз несёт в себе ощущение мира, совершенства, непорочности и чистоты.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Розы белые 60 см- 11 шт&lt;br&gt;&lt;/p&gt;&lt;p&gt;Лента&lt;br&gt;&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Obschie/a3e5e850b3a79812e214b2be9ca3b3e8.jpg', 1, 1, '11 белых роз', 'Доставка букетов', '2020-12-01 19:10:06', '2021-02-12 11:58:06'),
(311, 'Императрица', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента белая&amp;nbsp;&lt;/p&gt;&lt;p&gt;Лист аспидистры (Зеленый) - 8 шт&lt;/p&gt;&lt;p&gt;Роза 60 см (Белый) - 25 шт&lt;/p&gt;&lt;p&gt;Рускус (Зеленый) - 10 шт&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Obschie/Imperatrica.jpg', 1, 1, 'Императрица', 'Доставка букетов', '2020-12-01 19:28:55', '2021-02-19 17:41:36'),
(312, 'Воздушный поцелуй', 0, '&lt;p&gt;Простота этого букета обманчива – красные альстромерии пробиваются сквозь белые шапки хризантем, как первые чувства – чистые и яркие одновременно. Вся эта пышная композиция в красном фетре напоминает множество воздушных поцелуев, которые можно послать своей избраннице, без слов признаться ей в любви. И никакое расстояние не станет этому преградой.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Альстромерия (красная) - 7 шт&lt;/p&gt;&lt;p&gt;Лента белая&amp;nbsp;&lt;/p&gt;&lt;p&gt;Фетр красный&amp;nbsp;&lt;/p&gt;&lt;p&gt;Хризантема кустовая (белая) - 11 шт&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Obschie/Vozdushnijpoceluj.jpg', 1, 1, 'Воздушный поцелуй', 'Доставка букетов', '2020-12-01 19:31:48', '2021-02-19 17:38:47'),
(313, 'Дела сердечные', 0, '&lt;p&gt;Очаровательный букет, созданный с любовью руками наших флористов, - это отличный подарок для ваших близких. Доставим в любой уголок вашего города!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента белая&lt;/p&gt;&lt;p&gt;Орхидея (белая) - 3 шт&lt;/p&gt;&lt;p&gt;Роза кустовая (белая) - 4 шт&lt;/p&gt;&lt;p&gt;Лизиантус (белый) - 5 шт&lt;/p&gt;&lt;p&gt;Фисташки зелень - 3 шт&lt;/p&gt;&lt;p&gt;&amp;nbsp;Пленка голубая&amp;nbsp;&lt;/p&gt;&lt;p&gt;Хризантема одноголовая (белая) - 3 шт&lt;/p&gt;&lt;p&gt;Кружево (голубое)&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Obschie/Delaserdechnie.jpg', 1, 1, 'Дела сердечные', 'Доставка букетов', '2020-12-01 19:37:48', '2021-02-19 17:39:33'),
(314, 'Легкое пробуждение', 0, '&lt;p&gt;Яркая, по-настоящему солнечная композиция с очень теплой аурой задаст позитивное настроение на целый день. Пышные желтые хризантемы, усыпанные звездочками белой гипсофилы и укутанные искрящейся органзой, как солнечные лучики, украсят любое хмурое утро.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гипсофила (белая) - 3 шт&lt;/p&gt;&lt;p&gt;Лента (зеленая)&lt;/p&gt;&lt;p&gt;Органза (желтая)&lt;/p&gt;&lt;p&gt;Рускус (зеленый) - 6 шт&lt;/p&gt;&lt;p&gt;Хризантема кустовая (желтая) - 7 шт&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Obschie/Legkoeprobuzhdenie.jpg', 1, 1, 'Легкое пробуждение', 'Доставка букетов', '2020-12-01 19:40:03', '2021-03-31 08:54:22'),
