(332, '51 желтый тюльпан', 0, '&lt;p&gt;Яркое, солнечное «платье» букета из тюльпанов стимулирует появление отличного настроения, весёлого и бодрого состояния духа. Такой подарок пожелает долгой и благополучной жизни и символизирует счастье в браке.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Лента зеленая&amp;nbsp;&lt;/p&gt;&lt;p&gt;Тюльпан (желтый) - 51 шт&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Obschie/Buketiz51zheltogotyulpana.jpg', 1, 1, '51 желтый тюльпан', 'Доставка букетов', '2020-12-01 21:02:03', '2021-02-19 17:26:19'),
