(335, '25 красных тюльпанов', 0, '&lt;p&gt;Тюльпаны обладают простой, но скульптурно-выразительной формой. Здесь собраны в охапку прекрасные тюльпаны насыщенного красного цвета. Поскольку они еще обернуты в золотистую сетку, получилась яркая, притягивающая взгляд композиция.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Тюльпан (красный) - 25 шт&lt;/p&gt;&lt;p&gt;Органза (желтая)&amp;nbsp;&lt;/p&gt;&lt;p&gt;Лента красная&amp;nbsp;&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Obschie/Buketiz25krasnihtyulpanov.jpg', 1, 1, '25 красных тюльпанов', 'Доставка букетов', '2020-12-01 21:07:32', '2021-02-19 17:23:45'),
