(698, 'Сладкий поцелуй', 0, '&lt;p&gt;Сладкий поцелуй из красных роз и сладкого ????????&lt;/p&gt;&lt;div&gt;Состав:&lt;/div&gt;&lt;div&gt;&lt;div&gt;Роза чеховский сад - 11 шт. &lt;/div&gt;&lt;div&gt;Киндер сюрприз - 2 шт. &lt;/div&gt;&lt;div&gt;Шоколад kinder chocolate 100г - 1 шт. &lt;/div&gt;&lt;div&gt;чио рио - 3 шт. &lt;/div&gt;&lt;div&gt;зелень декоративная - 6 шт. &lt;/div&gt;&lt;div&gt;Упаковка дизайнерская - 6 шт. &lt;/div&gt;&lt;div&gt;Лента атласная - 1 шт.&lt;/div&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/Vkusniebuketi/2_-_Sharm_Flovery-removebg-preview(1).png', 1, 1, 'Сладкий поцелуй', 'Доставка букетов', '2021-02-03 14:24:02', '2021-02-03 14:24:02'),
(699, 'Мужской букет', 0, '&lt;p&gt;Креативный букет для мужчины, необычный формат преподнесения!!! Никто не устоит!!! Все остальные пожелания можно откорректировать у нашего флориста!!!&lt;/p&gt;&lt;div&gt;Состав:&lt;/div&gt;&lt;div&gt;&lt;div&gt;Сыр косичка - 2 шт. &lt;/div&gt;&lt;div&gt;колбаса салями - 4 шт. &lt;/div&gt;&lt;div&gt;колбаски пиколини - 1 шт. &lt;/div&gt;&lt;div&gt;колбаски чешские (упаковка) - 2 шт. &lt;/div&gt;&lt;div&gt;сыр тильзитер уп - 1 шт. &lt;/div&gt;&lt;div&gt;Упаковка дизайнерская - 3 шт. &lt;/div&gt;&lt;div&gt;Лента атласная - 2 шт.&lt;/div&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/Vkusniebuketi/3_-_Sharm_Flovery-removebg-preview(1).png', 1, 1, 'Мужской букет', 'Доставка букетов', '2021-02-03 14:26:04', '2021-02-03 14:26:04'),
(700, 'Мандариновый фреш', 0, '&lt;p&gt;Солнечные сочные мандарины с корицей и фундуком. Букет радует глаз и напоминает о самом любимом волшебном празднике!&lt;/p&gt;&lt;div&gt;Состав:&lt;/div&gt;&lt;div&gt;&lt;div&gt;Мандарин фрукт - 19 шт. &lt;/div&gt;&lt;div&gt;Фундук - 100 гр. &lt;/div&gt;&lt;div&gt;Корица - 3 шт. &lt;/div&gt;&lt;div&gt;Нобилис - 3 шт. &lt;/div&gt;&lt;div&gt;Упаковка - 6 шт.&lt;/div&gt;&lt;div&gt;Лента атласная - 1 шт.&lt;/div&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/Vkusniebuketi/4_-_Sharm_Flovery-removebg-preview(1).png', 1, 1, 'Мандариновый фреш', 'Доставка букетов', '2021-02-03 14:27:22', '2021-02-03 14:27:22'),
(701, 'Витаминка', 0, '&lt;p&gt;Витаминный букет, так актуален в наше время!!! Порадует, подсластит, и подкрепит получательницу)&lt;/p&gt;&lt;div&gt;Состав:&lt;/div&gt;&lt;div&gt;&lt;div&gt;Мандарин - 3 шт. &lt;/div&gt;&lt;div&gt;Лимон - 1 шт. &lt;/div&gt;&lt;div&gt;Корица - 4 шт. &lt;/div&gt;&lt;div&gt;Илекс - 3 шт. &lt;/div&gt;&lt;div&gt;Хлопок - 1 шт. &lt;/div&gt;&lt;div&gt;Нобилис - 6 шт. &lt;/div&gt;&lt;div&gt;Упаковка - 6 шт. &lt;/div&gt;&lt;div&gt;Лента - 2 шт.&lt;/div&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/Vkusniebuketi/5_-_Sharm_Flovery-removebg-preview(1).png', 1, 1, 'Витаминка', 'Доставка букетов', '2021-02-03 14:29:23', '2021-02-03 14:58:47'),
(702, 'Горячий глинтвейн ☕', 0, '&lt;p&gt;&quot;Горячий глинтвейн&quot; ☕ Вы спросите почему такое название!? Все очень просто. Когда смотришь на данный букет, то в голове сразу это слово - глинтвейн???? который делается из лимона и корицы, ну и конечно многое другое)&lt;/p&gt;&lt;div&gt;Состав:&lt;/div&gt;&lt;div&gt;&lt;div&gt;Мандарин - 7 шт. &lt;/div&gt;&lt;div&gt;Апельсин - 1 шт. &lt;/div&gt;&lt;div&gt;Корица палочки - 5 шт. &lt;/div&gt;&lt;div&gt;Хлопок - 3 шт. &lt;/div&gt;&lt;div&gt;Сухоцветы - 3 шт. &lt;/div&gt;&lt;div&gt;Ель нобилис - 9 шт. &lt;/div&gt;&lt;div&gt;Упаковка - 7 шт. &lt;/div&gt;&lt;div&gt;Лента атласная - 2 шт.&lt;/div&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/Vkusniebuketi/6_-_Sharm_Flovery-removebg-preview(1).png', 1, 1, 'Горячий глинтвейн ☕', 'Доставка букетов', '2021-02-03 14:30:47', '2021-02-03 14:30:47'),
(703, 'Ягодке моей', 0, '&lt;p&gt;Яркий букет с фруктами в красно персиковой цветовой гамме!!! Ни одна девушка не устоит перед таким букетом!!! Букет собран только что здесь и сейчас!!! Универсален подойдёт для любого повода!!! Подарить можно и жене и коллеге!!!&lt;/p&gt;&lt;div&gt;Состав:&lt;/div&gt;&lt;div&gt;&lt;div&gt;Роза - 5 шт. &lt;/div&gt;&lt;div&gt;Роза кустовая - 4 шт. &lt;/div&gt;&lt;div&gt;Альстромерия - 5 шт. &lt;/div&gt;&lt;div&gt;Аспидистра - 3 шт. &lt;/div&gt;&lt;div&gt;зелень декоративная - 3 шт. &lt;/div&gt;&lt;div&gt;Персик - 1 шт. &lt;/div&gt;&lt;div&gt;Яблоко - 3 шт. &lt;/div&gt;&lt;div&gt;Нектарин - 2 шт. &lt;/div&gt;&lt;div&gt;Вибурнум ягодный - 3 шт. &lt;/div&gt;&lt;div&gt;Упаковка дизайнерская - 3 шт.&lt;/div&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/Vkusniebuketi/7_-_Sharm_Flovery-removebg-preview(1).png', 1, 1, 'Ягодке моей', 'Доставка букетов', '2021-02-03 14:32:39', '2021-02-03 14:32:39'),
(704, 'Клубника и розы', 0, '&lt;p&gt;Яркий, сочный, вкусный букет!!! Хит продаж!!! Решение двух вопросов. Цветов и десерта!!! Все получательницы которые получали букет в подарок были в восторге!!! Дарите вкусные букеты!!!&lt;/p&gt;&lt;div&gt;Состав:&lt;/div&gt;&lt;div&gt;&lt;div&gt;Роза - 15 шт. &lt;/div&gt;&lt;div&gt;Клубника - 500 гр. &lt;/div&gt;&lt;div&gt;Шпажки деревянные - 23 шт. &lt;/div&gt;&lt;div&gt;Упаковка дизайнерская - 4 шт.&lt;/div&gt;&lt;div&gt;Лента атласная - 2 шт.&lt;/div&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/Vkusniebuketi/8_-_Sharm_Flovery-removebg-preview(1).png', 1, 1, 'Клубника и розы', 'Доставка букетов', '2021-02-03 14:34:59', '2021-02-03 14:34:59'),
(705, 'Ягодке моей', 0, '&lt;p&gt;Композиция с ягодами клубники, делается из свежей клубники, купленной по факту заказа! Необычное сочетание цветов и ягод!!! Будьте оригинальными!!!&lt;/p&gt;&lt;div&gt;Состав:&lt;/div&gt;&lt;div&gt;&lt;div&gt;Клубника шт - 15 шт. &lt;/div&gt;&lt;div&gt;Роза - 3 шт. &lt;/div&gt;&lt;div&gt;Роза кустовая - 5 шт. &lt;/div&gt;&lt;div&gt;Альстромерия - 3 шт. &lt;/div&gt;&lt;div&gt;зелень декоративная - 3 шт. &lt;/div&gt;&lt;div&gt;Астра - 1 шт. &lt;/div&gt;&lt;div&gt;Пенофлор - 1 шт. &lt;/div&gt;&lt;div&gt;Коробка - 1 шт. &lt;/div&gt;&lt;div&gt;Лента атласная - 2 шт.&lt;/div&gt;&lt;/div&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/Vkusniebuketi/9_-_Sharm_Flovery-removebg-preview(1).png', 1, 1, 'Ягодке моей', 'Доставка букетов', '2021-02-03 14:36:21', '2021-02-03 14:36:21'),
(706, 'Клубничка', 0, '&lt;p&gt;Композиция из цветов и ягод клубники. Отличное решение небольшого презента для любимой!!! Настроит на романтичное настроение!!!&lt;/p&gt;&lt;div&gt;Состав:&lt;/div&gt;&lt;div&gt;&lt;div&gt;Роза - 7 шт. &lt;/div&gt;&lt;div&gt;Клубника - 7 шт. &lt;/div&gt;&lt;div&gt;Коробка шляпная - 1 шт. &lt;/div&gt;&lt;div&gt;Пенофлор - 1 шт.&lt;/div&gt;&lt;div&gt; Тишью - 1 шт. &lt;/div&gt;&lt;div&gt;Лента атласная - 1 шт.&lt;/div&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/Vkusniebuketi/10_-_Sharm_Flovery-removebg-preview(1).png', 1, 1, 'Клубничка', 'Доставка букетов', '2021-02-03 14:37:34', '2021-02-03 14:37:34'),
(707, 'Валерия', 0, '&lt;p&gt;Воздушные ромашки в упаковке!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Хризантема кустовая - 9 шт.&lt;/p&gt;&lt;p&gt;Упаковка дизайнерская - 6 шт.&lt;/p&gt;&lt;p&gt;Лента атласная - 1 шт&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/1-SharmFlovery.png', 1, 1, 'Валерия', 'Доставка букетов', '2021-02-03 15:07:53', '2021-02-03 15:30:41'),
(708, 'Ромашковый букет хризантем', 0, '&lt;p&gt;Букет нежных хризантем в стильной упаковке. Актуален по любому поводу и без него!!! Подарить можно девушкам любого возраста и статуса!!! Доставим быстро, бережно, с любовью!!! Открытка от нашего салона прилагается в подарок с вашими пожеланиями и словами любви!!!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Хризантема кустовая - 9 шт.&lt;/p&gt;&lt;p&gt;Упаковка дизайнерская - 6 шт.&lt;/p&gt;&lt;p&gt;Лента атласная - 1 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/2_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Ромашковый букет хризантем', 'Доставка букетов', '2021-02-03 15:10:38', '2021-02-03 15:31:23'),
(709, '11 роз в крафт бумаге', 0, '&lt;p&gt;????Красивый букет из свежих цветов ????поможет передать все ваши самые теплые и нужные слова!???? Подарите своим близким хорошее настроение и приятные эмоции! Букет подойдёт в качестве основного подарка, а так же в качестве комплимента без повода! Дарите цветы и радость! Не ждите праздника!????????&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза Эквадор - 11 шт.&lt;/p&gt;&lt;p&gt;Оформление - 1 шт.&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/3_-_Sharm_Flovery-removebg-preview.png', 1, 1, '11 роз в крафт бумаге', 'Доставка букетов', '2021-02-03 15:17:20', '2021-02-12 11:58:44');
INSERT INTO `products` (`id`, `name`, `partner_id`, `description`, `short_description`, `price`, `sku`, `stock_status`, `quantity`, `image`, `status`, `moderated`, `slug`, `category`, `created_at`, `updated_at`) VALUES
(710, '11 роз', 0, '&lt;p&gt;Бело-салатовые розы сорта Мондиаль очень хорошо стоят в срезке, они имеют большой бокал бутона, богатую насыщенную зелень, а тонкий аромат добавляет им изысканный шарм.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза Эквадор Мондиаль - 11 шт.&lt;/p&gt;&lt;p&gt;Упаковка дизайнерская - 1 шт.&lt;/p&gt;&lt;p&gt;Лента атласная - 2 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/4_-_Sharm_Flovery-removebg-preview.png', 1, 1, '11 роз', 'Доставка букетов', '2021-02-03 15:19:05', '2021-02-12 11:58:35'),
(711, 'Букет из красных роз Простая романтика', 0, '&lt;p&gt;Букет из красных роз в оформлении!!! Классический вариант презента. Классика актуальна всегда и во все вред. По любому поводу. Девушке любого возраста. Современная упаковка делает букет стильным.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Красная роза - 11 шт.&lt;/p&gt;&lt;p&gt;Оформление - 1 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/5_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Букет из красных роз Простая романтика', 'Доставка букетов', '2021-02-03 15:22:18', '2021-02-03 15:33:01'),
(712, '31 роза микс', 0, '&lt;p&gt;Яркий, насыщенный букет, актуален по любому поводу и без него!!! Добавит ярких красок в эти холодные дни!!! Подарить можно всем любимым и родным. Мамам обязательно!!!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза - 31 шт.&lt;/p&gt;&lt;p&gt;Упаковка дизайнерская - 2 шт.&lt;/p&gt;&lt;p&gt;Лента атласная - 1 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/6_-_Sharm_Flovery-removebg-preview.png', 1, 1, '31 роза микс', 'Доставка букетов', '2021-02-03 15:23:48', '2021-02-03 15:33:30'),
(713, 'Пионовый блюз', 0, '&lt;p&gt;Букеты из пионовидных роз сейчас на пике популярности!!! Девушки их любят получать в подарок!!!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза кустовая пионовидная - 9 шт.&lt;/p&gt;&lt;p&gt;Упаковка дизайнерская - 6 шт.&lt;/p&gt;&lt;p&gt;Лента атласная - 1 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/7_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Пионовый блюз', 'Доставка букетов', '2021-02-03 15:26:47', '2021-02-03 15:26:47'),
(714, 'Пионовидные розы', 0, '&lt;p&gt;Нежные пионовидные розы-символ женственности, утонченности.&amp;nbsp; Нютовые, пастельные оттенки добавляют шарма в этот букет. Девушка будет в восторге от Вас с таким букетом!!!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза пионовидная кустовая - 7 шт.&lt;/p&gt;&lt;p&gt;Оформление - 1 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/8_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Пионовидные розы', 'Доставка букетов', '2021-02-03 15:29:16', '2021-02-03 15:29:16'),
(715, 'Букет из альстромерий', 0, '&lt;p&gt;Стойкий букет из альстромерий гарантированно будет долго радовать своего обладателя????. . Упаковка в крафт - это классическое оформление букета????&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Альстромерия микс - 11 шт.&lt;/p&gt;&lt;p&gt;Оформление матовая пленка - 3 шт.&lt;/p&gt;&lt;p&gt;Лента атласная - 1 шт.&lt;/p&gt;&lt;p&gt;зелень декоративная - 3 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/9_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Букет из альстромерий', 'Доставка букетов', '2021-02-03 15:37:16', '2021-02-03 15:37:16'),
(716, '17 роз', 0, '&lt;p&gt;Яркий букет роз!!! Готов радовать и передавать свои эмоции!!! Актуален по любому поводу и без него!!подарить такой букет всегда можно девушке любого возраста и статуса!!!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза Шангрила - 8 шт.&lt;/p&gt;&lt;p&gt;Роза желтая 50 см - 9 шт.&lt;/p&gt;&lt;p&gt;Пленка матовая - 2 шт.&lt;/p&gt;&lt;p&gt;Лента атласная - 1 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/10_-_Sharm_Flovery-removebg-preview.png', 1, 1, '17 роз', 'Доставка букетов', '2021-02-03 15:38:55', '2021-02-03 15:38:55'),
(717, 'Букет из 9 одноголовых хризантем', 0, '&lt;p&gt;Букет из 9 одноголовых прекрасных хризантем!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Хризантема - 9 шт.&lt;/p&gt;&lt;p&gt;Крафт упаковка - 1 шт.&lt;/p&gt;&lt;p&gt;Лента атласная - 1 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/11_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Букет из 9 одноголовых хризантем', 'Доставка букетов', '2021-02-03 15:40:38', '2021-02-03 15:40:38'),
(718, 'Радужный bouquet ????', 0, '&lt;p&gt;Почувствуй вкус лета???? Яркий и сочный букетик согреет получательницу своей красотой и Вашими намерениями❤️????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Гербера - 9 шт.&lt;/p&gt;&lt;p&gt;зелень писташ - 6 шт.&lt;/p&gt;&lt;p&gt;Упаковка дизайнерская - 6 шт.&lt;/p&gt;&lt;p&gt;Лента атласная - 1 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/12_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Радужный bouquet ????', 'Доставка букетов', '2021-02-03 15:42:30', '2021-02-03 15:42:30'),
(719, 'Букет пионовидных роз', 0, '&lt;p&gt;Эксклюзивные пионовидные розы Голландии, готовы стать Вашими!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Мэнсфилд парк кустовая пионовидная - 11 шт.&lt;/p&gt;&lt;p&gt;Крафт упаковка - 3 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/13_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Букет пионовидных роз', 'Доставка букетов', '2021-02-03 15:43:56', '2021-02-03 15:49:17'),
