(721, '3 лилии', 0, '&lt;p&gt;Нежная лилия - классический вариант презента. Сорт этой лилии имеет слабый нежный аромат. Нет кричащего запаха.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;лилии - 3 шт.&lt;/p&gt;&lt;p&gt;Эвкалипт - 3 шт.&lt;/p&gt;&lt;p&gt;Упаковка дизайнерская - 6 шт.&lt;/p&gt;&lt;p&gt;Лента атласная - 2 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/15_-_Sharm_Flovery-removebg-preview.png', 1, 1, '3 лилии', 'Доставка букетов', '2021-02-03 15:52:01', '2021-02-03 15:52:01'),
(722, 'Дон Пион', 0, '&lt;p&gt;&quot;Букет из пионов с эвкалиптом в оформлении! Самый стильный презент на сегодняшний день!!! Дарите самые стильные презентики для любимых, дорогих , ???????? они достойны дорогих цветов!!! Открытка от нашего салона прилагается в подарок с вашими пожеланиями и словами любви!!!! Доставим быстро, бережно, с любовью!!!!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Пион - 3 шт.&lt;/p&gt;&lt;p&gt;Эвкалипт - 1 шт.&lt;/p&gt;&lt;p&gt;Оформление - 1 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&quot;&lt;/p&gt;&lt;div&gt;&lt;br&gt;&lt;/div&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/16_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Дон Пион', 'Доставка букетов', '2021-02-03 16:14:41', '2021-02-03 16:14:41'),
(723, 'Букет кустовых пионовидных роз «Мисти баблс»', 0, '&lt;p&gt;Букет пионовидных роз шикарный подарок!!! Пионовидные розы сейчас хит продаж сезона!!! Толтко сейчас они такие большие с крупными бутонами!!! Нежный аромат роз покорит девушку!!!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза кустовая пионовидная - 5 шт.&lt;/p&gt;&lt;p&gt;стаффаж - 5 шт.&lt;/p&gt;&lt;p&gt;Оформление - 1 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/17_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Букет кустовых пионовидных роз «Мисти баблс»', 'Доставка букетов', '2021-02-03 16:17:58', '2021-02-03 16:17:58'),
(724, 'Комплимент', 0, '&lt;p&gt;Небольшой букет хризантем, в качестве комплимента самый оптимальный вариант!!!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Хризантема кустовая - 3 шт.&lt;/p&gt;&lt;p&gt;Упаковка дизайнерская - 2 шт.&lt;/p&gt;&lt;p&gt;Лента атласная - 1 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/18_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Комплимент', 'Доставка букетов', '2021-02-03 16:22:55', '2021-02-03 16:22:55'),
(725, 'Альстромерии микс', 0, '&lt;p&gt;????Красивый букет из свежих цветов ????поможет передать все ваши самые теплые и нужные слова!???? Подарите своим близким хорошее настроение и приятные эмоции! Букет подойдёт в качестве основного подарка, а так же в качестве комплимента без повода! Дарите цветы и радость! Не ждите праздника!????????&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;альстромерия микс - 9 шт.&lt;/p&gt;&lt;p&gt;Оформление пленка - 1 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/19_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Альстромерии микс', 'Доставка букетов', '2021-02-03 16:24:53', '2021-02-03 16:24:53'),
(726, '51 красная роза Эквадор', 0, '&lt;p&gt;Шикарная роза сорта Эксплорер, сорт премиум класса, очень хорошо чувствует себя в срезке.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза Эквадор 70 см - 51 шт.&lt;/p&gt;&lt;p&gt;Лента атласная - 2 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/20_-_Sharm_Flovery-removebg-preview.png', 1, 1, '51 красная роза Эквадор', 'Доставка букетов', '2021-02-03 16:26:57', '2021-02-03 16:26:57'),
