(728, 'Pinky pay', 0, '&lt;p&gt;Нежная коробочка в пудрово-розовом цвете.. Готова улететь к своей обладательнице!!! Цветы в композиции хорошо чувствуют себя в срезке и будут долго радовать получательницу!!! Универсальна как презент можно подарить жене, маме, любимой, коллеге и даже преподавателю!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Эустома - 3 шт.&lt;/p&gt;&lt;p&gt;Хризантема кустовая - 4 шт.&lt;/p&gt;&lt;p&gt;Гвоздика - 3 шт.&lt;/p&gt;&lt;p&gt;Альстромерия - 3 шт.&lt;/p&gt;&lt;p&gt;Роза кустовая - 3 шт.&lt;/p&gt;&lt;p&gt;Коробка шляпная - 2 шт.&lt;/p&gt;&lt;p&gt;Лента атласная - 3 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/22_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Pinky pay', 'Доставка букетов', '2021-02-03 16:33:23', '2021-02-03 16:33:23'),
(729, 'True lavender', 0, '&lt;p&gt;Композиция в коробке собрана на оазисе и не требует дополнительно вазы, поэтому можно подарить на работе или дома она станет украшением праздничного стола. Сиреневые, фиолетовые и белые цвета гармонично сочетаются в букете и подойдут для подарка по любому поводу он.&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Коробка - 1 шт.&lt;/p&gt;&lt;p&gt;Эустома - 1 шт.&lt;/p&gt;&lt;p&gt;Хризантема кустовая - 1 шт.&lt;/p&gt;&lt;p&gt;Роза кустовая - 1 шт.&lt;/p&gt;&lt;p&gt;Альстромерия - 1 шт.&lt;/p&gt;&lt;p&gt;Диантус кустовой - 1 шт.&lt;/p&gt;&lt;p&gt;зелень декоративная - 3 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/23_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'True lavender', 'Доставка букетов', '2021-02-03 16:38:22', '2021-02-03 16:38:22'),
(730, 'Композиция из кустовой розы и диантуса Кристалл', 0, '&lt;p&gt;Композиция из кустовой розы, сортовой гвоздики и эвкалипта!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Коробка - 1 шт.&lt;/p&gt;&lt;p&gt;Оазис - 1 шт.&lt;/p&gt;&lt;p&gt;Кустовая роза - 5 шт.&lt;/p&gt;&lt;p&gt;Эвкалипт - 2 шт.&lt;/p&gt;&lt;p&gt;Гвоздика сортовая - 5 шт.&lt;/p&gt;&lt;p&gt;Оформление - 1 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/24_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Композиция из кустовой розы и диантуса Кристалл', 'Доставка букетов', '2021-02-03 16:41:03', '2021-02-03 16:41:03'),
(731, 'Present XXXL', 0, '&lt;p&gt;Коробочки с цветами сейчас на пике популярности. Пользуются спросом у наших клиентов! Цветы отлично чувствуют себя в срезке, не трек особого ухода. Девушки любят получать такие цветочные презенты. Это стильно, это модно, это современно. Нашу коробочку можно подарить девушкам любого возраста и статуса!!! Актуальна по любому поводу и без него! Хризантемы символ любви и верности.&lt;/p&gt;&lt;p&gt;Хризантема Кустовая Бакарди белая - 15 шт.&lt;/p&gt;&lt;p&gt;Пенофлор - 2 шт.&lt;/p&gt;&lt;p&gt;Коробка шляпная - 1 шт.&lt;/p&gt;&lt;p&gt;Лента атласная - 3 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/25_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Present XXXL', 'Доставка букетов', '2021-02-03 16:43:17', '2021-02-03 16:43:17'),
(732, 'Сердце из роз', 0, '&lt;p&gt;Сердце из роз растопит любое сердечко, и станет отличным подарком к любому событию ❤️&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;Роза - 19 шт.&lt;/p&gt;&lt;p&gt;Коробка - 1 шт.&lt;/p&gt;&lt;p&gt;Оазис флористический - 1 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/26_-_Sharm_Flovery-removebg-preview.png', 1, 1, 'Сердце из роз', 'Доставка букетов', '2021-02-03 16:45:49', '2021-02-03 16:45:49'),
