(734, 'Коробка с цимбидиумом Розовый Клэр', 0, '&lt;p&gt;Коробочка с цимбидиумом и эвкалиптом!&lt;/p&gt;&lt;p&gt;Состав:&lt;/p&gt;&lt;p&gt;ЦИМБИДИУМ - 7 шт.&lt;/p&gt;&lt;p&gt;Эвкалипт - 1 шт.&lt;/p&gt;&lt;p&gt;Оазис - 1 шт.&lt;/p&gt;&lt;p&gt;Коробка - 1 шт.&lt;/p&gt;&lt;p&gt;ВНИМАНИЕ!!!&amp;nbsp;&lt;/p&gt;&lt;p&gt;Оформление (коробка, ленточка и т.д.) могут меняться в зависимости от их наличия. Если такое случится мы Вам сообщим.&amp;nbsp;&lt;/p&gt;&lt;p&gt;*В дополнение у Нас в салоне можно подобрать стильные упаковочные пакеты???? открытки???? мягкие игрушки???? шары????&amp;nbsp;&lt;/p&gt;&lt;p&gt;И просто советы по уходу за цветами????&amp;nbsp;&lt;/p&gt;&lt;p&gt;Наша команда с удовольствием поможет вам вовремя осуществить доставку????????????&lt;/p&gt;', '', 0, '', 'instock', 1000, 'catalog/Samara/buketi/28_Samara.png', 1, 1, 'Коробка с цимбидиумом Розовый Клэр', 'Доставка букетов', '2021-02-03 16:52:33', '2021-02-04 13:19:09'),
